"SWPH01" : "<div class=Section1><h1 class=helpfile>Hjelp </h1><p>I skjermbildene Grunnleggende innstillinger kan du konfigurere, oppgradere og kontrollere statusen til den trådløse NETGEAR-ruteren for kabel/DSL.</p> <p>Klikk på et element i kolonnen lengst til venstre. De gjeldende innstillingene eller informasjonen for det området vises i den midterste kolonnen. </P><p>I denne kolonnen finner du nyttig informasjon om det valgte kjermbildet for innstillinger. Hvis du bruker Internet Explorer, kan du klikke på et element i den midterste kolonnen for å gå rett til den relaterte hjelpen. Ellers ruller du ned til du finner den. <hr><a name=bsetting></a></P><P><font size=4><B>Hjelp for grunnleggende innstillinger</B></font></P><p><B>Merk:</B> Hvis du konfigurerer ruteren for første gang, kan det hende at du kan bruke standardinnstillingene uten å endre dem. <a name=question></a></P><p><B>Krever Internett-tilkoblingen pålogging?</B> </P><p>Velg dette alternativet på grunnlag av hvilken type konto du har hos Internett-leverandøren. Hvis du må oppgi påloggingsinformasjon hver gang du kobler deg til Internett, eller hvis du har en PPPoE-konto hos Internett-leverandøren, velger du <B>Ja</B>. I motsatt fall velger du <B>Nei</B>. </p><p><B>Merk: </B>Hvis du har installert PPP-programvare som WinPoET (fra Earthlink) eller Enternet (fra PacBell), har du PPPoE. Klikk på <B>Ja</B>. Når du har klikket på Ja og konfigurert ruteren, trenger du ikke å kjøre PPP-programvaren på PC-en for å koble til Internett.</p> <a name=isp></a><h2 class=helpfile>Internett-leverandør</h2><p>Velg tjenesten som tilbys av Internett-leverandøren. <B>Andre </B>(PPPoE) er vanligst. <B>PPTP</B> brukes i Østerrike og andre europeiske land. </p><a name=login></a><h2 class=helpfile>Logg på </h2><p>Dette er vanligvis navnet som du bruker i e-postadressen din. Hvis for eksempel e-postkontoen du bruker mest, er JerAB@ISP.com, skriver du JerAB i dette feltet. </p><p>Enkelte Internett-leverandører (som Mindspring, Earthlink og T-DSL) krever at du bruker hele e-postadressen når du logger deg på. Hvis Internett-leverandøren krever at du bruker hele e-postadressen, skriver du den inn i feltet <B>Pålogging</B>. </p><a name=password></a><h2 class=helpfile>Passord</h2><p>Angi passordet som du bruker til å logge på Internett-tjenesten. </p><a name=serv_name></a><h2 class=helpfile>Godkjenningsserver</h2><p>Skriv inn adressen (enten IP-adresse eller domenenavn) til Internett-leverandørens server.</p><a name=idletime></a><h2 class=helpfile>Tidsavbrudd ved inaktivitet</h2><p>En inaktiv Internett-tilkobling avsluttes etter denne tidsperioden.</P><p>Hvis denne verdien er null (0), forblir tilkoblingen oppe – hvis du mister tilkoblingen, gjenopprettes den umiddelbart.</p><a name=DNSaddress></a><h2 class=helpfile>DNS-adresse (Domain Name Server) </h2><p>DNS-serveren brukes til å slå opp områdeadresser basert på navnene. </p><p>Hvis du fikk én eller to DNS-adresser av Internett-leverandøren, merker du av for <B>Bruk disse DNS-serverne</B> og skriver inn den primære og den sekundære adressen. </p><p>I motsatt fall velger du <B>Hent automatisk fra Internett-leverandør</B>. </p><p><B>Merk: </B>Hvis du får feilmeldingen Finner ikke adresse når du går til et webområde, er det mest sannsynlig fordi DNS-serverne ikke er riktig konfigurert. Da bør du kontakte Internett-leverandøren for å få DNS-serveradresser. </p><h2 class=helpfile><a name=localaddress></a>Ruterens MAC-adresse </h2><p>Hver datamaskin eller ruter i nettverket har en unik 48-biters lokal Ethernet-adresse. Dette kalles også datamaskinens MAC-adresse (MAC = Media Access Control). </p><p>Du kan vanligvis merke av for <B>Bruk standardadresse</B>.</p><p>Hvis Internett-leverandøren krever MAC-godkjenning, merker du enten av for <B>Bruk datamaskinens MAC-adresse</B> for at ruteren skal bruke MAC-adressen til datamaskinen du bruker nå, eller så merker du av for <B>Bruk denne MAC-adressen</B> og skriver manuelt inn MAC-adressen Internett-leverandøren ber om.</p> <p>Formatet for MAC-adressen er XX:XX:XX:XX:XX:XX. Hvis du merker av for <B>Bruk denne MAC-adressen </B>og skriver inn en MAC-adresse, må du ikke merke av for <B>Bruk datamaskinens MAC-adresse</B>, for da blir oppføringen overskrevet.</p><a name=buttons> </a><h2 class=helpfile>Knappene Bruk, Avbryt og Test</h2><p>Klikk på <B>Bruk</B> når du er ferdig med å endre innstillingene. </p><p>Klikk på <B>Avbryt</B> for å gå tilbake til de forrige innstillingene. </p><p>Klikk på <B>Test</B> for å koble til webområdet til NETGEAR. Hvis du får koblet til, er innstillingene riktige, og du kan klikke på <B>Logg av</B> for å gå ut av disse skjermbildene og ... begynne å surfe på Internett!</p><p>Hvis du har problemer med tilkoblingen: </p><ul><li>Gå gjennom innstillingene og kontroller at du har valgt de riktige alternativene og skrevet inn alt riktig. </li><li>Kontakt Internett-leverandøren for å få bekreftet konfigurasjonsinformasjonen. </li><li>Les feilsøkingsdelen i <I>installeringsveiledningen</I> for enheten.</li><li>På <I>ressurs-CD-en</I> for enheten leser du <I>konfigureringshåndboken</I> eller feilsøkingsdelen i <I>referansehåndboken</I>.</li><li>Kontakt NETGEARs kundestøtte.</li></ul> </div>",
"SWPH02" : " <P><font size=4><B>     Hjelp for konfigureringsveiviseren (Setup Wizard) </B></font></P>  <p>Konfigureringsveiviseren har oppdaget at det allerede er opprettet en aktiv Internett-tilkobling. Siden det ikke ser ut som om Internett-tilkoblingen fungerer korrekt, er det ikke sikkert at du trenger å fortsette med konfigureringsveiviseren. Hvis du velger å fortsette med konfigureringsveivisere, kan det hende at den gjeldende konfigurasjonen blir endret. NETGEAR anbefaler at du sikkerhetskopierer de gjeldende innstillingene før du fortsetter med konfigureringsveivisere. <p>Gjør følgende for å fortsette:<ol> <li>Klikk på <b>Ja (Yes)</b> hvis du vil fortsette med Setup Wizard.<br><li>Klikk på <b>Nei (No)</b> for å avslutte Setup Wizard og beholde den eksisterende Internett-tilkoblingen.</ol> <p>Slik sikkerhetskopierer du innstillingene:<ol> <li>Klikk på <b>Nei (No)</b> for å avslutte Setup Wizard og beholde den eksisterende Internett-tilkoblingen.<li>Klikk på <b>Sikkerhetskopier innstillinger (Back up Settings)</b> i navigasjonsfeltet for å åpne skjermbildet Sikkerhetskopier (Backup).<br><li>Når innstillingene er lagret, kjører du Setup Wizard på nytt.</ol> ",
"SWPH03" : "<P><font size=4><B>Hjelp for Smart Setup Wizard </B></font></P>             <p>Når du har koblet ruteren til nettverket, må den konfigureres. Det kan du gjøre ved å bruke Smart Setup Wizard. Veiviseren prøver automatisk å identifisere hvilken type Internett-tjeneste du har gjennom Internett-leverandøren. Du kan også konfigurere ruteren manuelt. Hvis du ikke har erfaring med å konfigurere Internett-tilkoblinger, bør du la Smart Setup Wizard gjøre noe av jobben for deg.<p>Når du skal konfigurere ruteren, bruker du informasjonen du oppga tidligere i <I>installasjonsveiledningen</i>.<p>Slik kommer du i gang:<ol> <li>Velg <b>Ja (Yes)</b> hvis du vil bruke Smart Setup Wizard,<br>eller<br>velg <b>Nei (No)</b> for å konfigurere ruteren manuelt.<li>Klikk på <b>Neste (Next)</b>.</ol>",
