"AWCH01" : "<P><font size=4><B>Hjelp for Legg til WPS-klient</B></font></P><p><a name=internet></a><a name=meter></a>WPS står for Wi-Fi Protected Setup. Med denne funksjonen kan du legge til en trådløs klient i nettverket uten at du trenger å konfigurere de trådløse innstillingene (for eksempel SSID, sikkerhetsmodus og passord).<p>Du kan legge til en trådløs klient som støtter WPS ved hjelp av trykknappmetoden.<p>Med trykknappmetoden kan du fullføre WPS-prosessen ved å trykke på eller klikke på en WPS-knapp på klienten (enten en fysisk maskinvareknapp eller en programvareknapp på klientens verktøygrensesnitt). Se kundens WPS-instruksjoner for mer informasjon.</p>",
