"SBSW09" : "<HR><A name=security></A> <B>Smart Connect</B><P>Aktiver Smart Connect for å la ruteren velge det beste WiFi-båndet, 2,4 GHz eller 5 GHz, til WiFi-tilkoblingene. Smart Connect balanserer WiFi-innlastingen og utnytter nettverket ditt best mulig. Smart Connect krever at 2,4 GHz- og 5 GHz-nettverkene bruker samme WiFi-nettverksnavn (SSID), sikkerhetsalternativer og passord.</P><HR>",
