"SGNH01" : "<P><font size=4><B>Innstillinger for gjestenettverk  </B></font></P><p><b>Gjennom disse innstillingene kan du gi besøkende tilgang til Internett hjemme hos deg hvis du ikke vil at de skal få vite sikkerhetskoden for trådløs tilgang.</b></p><HR><A name=network></A><A name=wireless></A><P><B>Trådløsinnstillingene til profilen</B></P><A name=enable_guest></A><p>Aktiver gjestenettverk <p>Hvis det er merket av for dette alternativet, er dette gjestenettverket aktivert. Du og de besøkende kan koble til nettverket via SSID-en for denne profilen.<A name=enable_ssid></A><p>Aktivere SSID Broadcast <p>Hvis dette alternativet er aktivert, vil det trådløse tilgangspunktet sende ut navnet (SSID) til alle trådløse stasjoner. Stasjoner som ikke har en SSID (eller en nullverdi), kan deretter ta i bruk riktig SSID for tilkoblinger til dette tilgangspunktet.<A name=allow_guest></A><p>Tillat at gjester kan se hverandre og få tilgang til mitt lokale nettverk <p>Når du fjerner avmerkingen, kan brukerne som er knyttet til dette gjestenettverket bare få tilgang til Internett og kan ikke få tilgang til andre enheter på samme nettverk eller andre nettverk, inkludert hovednettverket og det kablede nettverket. I tillegg kan ingen av klientene i dette gjestenettverket få tilgang til ruterens administrasjonsbrukergrensesnitt eller andre tjenester som tilbys av ruteren (for eksempel ReadySHARE Storage, ReadySHARE Printer... hvis ruteren støtter disse funksjonene).<br>Hvis du merker av, kan brukerne som er koblet til dette gjestenettverket ikke bare få tilgang til Internett, men også alle enheter på lokale nettverk, inkludert hovednettverket og det kablede nettverket.<A name=guest_ssid></A><p>Navn på det trådløse nettverket gjesten skal bruke (SSID) <p>Angi en verdi på opptil 32 alfanumeriske tegn. Det samme navnet (SSID) må tilordnes til alle de trådløse enhetene i nettverket. Standard SSID er NETGEAR_Guest, men NETGEAR anbefaler sterkt at du endrer nettverkets navn (SSID) til en annen verdi. I denne verdien skilles det også mellom små og store bokstaver. <i>NETGEAR</i> er for eksempel ikke det samme som <i>NETGEAr</i>.</p><HR><A name=security></A><p><b>Sikkerhetsalternativer</b></p><UL><LI>Ingen – ingen datakryptering<LI>WEP – Wired Equivalent Privacy. Bruk WEP 64- eller 128-biters datakryptering<br><b>Merk: </b>Wi-Fi Protected Setup-funksjonen er deaktivert når sikkerhetsinnstillingen er WEP.<LI>WPA2-PSK [AES] – Wi-Fi Protected Access versjon 2 med forhåndsdelt nøkkel. Bruk standard WPA2-PSK-kryptering med AES-krypteringstypen<LI>WPA-PSK [TKIP] + WPA2-PSK [AES] – tillat klienter som bruker enten WPA-PSK [TKIP] eller WPA2-PSK [AES]<LI>Bedrifts-WPA/WPA2 – Dette alternativet støtter 802.1x-godkjenning, ikke for hjemmebruk, og du må ha en RADIUS-server i nettverket.</LI></UL><p>Hvis du vil oppnå best mulig ytelse med trådløse 11N-kort eller robuste sikkerhetsnettverk, anbefaler NETGEAR at du endrer sikkerhetsalternativet for nettverket til WPA2-PSK.</p><HR><A name=wep></A><p><b>Sikkerhetskryptering (WEP)  </b></p><P>Godkjenningstype <p>Vanligvis kan du bruke standardverdien Automatisk. Kortene kan bruke enten Åpent system eller Delt nøkkel til godkjenning. Hvis du vil ha bedre sikkerhetsgodkjenning, kan du velge Delt nøkkel, slik at de trådløse kortene bare kan bruke Delt nøkkel til å koble til dette nettverket.<p>Krypteringsstyrke <p>Velg WEP-krypteringsnivå: <UL><LI>64-biters (noen ganger kalt 40-biters) kryptering <LI>128-biters kryptering </LI></UL><HR><A name=wepkey></A><p><b>Sikkerhetskrypteringsnøkkel (WEP)</b></p><p>Hvis WEP er aktivert, kan du programmere de fire datakrypteringsnøklene manuelt. Disse verdiene må være identiske for alle PC-er og tilgangspunkter i nettverket. <p>Velg hvilken av de fire nøklene som skal brukes, og skriv inn den tilhørende WEP-nøkkelinformasjonen for nettverket i den valgte nøkkelboksen. <p>For 64-biters WEP – skriv inn 10 heksadesimale sifre (enhver kombinasjon av 0–9 og A–F). <p>For 128-biters WEP – skriv inn 26 heksadesimale sifre (enhver kombinasjon av 0–9 og A–F). <p>Pass på at du klikker på Bruk for å lagre innstillingene på denne menyen.</P><HR><A name=wpa-psk></A><p><b>Sikkerhetskryptering (WPA2-PSK)</b></p><p>WPA2 er en nyere versjon av WPA. Velg dette alternativet bare hvis alle trådløsklientene i nettverket støtter WPA2. Hvis dette alternativet velges, må du bruke AES-kryptering og angi WPA-passordet (nettverksnøkkelen). Skriv inn et ord eller en gruppe utskrivbare tegn i boksen Password (Passord). Passordet må bestå av 8 til 63 ASCII-tegn eller nøyaktig 64 heksadesimale sifre. Et heksadesimalt siffer er ett av følgende tegn: <br>0, 1, 2, ..., 8, 9, A, B, C, D, E og F. </p><HR><A name=wpa-psk+wpa2-psk></A><p><b>Sikkerhetskryptering (WPA-PSK + WPA2-PSK)  </b></p><p>Med dette alternativet kan klienter bruke enten WPA (med TKIP, kringkastede pakker bruker også TKIP) eller WPA2 (med AES). Hvis dette alternativet velges, må krypteringen være TKIP + AES. Du må også angi WPA-passordet (nettverksnøkkelen). For at du skal få maksimal trådløs ytelse, må 11N-klienter kobles til denne ruteren ved hjelp av WPA2-PSK (med AES). For klienter som kobler til via WPA-PSK (med TKIP), er den maksimale trådløshastigheten 802.11g. Skriv inn et ord eller en gruppe utskrivbare tegn i boksen Passord. Passordet må bestå av 8 til 63 ASCII-tegn eller nøyaktig 64 heksadesimale sifre. Et heksadesimalt siffer er ett av følgende tegn: <br>0, 1, 2, ..., 8, 9, A, B, C, D, E og F. </p><HR><A name=wpawpa2></a><p><b>Sikkerhetskryptering (WPA/WPA2 Enterprise)</b></p><p>Dette alternativet støtter 802.1x-godkjenning, ikke for hjemmebruk, og du må ha en RADIUS-server i nettverket. <b>WPA-modusen</b> inkluderer WPA [TKIP], WPA2 [AES] og WPA [TKIP] + WPA2 [AES] (standardverdi). <b>IP-adressen til RADIUS-serveren</b> er IP-adressen til RADIUS-serveren (godkjenningsserver) som IKKE kan være den samme som ruterens IP-adresse som konfigureres av brukeren. Og denne godkjenningsserveren kan være på enten WAN-siden eller LAN-siden. Verdiområdet til <b>RADIUS-serverporten</b> er fra <b>1 til 65535</b>, og standardverdien er 1812. <b>Den delte RADIUS-serverhemmeligheten</b> må bestå av <b>64 tegn</b> (oktetter), og standardverdien er tom. Den støtter fem EAP-godkjenningsmetoder: EAP-TLS, EAP-TTLS/MSCHAPv2, PEAPv0/EAP-MSCHAPv2, PEAPv1/EAP-GTC og EAP-SIM.</p><HR><p><b>Slik lagrer eller avbryter du endringer:</b></p><p>Klikk på <b>Bruk</b> for at endringene skal bli aktivert. <br>Klikk på <b>Avbryt</b> for å gå tilbake til de forrige innstillingene. </p>",
