"UBS018" : "<p>ReadySHARE Cloud-funksjonen gir deg ekstern tilgang via Internett til en USB-lagringsenhet som er koblet til ruterens USB-port.</p><p><b>Slik konfigurerer du ReadySHARE Cloud</b></p><p>Trinn 1: Du trenger en ReadySHARE Cloud-konto. Hvis du ikke har en, kan du<a class=&quot;&quot;linktype&quot;&quot; target=&quot;&quot;_blank&quot;&quot; href=&quot;&quot;https://readyshare.netgear.com/site/index.jsp?pid=4&src=device&quot;&quot;>klikke her</a> for å få en.</p><p>Trinn 2: På denne siden angir du brukernavnet og passordet for ReadySHARE Cloud for å registrere ruteren og USB-enheten som er tilkoblet kontoen din.</p><p>Trinn 3: Logg på <a class=&quot;&quot;linktype&quot;&quot; target=&quot;&quot;_blank&quot;&quot; href=&quot;&quot;http://readyshare.netgear.com/&quot;&quot;>http://readyshare.netgear.com/</a> igjen med kontoen din. Du vil se USB-enheten som er tilkoblet ruteren.</p><p>Trinn 4: Den første gangen blir du bedt om å laste ned en Windows-klient, som brukes til å foreta en sikker tilkobling fra PC-en til ruterens USB-enhet. Logg på denne klienten slik at du kan få tilgang til USB-enheten overalt.</p><p><b>Merk:</b> Uten denne klienten kan du bla gjennom innholdet på USB-enheten, men du kan ikke åpne filer eller foreta endringer i dem</p>",
