"UBSH01" : "<P><font size=4><B>Hjelp for ReadySHARE Printer</B></font></P><p>ReadySHARE Printer gjør at Windows PC-er og Mac-datamaskiner kan dele med en USB-skriver tilknyttet ruterens USB-port.</p>",
"UBSH02" : "<P><font size=4><B>Hjelp for ReadySHARE Cloud</B></font></P><p>ReadySHARE Cloud-funksjonen gir deg ekstern tilgang via Internett til en USB-lagringsenhet som er tilkoblet ruterens USB-port, uansett hvor du er. Du kan også invitere familiemedlemmer eller venner til å få tilgang til den.</p><p><b>Slik konfigurerer du ReadySHARE Cloud</b></p><p>Trinn 1: Du trenger en ReadySHARE Cloud-konto. Hvis du ikke har en, kan du klikke på koblingen på denne siden for å gå til NETGEAR ReadySHARE Cloud-siden for å opprette en konto. <br/>Du blir bedt om å angi en gyldig e-postadresse som blir brukt til å gjenopprette brukernavnet og passordet ditt.<br/>Trinn 2: Etter Trinn 1 må du gå tilbake til dette ruternettstedet og angi ReadySHARE Cloud-brukernavnet og -passordet for å registrere ruteren og USB-enheten som er koblet til den.<br/>Dette registreringstrinnet må startes fra NETGEAR-ruteren, noe som betyr at du ikke kan registrere ruteren gjennom NETGEAR ReadySHARE Cloud-nettsiden <a target=&apos;_blank&apos; href=&apos;http://readyshare.netgear.com&apos;>http://readyshare.netgear.com</a>.<br/>Trinn 3: Logg på <a target=&apos;_blank&apos; href=&apos;http://readyshare.netgear.com&apos;>http://readyshare.netgear.com</a> igjen med kontoen din. Du vil se USB-enheten som er tilkoblet ruteren. Som standard er alt innholdet på USB-enheten tilgjengelig. Du kan opprette en ny delingsenhet som er begrenset til en del av innholdet med det sikkerhetsnivået du spesifiserer.<br/>Trinn 4: Den første gangen du bruker ReadySHARE Cloud, blir du bedt om å laste ned en Windows-klient, som brukes til å lage en sikker tilkobling fra PC-en til ruterens USB-enhet. Logg på denne klienten slik at du kan få tilgang til USB-enheten overalt.<br/>For øyeblikket kan du bare laste ned Windows OS-klienten. Mac OS-klienten blir tilgjengelig på et senere tidspunkt på nettstedet.<br/> <b>Merk:</b> Uten denne klienten kan du bare bla gjennom USB-enhetens innhold ved å klikke på ikonet \&quot;+\&quot; (Legg til delingsenhet) på nettstedet. Du vil ikke kunne åpne filene eller foreta endringer i dem. </p><p><b>Brukernavn og passord</b></p><p>Dette er ReadySHARE Cloud-kontoen du opprettet på NETGEAR-nettstedet under Trinn 1.<br/> Ruteren med USB-lagringsenheten vil bare vises etter at du har registrert den. Internett-tilkoblingen mellom ruteren på ReadySHARE Cloud-serveren vil være aktiv til du avregistrerer den.<br/> Du kan også registrere ruteren med en annen konto etter at du har avregistrert den fra den forrige kontoen.<br/></p>",
"UBSH03" : "<P><font size=\&quot;4\&quot;><B> Hjelp for USB-lagring (grunninnstillinger)</B></font></P><P><B>MERK: </B>Denne siden viser gjeldene innstillinger for USB-lagring. Hvis du vil redigere noen av innstillingene som er vist nedenfor, eller opprette en ny nettverksmappe, klikker du på Rediger. </P><P><a name=device></a><B> Nettverks-/enhetsnavn  </B></P><P> Navnet som brukes til å få tilgang til ruteren fra den bærbare eller stasjonære datamaskinen/PC-en. Du kan enten klikke på nettverks-/enhetsnavnet som vises i ruterens webgrensesnitt, for å få øyeblikkelig tilgang til lagringsenheten, eller du kan angi navnet i nettleseren, for eksempel //readyshare.</P><P><a name=available_folder></a><B> Tabell over tilgjengelige nettverksmapper</B></P><P> Denne tabellen viser alle nettverksmappene som er tilgjengelige og konfigurerte på ruteren:<UL><LI> Mappenavn: Den fullstendige banen til nettverksmappen som brukes. </LI><LI> Volumnavn: Volumnavnet fra lagringsenheten (enten USB-stasjon eller harddisk).</LI><LI> Total/ledig plass: Viser den gjeldende utnyttelsesgraden for lagringsenheten. </LI><LI> Navn på delt ressurs: Navnet som vises i ruterens webgrensesnitt. Du kan enten klikke på det for å få øyeblikkelig tilgang til lagringsenheten, eller du kan angi navnet i en nettleser, for eksempel //readyshare/bilder. Hvis \&quot;Not Shared\&quot; vises, har standardressursen for deling blitt slettet, og det finnes ingen andre delte ressurser for rotmappen. Klikk på koblingen for å endre denne innstillingen.</LI><LI> Lese-/skrivetilgang: Viser tillatelsene/tilgangskontrollene for nettverksmappen:<ul><li>&apos;All - no password&apos; gir alle brukere tilgang til nettverksmappen. </li><li>&apos;admin&apos; ber brukerne om å angi det samme brukernavnet og passordet som brukes til å få tilgang til ruterens webgrensesnitt. </li></ul></LI></UL></P><P><B> Knappen Rediger  </B></P><P> Klikk for å redigere noen av innstillingene som vises, eller for å opprette en ny nettverksmappe. </P><P><B> Knappen Trygg fjerning av USB-enhet  </B></P><P> Klikk for å fjerne én av eller alle USB-enhetene som er festet til ruteren, på en trygg måte. </P><P><B> Knappen Oppdater  </B></P><P>Klikk for å oppdatere siden, noe som er nyttig hvis du nettopp har koblet til en ny USB-enhet.</P>",
"UBSH04" : "<P><font size=4><B>Hjelp for ReadySHARE Cloud</B></font></P><p>ReadySHARE Cloud-funksjonen gir deg ekstern tilgang via Internett til en USB-lagringsenhet som er tilkoblet ruterens USB-port, uansett hvor du er. Du kan også invitere familiemedlemmer eller venner til å få tilgang til den.</p><p><b>Slik konfigurerer du ReadySHARE Cloud</b></p><p>Trinn 1: Du trenger en ReadySHARE Cloud-konto. Hvis du ikke har en, kan du klikke på koblingen på denne siden for å gå til NETGEAR ReadySHARE Cloud-siden for å opprette en konto. <br/>Du vil bli bedt om å angi en gyldig e-postadresse som vil bli brukt til å gjenopprette brukernavnet eller passordet ditt.<br/></p><p>Trinn 2: Etter trinn 1 må du gå tilbake til denne rutersiden og angi ditt brukernavn og passord for ReadySHARE Cloud for å registrere ruteren din og USB-enheten som er koblet til den.<br/>Dette registreringstrinnet må utføres fra NETGEAR-ruteren, noe som betyr at du ikke kan registrere ruteren via nettstedet til NETGEAR ReadySHARE Cloud<a target=&apos;_blank&apos; href=&apos;http://ReadySHARE.netgear.com&apos;>http://ReadySHARE.netgear.com</a>.<br/></p><p>Trinn 3: Logg på <a target=&apos;_blank&apos; href=&apos;http://ReadySHARE.netgear.com&apos;>http://ReadySHARE.netgear.com</a> igjen med kontoen din. Du vil se USB-enheten som er tilkoblet ruteren. Som standard er alt innholdet på USB-enheten tilgjengelig. Du kan opprette en ny deling som er begrenset til en del av innholdet med det sikkerhetsnivået du spesifiserer.<br/></p><p>Trinn 4: Første gang du bruker ReadySHARE Cloud, blir du bedt om å laste ned en Windows-klient, som brukes til å foreta en sikker tilkobling fra PC-en til ruterens USB-enhet. Logg på denne klienten slik at du kan få tilgang til USB-enheten overalt.<br/>For øyeblikket kan du bare laste ned Windows OS-klienten. Mac OS-klienten blir tilgjengelig på et senere tidspunkt på nettstedet.<br/> </p><b>Merk:</b> <p>Uten denne klienten kan du bare bla gjennom USB-enhetens innhold ved å klikke på ikonet &apos;+&apos; (Legg til delingsenhet) på nettstedet. Du vil ikke kunne åpne filene eller foreta endringer i dem.</p><p><b>Brukernavn og passord</b></p><p>Dette er ReadySHARE Cloud-kontoen du opprettet på NETGEAR-nettstedet under Trinn 1.<br/> Ruteren med USB-lagringsenheten vil bare vises etter at du har registrert den. Internett-tilkoblingen mellom ruteren og ReadySHARE Cloud-serveren vil være aktiv til du avregistrerer den.<br/> Du kan også registrere ruteren med en annen konto etter at du har avregistrert den fra den forrige kontoen.<br/></p>",
