"UAS031" : "<p>ReadyCLOUD-funksjonen gir deg ekstern tilgang via Internett til en USB-lagringsenhet som er koblet til ruterens USB-port.</p><p><b>Slik konfigurerer du ReadyCLOUD</b><br>Trinn 1: Du trenger en ReadyCLOUD-konto. Hvis du ikke har en,<a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/client/index.html#page=manage&quot;>klikker du her for å opprette en konto  </a> og velger &quot;Opprett konto&quot;.<br>Trinn 2: Gå tilbake til denne rutersiden og skriv inn ditt brukernavn og passord for ReadyCLOUD for å registrere ruteren din og USB-enheten som er koblet til den med ReadyCLOUD.<br>Trinn 3: Logg på <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/&quot;>http://readycloud-staging.netgear.com/</a> igjen med ReadyCLOUD-kontoen din. USB-enheten som er koblet til ruteren din, vises.<br><b>Merk:</b>Du kan bruke et supplerende eksternt program til å opprette en sikker kobling fra datamaskinen eller den mobile enheten til ruterens USB-enhet.<br>Logg på dette eksterne programmet slik at du kan få tilgang til USB-enheten overalt. <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/client/cloud_download.html&quot;>Klikk her</a> for å få det eksterne programmet.</p>",
