"UAS041" : "<P><font size=4><B>Hjelp for ReadyCLOUD</B></font></P><p>ReadyCLOUD-funksjonen gir deg ekstern tilgang via Internett til en USB-lagringsenhet som er tilkoblet ruterens USB-port, uansett hvor du er. Du kan også invitere familiemedlemmer eller venner til å få tilgang til den.</p><p><b>Slik konfigurerer du ReadyCLOUD</b></p><p><ul><li>Trinn 1: Du trenger en ReadyCLOUD-konto. Hvis du ikke har en konto, kan du klikke på koblingen på denne siden for å gå til NETGEAR ReadyCLOUD-siden og opprette en. <br>Du vil bli bedt om å angi en gyldig e-postadresse som vil bli brukt til å gjenopprette brukernavnet eller passordet ditt.<br><li>Trinn 2: Etter trinn 1 må du gå tilbake til denne rutersiden og angi ditt brukernavn og passord for ReadyCLOUD for å registrere ruteren din og USB-enheten som er koblet til den.<br>Dette trinnet av registreringen må startes fra NETGEAR-ruteren. Du kan ikke registrere ruteren din gjennom NETGEAR ReadyCLOUD-nettstedet<a target=&apos;_blank&apos; href=&apos;http://readycloud-staging.netgear.com&apos;>http://readycloud-staging.netgear.com</a><br><li>Trinn 3: Logg på <a target=&apos;_blank&apos; href=&apos;http://readycloud-staging.netgear.com&apos;>http://readycloud-staging.netgear.com</a> igjen med ReadyCLOUD-kontoen din. USB-enheten som er koblet til ruteren din, vises. Som standard er alt innholdet på USB-enheten tilgjengelig. Du kan opprette en ny deling som er begrenset til en del av innholdet med det sikkerhetsnivået du spesifiserer.<br></ul></p><p><b>Merk:</b> Du kan bruke et supplerende eksternt program til å opprette en sikker kobling fra datamaskinen eller den mobile enheten til ruterens USB-enhet.<br>Logg på dette eksterne programmet slik at du kan få tilgang til USB-enheten overalt. <a target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/client/cloud_download.html&quot;>Klikk her</a> for å få det eksterne programmet.</p><p><b>Brukernavn og passord</b></p><p>Dette er brukernavnet og passordet for ReadyCLOUD som du opprettet.<br> Ruteren og USB-enheten vises bare etter at du har registrert dem. Internett-tilkoblingen mellom ruteren og ReadyCLOUD-serveren vil være aktiv til du avregistrerer den.<br> Du kan også registrere denne ruteren med en annen konto etter at du har avregistrert den fra den forrige kontoen.</p>",
