"UAS049" : "<p>ReadyCLOUD gir deg ekstern tilgang via Internett til en USB-lagringsenhet som er koblet til ruterens USB-port. Du må ha en ReadyCLOUD-konto for å bruke ReadyCLOUD. Hvis du ikke har en ReadyCLOUD-konto, kan du<a id=&quot;link_rc_info1&quot; class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>klikke her</a> og deretter klikke på <b>Logg på > Opprett konto</b>. </p><p><b>Slik konfigurerer du ReadyCLOUD</b></p><p><ol><li>Koble en USB-lagringsenhet til ruterens USB-port.</li><li>Angi brukernavnet og passordet for ReadyCLOUD i feltene nedenfor, og klikk på knappen <b>Registrering</b>. Ruteren og USB-enheten din er registrert med ReadyCLOUD.</li><li> Gå til <a id=&quot;link_rc_info2&quot; class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>http://readycloud.netgear.com</a>, klikk på Logg på, angi brukernavnet og passordet ditt for ReadyCLOUD, og klikk på knappen <b>Logg på</b>.</li></ol></p><p>      Du kan også bruke ReadyCLOUD-appen til å opprette en sikker tilkobling mellom datamaskinen eller den mobile enheten din og ruterens USB-lagringsenhet.<br>      <a id=&quot;link_rc_info3&quot; class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com/client/cloud_download.html&quot;>Klikk her</a> for å laste ned ReadyCLOUD-appen.</p>",
