"UMS017" : "<P><font size=4><B>Hjelp for medieserver (innstillinger)</B></font></P> <P> Du kan bruke ruteren som en ReadyDLNA-medieserver som gir medier i DLNA-kompatibel form til DLNA- og UPnP AV-kompatible mediespillere. Da kan du spille av videoer, filmer og bilder fra kompatible mediespillere som Xbox360, PlayStation og NETGEARs Digital Entertainer Live.</P><P>Du kan også aktivere iTunes Media-serveren og spille av musikk på USB-lagringsenheten med iTunes og Apple Remote.</P><B><P> Aktiver DNLA Media Server </P></B><P> Velg denne avmerkingsboksen for å aktivere ruteren til å fungere som en ReadyDLNA-medieserver. </P><B><P> Aktiver TiVo-støtte </P></B><P> Velg denne avmerkingsboksen for å tillate at TiVo-enheter kan spille av medier på en USB-lagringsenhet som er koblet til ruterens USB-port.</P><B><P> Aktivere iTunes Media Server (kun musikk) </P></B><P> Velg denne avmerkingsboksen for å bruke iTunes og Apple Remote til å spille av musikk på en USB-lagringsenhet som er koblet til ruteren. Når du kobler USB-enheten til ruterens USB-port, kan du se musikkbiblioteket som er på USB-enheten i iTunes-appen på Mac- og Windows-datamaskinene dine. iTunes Media Server støtter flere filformater, inkludert MP3, AAC, FLAC, WAV og WMA.</P><B><P> Angi passordet som vises på Remote-appen</P></B><P> Apple Remote er en app for iPhone- og iPad-enheter. Den kan kontrollere hvordan musikk på USB-enheten spilles av på airplay-enheter. Når du prøver å legge til et nytt bibliotek i Apple Remote-appen, vises et firesifret passord. Angi dette passordet i feltet, og klikk på knappen Gi kontroll. Da vil Apple Remote-appen vise musikkbiblioteket på USB-enheten som er koblet til ruterens USB-port. </P><B><P> Medieserver/enhetsnavn</P></B><P> Dette er medieservernavnet som brukes til både DLNA-medieserveren og iTunes-medieserveren. Medieservernavnet er det samme som enhetsnavnet. Standardnavnet er ruterens modellnummer. Hvis du vil endre navnet, klikker du på koblingen Kontroller her for å endre enhetsnavnet og skriver inn et nytt navn.</P>",
