"UMSH01" : "<P><font size=4><B>Hjelp for medieserver (innstillinger)</B></font></P> <P>Hvis denne enheten angis som en ReadyDLNA-medieserver, kan det spilles av videofilmer og bilder på mediespillere som er i samsvar med DLNA/UPnP AV, for eksempel Xbox360, Playstation og NETGEARs Digital Entertainer Live.</p><p>ReadyDLNA innebærer at denne enheten kan behandle medier i DLNA-kompatibelt format for mediespillere som er i samsvar med DLNA/UPnP AV </p> <ul><li><a name=dlna_enable></a><b>Aktiver medieserver</b> aktiverer denne enheten, slik at den fungerer som en medieserver.</li><li><a name=tivo_enable></a><b>Enable TiVo®-støtte</b> Gå til http://kb.netgear.com/app/answers/detail/a_id/24316 for å se hvordan du bruker denne funksjonen med TiVo-enheten.</li><li><a name=dev_name></a><b>Navn på medieserver</b> er navnet som vises på mediespillere</li></ul> </p><p><b>Innholdssøk</b><ul><li><b>Innholdssøk -&gt; Automatisk  </b> Søker etter mediefiler når nye filer legges til i ReadyShare USB-lagring Bare delt mappe med Alle – ingen passord i Lesetilgang kan søkes etter for mediefiler.</li><li>Du kan også klikke på <b>Søke etter mediefiler på nytt</b> på nytt for å slette den gjeldende databasen og søke på nytt umiddelbart.</li></ul></p>",
