"CLOH01" : "<P><font size=4><B>Hjelp for Logger (Logs)</B></font></P><p>En logg er en detaljert registrering av webområdene som brukerne i nettverket har vært inne på, eller som de har prøvd å få tilgang til. Hvis du har konfigurert innholdsfiltrering i skjermbildet Blokker områder (Block Sites), blir det registrert i skjermbildet Logger (Logs) når noen i nettverket prøver å få tilgang til et blokkert område. Hvis e-postvarsling er aktivert, mottar du disse loggene i en e-postmelding. Hvis du ikke har konfigurert e-postvarsling, kan du vise loggene her.</p><p><ul><li>Klikk på <b>Tøm logg (Clear Log)</b> for å slette alle loggoppføringene.</ul><p><ul><li>Klikk på <b>Oppdater (Refresh)</b> for å se de siste tilkoblingsforsøkene.</ul><p><ul><li>Klikk på <b>Send logg (Send Log)</b> for å sende loggfilen til e-postkontoen din. Denne funksjonen kan være svært nyttig for å teste e-postinnstillingene dine.</ul>",
