"CBSH01" : " <P><font size=4><B>Hjelp for Blokker områder (Block Sites)</B></font></P> <p>Hvis du ønsker å begrense tilgangen til bestemte områder på Internett, må du konfigurere innholdsfiltrering. Innholdet kan filtreres på to måter: <ul><li>Du kan blokkere tilgang til bestemte domener (for eksempel www.badstuff.com/XXX) <li>Du kan blokkere områder som inneholder bestemte ord (for eksempel banneord eller innhold av seksuell karakter). </UL><p>Når brukerne forsøker å få tilgang til et blokkert område, får de en melding: &apos;Blokkert av NETGEAR&apos; (Blocked by NETGEAR).</p><hr><a name=blocking></a><p><b>Slik aktiverer du blokkering av områder:</b></p><ul>Velg <b>Ifølge tidsplan</b> (Per Schedule) for å aktivere blokkering av områder og blokkere i henhold til innstillingene i skjermbildet Tidsplan (Schedule).</ul><ul>Velg <b>Alltid</b> (Always) for å aktivere blokkering av områder og tillate kontinuerlig blokkering, uavhengig av innstillingene i skjermbildet Tidsplan (Schedule).</ul><p><b>Merk:</b> I skjermbildet Tidsplan (Schedule) kan du angi når blokkeringen skal utføres basert på nøkkelord og domenenavn.</p><p><b>Slik deaktiverer du blokkering av områder:</b></p><p><ul>Velg <b>Aldri</b> (Never) for å deaktivere blokkering av områder.</ul><hr><a name=toaddword></a><p><b>Slik blokkerer du basert på nøkkelord eller domener på Internett:</b></p><ol><li>Velg når Nøkkelordblokkering (Keyword Blocking) skal aktiveres: (Aldri (Never), Ifølge timeplan (Per Schedule) eller Alltid (Always)).</li><li>I feltet <a name=toaddword></a> <b>Skriv inn nøkkelordet eller domenenavnet her</b> (Type Keyword Or Domain Name Here) skriver du inn ordet eller domenenavnet du vil blokkere mot.</li><li>Klikk på <b>Legg til nøkkelord </b>(Add Keyword).<li>Ordet eller domenenavnet vises i listen.</li><li>Fortsett å legge til navn og nøkkelord til du er ferdig.</li><li>Klikk på <b>Bruk</b> (Apply) når du er ferdig.</li></ol><a name=blocklist></a><p><b>Blokkeringsliste</b>. Listen under overskriften Blokker områder som inneholder disse nøkkelordene eller domenenavnene (Block Sites Containing these Keywords or Domain Names) viser en oppdatert liste over elementene som skal blokkeres.</p><a name=todelete></a><p><b>Slik sletter du et nøkkelord eller domenenavn:</b></p><ol><li>Velg ordet eller domenenavnet fra listen.</li><li>Klikk på <b>Slett nøkkelord</b> (Delete Keyword).</li><li>Fortsett med å velge og slette navn og nøkkelord til du er ferdig.</li><li>Klikk på <b>Bruk</b> (Apply).</li></ol><p><b>Slik sletter du alle nøkkelord og domenenavn:</b></p><ol><li>Klikk på <b>Fjern liste </b>(Clear List).</li><li>Klikk på <b>Bruk</b> (Apply).</li></ol></p><hr><a name=trusted></a><p><b>Slik gir du en datamaskin ubegrenset tilgang til Internett:</b></p><ol><li>Merk av for <b>Tillat at klarerte IP-adresser får tilgang til blokkerte områder</b> (Allow Trusted IP Address to Visit Blocked Sites).</li><li>Skriv inn IP-adressen til datamaskinen i området Klarert IP-adresse (Trusted IP Address). <br>Det skal være tilstrekkelig å skrive inn et tall bare i det siste feltet.</li><li>Klikk på <b>Bruk</b> (Apply).</li></ol><a name=To></a><p><b>Slik gir du ubegrenset tilgang til Internett:</b></p><ol><li>Velg <B>Aldri</b> (Never) fra listen <b>Nøkkelordblokkering</b> (Keyword Blocking).</li><li>Klikk på <b>Bruk</b> (Apply).</li></ol>",
