"CBEH01" : "<P><font size=4><B>Hjelp for Blokker tjenester</B></font></P><P>Med Blokker tjenester kan du blokkere Internett-tilgang for bestemte brukere i det lokale nettverket basert på brukernes IP-adresser. Du kan for eksempel hindre at alle eller noen bestemte brukere i nettverket ditt bruker bestemte Internett-tjenester, for eksempel surfer på Internett (http). Du kan konfigurere blokkering av tjenester og sette blokkeringen til Aldri, I henhold til en tidsplan eller Alltid. </P><HR><A name=block></A><P><B>Slik aktiverer du blokkering av tjenester:</B></P><UL>  <LI>Velg <B>Ifølge tidsplan</B> for å aktivere blokkering av tjenester og blokkere i henhold til innstillingene i skjermbildet Tidsplan.   <LI>Velg <B>Alltid</B> hvis du vil aktivere blokkering av tjenester og tillate kontinuerlig blokkering, uavhengig av innstillingene i skjermbildet Tidsplan. </LI></UL><BR><P><B>Slik deaktiverer du blokkering av tjenester:</B><P><P><UL>  <LI>Velg <B>Aldri </B> for å deaktivere blokkering av tjenester.</LI></UL><A name=table></A><P><B>Tjenestetabell</B> <P>Denne tabellen viser alle tjenestene som for øyeblikket er blokkerte. Du kan legge til oppføringer i og slette dem fra denne tabellen etter behov.</P><A name=add></A><P><B>Slik legger du til en ny tjeneste:</B> <OL>  <LI>Klikk på knappen <B>Legg til</B> .   <LI>Angi informasjon i skjermbildet som vises.   <LI>Klikk på knappen <B>Bruk</B> når du er ferdig. </LI></OL><A name=edit></A><P><B>Slik redigerer du en tjeneste</B> <OL>  <LI>Velg alternativknappen for tjenesten du vil redigere.   <LI>Klikk på knappen <B>Rediger</B>.   <LI>Endre dataene for tjenesten etter behov.   <LI>Klikk på knappen <B>Godta</B> når du er ferdig. </LI></OL><A name=delete></A><P><B>Slik sletter du en tjeneste</B> <OL>  <LI>Velg alternativknappen ved siden av raden i tabellen for tjenesten du vil slette.   <LI>Klikk på knappen <B>Slett</B> for å slette den valgte tjenesten. </LI></OL><HR><P><B>Slik lagrer eller forkaster du endringer</B></P><P>Klikk på <A name=To></A><B>Bruk</B> for å lagre de nye innstillingene for ruteren. <BR>Klikk på <A name=cancel></A><B>Avbryt</B> for å forkaste endringer som ikke er lagret. </P>",
"CBEH02" : "<P><font size=4><B>Hjelp for Konfigurering av tjenesteblokkering (Block Services Setup)</B></font></P><p>  Med tjenesteblokkering kan du blokkere Internett-tilgang for bestemte brukere i det lokale nettverket basert på brukernes IP-adresser. Du kan også hindre bruk av enkelte Internett-tjenester fullstendig.<p><hr> <p><b>Slik kan du legge til / redigere en tjeneste:</b></p><ol><li>Velg en type tjeneste fra rullegardinlisten, eller velg <b>Brukerdefinert (User Defined)</b> hvis tjenestetypen ikke er i listen.<li>For <b>Brukerdefinert (User Defined)</b> må du velge protokollen og skrive inn navnet på og området av portnumrene som brukes av tjenesten. Disse feltene fylles ut automatisk for kjente tjenester.<li>I alternativet IP-adresse (IP Addresse) angir du hvilke PC-er som skal blokkeres. (Du finner mer informasjon senere i dette emnet).<li>Klikk på <b>Legg til / godta (Add/Accept)</b> for å lagre endringene.</ol><a name=ip></a><p><b>Filtrer tjenester for (Filter Services for)</b>. Dette alternativet angir hvilke datamaskiner som skal blokkeres.<ul><li>Bare denne IP-adressen (Only this IP Address). Bare én (1) PC blokkeres. Skriv inn IP-adressen til PC-en som skal blokkeres.<li>IP-adresseområde (IP Address Range). En gruppe PC-er blokkeres ut fra IP-adressen. Skriv inn start- og slutt- IP-adressen for området av PC-er som skal blokkeres.<li>Alle IP-adresser (All IP Addresses). Alle PC-ene blokkeres.</ul><hr> <p><b>Slik lagrer eller avbryter du endringer:</b></p><p> Klikk på <b>Legg til / godta (Add/Accept)</b> når du er ferdig for å oppdatere tabellen over blokkerte tjenester. <br> Klikk på <b>Avbryt (Cancel)</b> for å gå tilbake til de forrige innstillingene.</p>",
