"CSEH01" : "<P><font size=4><B>Hjelp for Tidsplan (Schedule)</B></font></P><p>Hvis du har konfigurert innholdsfiltrering i skjermbildet Blokker områder (Block Sites) eller konfigurert blokkering av tjenester i skjermbildet Blokker tjenester (Block Services), kan du konfigurere en tidsplan for når blokkeringen skal utføres, eller når tilgangen ikke skal være begrenset. </p><a name=blocksch></a><p>Slik bruker du en tidsplan til å blokkere nøkkelord, tjenester eller Internett-domener:<ol><li>Velg ett av følgende:<b>Hver dag</b> (Every Day).<br>Én eller flere dager.</li><li>Hvis du vil begrense tilgangen helt på de valgte dagene, velger du<b>Hele dagen</b> (All Day).<br>Hvis du vil begrense tilgangen på bestemte tider på de valgte dagene, angir du et klokkeslett i feltene <b>Start blokkering</b> (Start Blocking) og <b>Avslutt blokkering</b>(End Blocking).<br><b>Merk:</b> Angi verdiene i 24-timers format. Eksempel:10:30 am. betyr klokken 10.30 om formiddagen, og 10:30 pm. betyr klokken 22.30 om kvelden.</li><li>Klikk på <a name=Apply></a><b>Bruk</b> (Apply).</li></ol>",
"CSEH02" : "<P><font size=4><B>Hjelp for planlegging</B></font></P><p>Hvis du har valgt innholdsfiltrering på skjermbildet Blokkér nettsteder eller tjenesteblokkering på skjermbildet &quot;Blokkér tjenester&quot;, kan du planlegge når blokkering skal forekomme, eller når tilgangen ikke skal være begrenset. </p><p name=blocksch id=blocksch></p><p>Gjør følgende for å blokkere nøkkelord, tjenester eller Internett-domener basert på en plan:<ol><li>Velg en av følgende:<b>Hver dag</b>.<br>Én eller flere dager.</li><li>Hvis du ønsker å begrense tilgangen fullstendig for de valgte dagene, kan du velge <b>Hele dagen</b>.<br>Hvis du ønsker å begrense tilgang på spesifikke tidspunkt de valgte dagene, angir du et klokkeslett i feltene for <b>Start blokkering</b> og <b>Avslutt blokkering</b>.<br><b>Merk:</b> Angi verdiene i 24-timers format. 10:30 a.m. er for eksempel klokken 10.30, og 10:30 p.m. er klokken 22.30.</li><li>Klikk på <p name=Apply id=Apply><b>Bruk</b>.</p></li></ol>",
