"CEMH01" : "<P><font size=4><B>Hjelp for E-post (E-mail)</B></font></P><p>Varsler kan sendes når noen på det lokale nettverket (LAN) forsøker å gå til en side som er blokkert. Logger er lister over alle URL-adressene som er besøkt. Hvis du vil ha tilsendt varsler og logger på e-post, angir du innstillingene i dette skjermbildet.</p><p>Du kan når som helst sjekke loggene manuelt i skjermbildet Logger (Logs). Hvis du ikke ønsker å motta e-postmeldinger, lar du feltene stå tomme.</p><a name=receive></a><p><b>Slik angir du at du vil motta varsler og logger via e-post:</b><ol><li>Merk av for <b>Aktiver e-postvarsling</b> (Turn E-mail Notification On).</li><li>I feltet <b>Utgående e-postserver</b> (Outgoing Mail Server) skriver du inn navnet på Internett-leverandørens utgående SMTP-postserver (for eksempel smtp.minISP.com). <br>Hvis du lar dette feltet stå tomt, får du ikke tilsendt varsler eller logger Autentifiseringen som bruker  SSL eller TLS er ikke støttet.<br><b>Tips:</b> Du brukte denne informasjonen da du konfigurerte e-postprogrammet. Hvis du ikke husker informasjonen, kan du kontrollere innstillingene i e-postprogrammet.</li><li>Skriv inn en e-postadresse i feltet <b>E-postadresse</b> (E-mail Address) for å få varsler og logger tilsendt deg eller noen andre. <br>Oppgi en fullstendig e-postadresse (for eksempel Jackie@minISP.com). </li><li><a name=alert></a>Hvis du ønsker å få tilsendt et varsel via e-post hver gang noen i nettverket forsøker å koble seg til en blokkert URL-adresse, merker du av for <b>Send varsel umiddelbart</b> (Send Alert Immediately).<br></li><li><a name=schedule></a>Hvis du ikke ønsker å få loggene tilsendt, velger du <b>Ingen</b> (None) fra listen i området Send logger i henhold til denne tidsplanen (Send Logs According to This Schedule).<br> <br>Hvis du derimot ønsker å få tilsendt logger, velger du ett av de andre alternativene.<ul><li>Angi ukedag hvis du valgte <b>Ukentlig</b> (Weekly).</li><li>Angi når på dagen du ønsker å få tilsendt e-post hvis du valgte <b>Ukentlig</b> (Weekly) eller <b>Daglig</b> (Daily).</li></ul><a name=Apply></a><li>Klikk på <b>Bruk</b> (Apply) for at endringene skal bli aktivert.</li></ol><a name=timezone></a><p><b>Tidssone.</b><p>Velg den lokale tidssonen. Dette er nødvendig for at tidsplanen skal fungere på riktig måte.</p><p>Velg Juster automatisk for sommertid hvis det er aktuelt.</p>",
