"MBSH01" : "<p><font size=4><b>Hjelp for Innstillinger for sikkerhetskopiering (Backup Settings)</b></font></p><p>I dette skjermbildet kan du sikkerhetskopiere, gjenopprette og slette de gjeldende ruterinnstillingene. </p><p>Når ruteren fungerer riktig, bør du sikkerhetskopiere informasjonen slik at du har den tilgjengelig hvis noe går galt. Når du sikkerhetskopierer innstillingene, lagres de som en fil på datamaskinen. Du kan bruke denne filen til å gjenopprette ruterinnstillingene. </p><a name=save></a><p>Slik oppretter du en sikkerhetskopifil av de gjeldende innstillingene:<ol><li>Klikk på <b>Sikkerhetskopier (Back Up)</b>.</li><li>Hvis du ikke har konfigurert nettleseren til å lagre nedlastede filer automatisk, må du angi hvor filen skal lagres, gi den et nytt navn om ønskelig, og klikke på <b>Lagre (Save)</b>. <br>Hvis du har konfigurert nettleseren til å lagre nedlastede filer automatisk, lagres filen på nettleserens nedlastingsplassering på harddisken, med navnet ",
"MBSH02" : ". </li></ol><hr><p><b>VIKTIG!</b>Når du har begynt å gjenopprette innstillinger eller slette ruteren, må du <I>ikke</I> prøve å koble deg til Internett, slå av ruteren, slå av datamaskinen eller gjøre andre ting med ruteren før den har startet på nytt! Omstarten tar ca. et minutt. Når testlyset slutter å blinke, må du vente noen sekunder til før du gjør noe med ruteren. </p><hr><a name=restore></a><p>Slik gjenoppretter du innstillinger fra en sikkerhetskopifil:<ol><li>Klikk på <b>Bla gjennom (Browse)</b>.</li><li>Finn frem til og velg sikkerhetskopifilen som ble lagret tidligere (som standard ",
"MBSH03" : ").</li><li>Klikk på <b>Gjenopprett (Restore)</b>. <br>Det vises et vindu med informasjon om at ruteren er gjenopprettet til de forrige innstillingene. Ruteren starter på nytt. Omstarten tar ca. 1 minutt.<br><b>VIKTIG!</b>Du må ikke prøve å koble deg til Internett, slå av ruteren, slå av datamaskinen eller gjøre andre ting med ruteren før den har startet på nytt! Når testlyset slutter å blinke, må du vente noen sekunder til før du gjør noe med ruteren. </li><li>Lukk meldingsvinduet.</li></ol><a name=revert></a><p>Slik sletter du de gjeldende ruterinnstillingene og tilbakestiller du ruteren til de opprinnelige standard fabrikkinnstillingene:<ul><li>Klikk på <b>Slett (Delete)</b>.<br><b>VIKTIG!</b>Du må ikke prøve å koble deg til Internett, slå av ruteren, slå av datamaskinen eller gjøre andre ting med ruteren før den har startet på nytt. Når testlyset slutter å blinke, må du vente noen sekunder til før du gjør noe med ruteren. </ul><p>Når du har slettet de gjeldende ruterinnstillingene, er ruterens passord <b>password</b>, LAN-IP-adressen er <b>192.168.1.1</b>, og ruteren vil fungere som en DHCP-server i det lokale nettverket, og som en DHCP-klient på Internett. </p></a>",
"MSP001" : "Gammelt passord",
"MSP002" : "Nytt passord",
"MSP003" : "Gjenta det nye passordet",
"MSPE01" : "Passordet kan ikke være lengre enn 32 tegn.",
"MSPE02" : "Det gamle passordet er feil.",
"MSPH01" : "<P><font size=4><B>Hjelp for Angi passord (Set Password)</B></font></P><p>  I skjermbildet Angi passord (Set Password) kan du endre passordet du bruker for å få tilgang til skjermbildene med innstillinger – <I>ikke</I> passordet til kontoen du har hos Internett-leverandøren. <p>  Slik endrer du passordet: <ol> <li>Skriv inn det gamle passordet.   <BR>Standardpassordet for ruteren er <b>password</b>.  <li>Skriv inn et nytt passord, og skriv det inn en gang til i feltet <b>Gjenta nytt passord (Repeat New Password)</b> for å bekrefte det.   <br>  <b>Merk:</B> Skriv ned passordet på et trygt sted.  <li>Klikk på <b>Bruk (Apply)</b> for å endre passordet, eller klikk på <b>Avbryt (Cancel)</b> for å beholde det gjeldende passordet. </ol><p> <b>Merk:</b> Hvis du har tatt en sikkerhetskopi av ruterinnstillingene tidligere, bør du ta en ny sikkerhetskopi slik at det nye passordet blir inkludert i filen med innstillingene. </p>",
"MSPH02" : "<P><font size=4><B>Hjelp for Angi passord</B></font></P><p> Bruk skjermbildet Set Password (Angi passord) for å endre passordet du bruker for å få tilgang til skjermbildene Settings (Innstillinger), <I>ikke</I> ISP-kontopassordet. <p> Slik endrer du passordet: <ol> <li>Skriv inn det gamle passordet.   <BR>Standardpassordet for ruteren er <b>password</b>.  <li>Skriv inn et nytt passord, og skriv det inn én gang til i boksen <b>Repeat New Password</b> (Gjenta nytt passord) for å bekrefte det.   <br>  <b>Merk:</B> Skriv ned passordet på et trygt sted.  <li>Klikk på <b>Apply</b> (Bruk) for å endre passordet, eller klikk på <b>Cancel</b> (Avbryt) for å beholde det gjeldende passordet. </ol><p> <b>Merk:</b> Hvis du har tatt en sikkerhetskopi av ruterinnstillingene tidligere, bør du ta en ny sikkerhetskopi slik at det nye passordet blir inkludert i filen med innstillingene. </p><p><b>Aktivere passordgjenoppretting</b><br>NETGEAR anbefaler at du aktiverer passordgjenopprettingen hvis du endrer passordet for ruterens brukernavn for admin. Da blir det enkelt å gjenopprette passordet hvis du glemmer det. <p><b>Slik aktiverer du passordgjenoppretting:</b><ol><li>Velg avmerkingsboksen <b>Enable Password Recovery</b> (Aktiver passordgjenoppretting).<li>Velg to sikkerhetsspørsmål, og angi svar for dem.<li>Klikk på <b>Apply</b> (Bruk) for å lagre endringene.</ol></p><p>Når du bruker nettleseren for å få tilgang til ruteren, vises påloggingsvinduet. Hvis passordgjenoppretting er aktivert når du klikker på <b>Cancel</b> (Avbryt), starter prosessen med passordgjenopprettingen. Da kan du angi de lagrede svarene på sikkerhetsspørsmålene for å gjenopprette passordet. Denne gjenopprettingsprosessen støttes i nettleserne Internet Explorer, Firefox og Chrome, men ikke i Safari-nettleseren.</p>",
