"MRUH01" : "<title>Hjelp</title><link rel=stylesheet href=help.css></head><h1>Hjelp for språkkontroll</h1><p>Brukergrensesnittspråket er forskjellig fra nettleserspråket. Hvis du vil bytte brukergrensesnittspråket til nettleserspråket, klikker du på <B>Ja</B>, ellers klikker du på <B>Nei</B></p>",
"MRUH02" : " <P><font size=4><B>Hjelp for Oppgraderingsassistent for fastvare (Firmware Upgrade Assistant)</B></font></P>        <p>Ruteren kan automatisk finne ut om en ny fastvareversjon er tilgjengelig på Internett.<p>Klikk på <b>Ja (Yes)</b> hvis du vil starte søket nå.<br>Klikk på <b>Nei (No)</b> hvis du ikke vil søke etter en ny versjon nå.<p>Hvis du heller vil søke etter en ny versjon senere, kan du gjøre det i skjermbildet Ruteroppgradering (Router Upgrade).<p>Hvis du ikke vil at denne meldingen skal vises på nytt neste gang du logger deg på, merker du av i avmerkingsboksen <b>Ikke vis denne meldingen igjen (Do not display this message again)</b> og klikker på <b>Nei (No)</b>.",
"MRUH03" : "   <P><font size=4><B>         Hjelp for Oppdatere brukergrensesnittspråk (GUI Language Update)   </B></font></P>     <p>Du har valgt brukergrensesnittspråk fra listen <b>Velg språk (Select Language)</b>. Du kan bruke funksjonen Oppdatere brukergrensesnittspråk (GUI Language Update) for å kontrollere oppdateringen av brukergrensesnittspråk Denne funksjonen kontrollerer bare selve oppdateringen av brukergrensesnittspråket, ikke hele fastvaren.<p>Klikk på knappen <b>Kontroller (Check)</b> for å gå til webområdet til NETGEAR for å få en ny versjon av det valgte brukergrensesnittspråket. <p>Hvis det finnes en ny versjon, kan du klikke på <b>Ja (Yes)</b> for å oppdatere til den nye versjonen eller på <b>Nei (No)</b> for å avbryte oppdateringen. ",
"MRUH04" : " <p><font size=4><b>Hjelp for Ruteroppgradering (Router Upgrade)</b></font></p> <p>Du installerer nye versjoner av programvaren for ruteren via skjermbildet Ruteroppgradering (Router Upgrade).<a name=check></a> <p>Klikk på knappen <b>Kontroller</b> (Check) for å gå til NETGEAR-webområdet og laste ned <b>nye versjoner </b> av programvaren for ruteren. Når du har lastet ned filen, må du pakke den ut før du oppgraderer ruteren.    <p>Merk av hvis du vil søke etter en ny versjon når du logger deg på. <p><b>VIKTIG!</b> Når du klikker på <b>Last opp</b> (Upload), må du <i>ikke</i> avbryte opplastingen av programvaren til ruteren og starte ruteren på nytt. Hvis du tror at det kan oppstå avbrudd underveis, klikker du på <b>Avbryt</b> (Cancel) for å beholde den gjeldende programvaren for ruteren.</p><a name=locate></a><p><b>Finn og velg oppgraderingsfilen på harddisken.</b><ol><li>Gå til www.NETGEAR.com, og last ned den oppdaterte programvaren.<li>Hvis det ikke gjøres automatsk, dekomprimerer du filen.<br>Vi anbefaler deg å lese <i>produktmerknadene</i> før du går videre.<li>Klikk på <b>Bla gjennom </b> (Browse).<li>Finn og velg filen du nettopp lastet ned og dekomprimerte.<li>Klikk på <b>Last opp</b> (Upload) for å laste opp programvaren til ruteren.<br>Den nye programvaren lastes opp til ruteren, og sørger for at ruteren startes på nytt.<br><b>Merk:</b> Ikke gå på Internett, slå av ruteren, slå av datamaskinen eller gjør noe annet før ruteren er ferdig med omstarten. Når klargjøringslampen slutter å blinke, venter du noen sekunder før du gjør noe.<li>Klikk på <b>Ruterstatus</b> (Router Status), og kontroller fastvareversjonen for å bekrefte at den nye programvaren er installert i ruteren. </ol><p><B>VIKTIG!</b> I noen tilfeller, for eksempel ved store oppgraderinger, må du kanskje konfigurere ruteren på nytt etter at du har oppgradert den. Les <i>produktmerknadene</i> som fulgte med programvaren, for å finne ut om du trenger å konfigurere ruteren på nytt. <p>Hvis du ikke kan oppgradere med denne metoden, kan du lese <i>referansehåndboken</i> på produktets nettsted for brukerstøtte og se hvilke andre måter ruteren kan oppgraderes på.</p> ",
