"AAW046" : "Aktiver Smart Connect –‧ la ruteren velge det beste WiFi-båndet 2,4 GHz eller 5 GHz til WiFi-tilkoblingene. Smart Connect krever 2,4 GHz- og 5 GHz-nettverk for å bruke samme WiFi-nettverksnavn (SSID), sikkerhetsalternativer og passord.",
