"AAW050" : "<p><font size=4><B>Hjelp for trådløs bro</B></font></p><HR><p>Du kan bruke ruteren i bromodus for å koble til flere enheter trådløst med den raskere 802.11ac-hastigheten.<br>Aktiver bromodus: Du kan aktivere eller deaktivere bromodus.<br>Klikk på knappen Konfigurer trådløsinnstillinger for bromodus for å spesifisere innstillingene til den andre ruteren som denne ruteren skal kobles til.<br>1. Du kan velge trådløs nettverksfrekvens (2,4 GHz eller 5 GHz). For 802.11ac-modusen velger du 5 GHz.<br>2. I feltet Navn (SSID) angir du navnet på det trådløse nettverket (SSID).<br>3. Under delen Sikkerhetsalternativ velger du en alternativknapp.<br>4. Hvis du får beskjed om det, skriver du inn passordet (WiFi-passordet som du bruker til å koble til ruteren trådløst.<br>5. Klikk på knappen Bruk.<br>Du må også velge innstillinger for IP-adresse på denne broen, enten \&quot;Hent dynamisk fra eksisterende ruter\&quot; eller \&quot;Bruk fastsatt IP-adresse (anbefales ikke)\&quot;.<br>Klikk på Bruk på siden for den trådløse broen. Da blir endringene gjeldende.</p>",
