"AAWH11" : "<HR><A name=wps></A><P><B>WPS-innstillinger</B></P><p>Ruterens PIN-kode</p><p>Dette er PIN-koden du bruker i en registrator (for eksempel fra Network Explorer på en Vista Windows-PC) for å konfigurere trådløsinnstillingene til ruteren via WPS. Du finner også PIN-koden på produktetiketten på ruteren.</p><P>Deaktiver ruterens PIN-kode<P>Hvis PIN-koden er aktivert, kan du konfigurere trådløsinnstillingene for ruteren eller legge til en trådløs klient via WPS ved hjelp av ruterens PIN-kode. Du kan deaktivere ruterens PIN-kode midlertidig når ruteren oppdager mistenkelige forsøk på inntrenging i trådløsinnstillingene for ruteren, ved å bruke ruterens PIN-kode via WPS. Du kan aktivere denne funksjonen manuelt ved å fjerne haken <b></b> i avmerkingsboksen og klikke på knappen B<b>ruk</b>. </P><P><b>Behold eksisterende trådløsinnstillinger</b> <P>Dette viser om ruteren er konfigurert for WPS.<br>Hvis det ikke er merket av for dette alternativet, vil ruterens trådløsinnstillinger endres til en automatisk generert og tilfeldig SSID og sikkerhetsnøkkel hvis du legger til en ny trådløs klient. Hvis det er merket av for dette alternativet, kan det i tillegg hende at enkelte eksterne registratorer (for eksempel Network Explorer i Vista Windows) ikke oppdager ruteren.<br>Hvis du konfigurerer de grunnleggende trådløsinnstillingene fra ruterens administrasjonsgrensesnitt, merkes det automatisk av for dette alternativet.</P>",
"AAWH12" : "<p><A name=beamforming></A>Implisitt Beamforming kan forbedre 11ac WiFi-ytelsen uten å bruke drivere for de fleste mobile enheter, som smarttelefoner og nettbrett.</p>",
"AAWH13" : "<p><A name=mu_mimo></A>MU-MIMO forbedrer ytelsen når flere MU-MIMO-kompatible WiFi-klienter overfører data samtidig. Merk deg at WiFi-klientene må ha MU-MIMO-støtte, og at de må være tilkoblet samme WiFi-nettverk.</p>",
