"ANMH01" : "<p><font size=4> <b> Hjelp til innstillinger av Network Monitor Display  </b></font></p><p>Med Network Monitor Display kan du tilpasse adferdsmønsteret til lampen på den blå kuppelen. Hvis du vil slå lampen av eller på, kan du enten trykke på den blå kuppelen eller bruke innstillingene nedenfor. Hvis du vil ha mer informasjon om blinkemønsteret til lampen, kan du se hjelpedelen til høyre. Lampeinnstillingene er bare tilgjengelige når lampen er på.</p><a name=display></a><p><b>Status for trådløse data (standard)</b></p><p>Lampene blinker når trådløse data overføres. Lampen til venstre indikerer innkommende data, og lampen til høyre indikerer utgående data.</p><p><b>Status for gjestenettverk</b></p><p>Lampene slås på når gjestenettverket er aktivert, og de blinker når en datamaskin er tilkoblet.</p><p><b>Status for foreldrekontroll</b></p><p>Lampene slås på når foreldrekontrollen er aktivert, og de blinker når et forsøk på å få tilgang, blokkeres.</p><p><b>Status for måling av bredbåndsbruk</b></p><p>Lampene blinker hvis bruken når advarselsnivået, og de lyser konstant hvis bruken når det forhåndsinnstilte nivået.</p><p><b>Slik lagrer eller avbryter du endringer:</b><ul><li>Klikk på <b>Bruk</b> for å lagre de nye innstillingene for ruteren.</li><li>Klikk på <b>Avbryt</b> for å forkaste endringer som ikke er lagret.</li></p>",
