"AWRH01" : "<P><font size=4><B>Hjelp for Innstillinger for funksjonen for trådløs repetisjon (Wireless Repeating Function Settings)</B></font></P> <a name=en_repeat></a> <p><b>Aktiver trådløs repetisjon (Enable Wireless Repeating)</b></p> <p>Aktiver denne funksjonen hvis du vil bruke bromodus (Bridge mode) eller repeatermodus (Repeater mode), og velg deretter modusen du ønsker for miljøet ditt. </p><ul><p><li><a name=repeat></a><strong>Trådløs repeater (Wireless Repeater). </strong><p>I denne modusen kommuniserer -ruteren <I>bare</I> med en annen trådløs stasjon i basestasjonsmodus. Du må skrive inn MAC-adressen (den fysiske adressen) til den andre trådløse stasjonen i basestasjonsmodus i det angitte feltet. WEP kan (og bør) brukes for å beskytte denne kommunikasjonen.   <p><li><a name=base></a><strong>Trådløs basestasjon (Wireless Base Station). </strong>  <p>Merk bare av for dette alternativet hvis -ruteren er hovedruteren for en gruppe trådløse stasjoner i repeatermodus. De andre trådløse stasjonene i repeatermodus må være satt til Trådløs repeatermodus (Wireless Repeater mode) og bruke MAC-adressen til denne ruteren. Da sender de all trafikk til denne hovedruteren i stedet for å kommunisere direkte med hverandre. WEP kan (og bør) brukes for å beskytte denne trafikken. <p>Hvis du merker av for dette alternativet, må du skrive inn MAC-adressene til de andre tilgangspunktene i de angitte feltene. ",
