"AWN048" : "<p name=vpn_passthrough id=vpn_passthrough><b>VPN-gjennomgang</b></p><p>Dette alternativet gjør at brukeren kan aktivere/deaktivere VPN-gjennomgangsfunksjonen. Som standard støtter ruteren tre typer VPN-gjennomgangstjenester: IPSec, PPTP og L2TP.</p>",
