"AWNH01" : "<P><font size=4><B>Hjelp for WAN-konfigurering  </B></font></P><p>På denne siden kan du konfigurere en standard DMZ-server og angi at ruteren skal svare på ping fra Internett. Begge disse alternativene har sikkerhetsproblemer, så de må brukes med forsiktighet.</p><a name=spi></a><p><b>Deaktiver portsøk og DoS-beskyttelse</b> –DoS-beskyttelse beskytter det lokale nettverket mot tjenestenektangrep. Dette alternativet må bare deaktiveres i spesielle tilfeller.</p><a name=dmz></a><p><b> Standard DMZ-server  </b><p>Hvis du angir en standard DMZ-server, kan du konfigurere en datamaskin eller en server som er tilgjengelig for alle på Internett, for tjenester du ikke har definert. Det er sikkerhetsproblemer forbundet med dette, så det må bare gjøres hvis du er villig til å risikere åpen tilgang til nettverket. Hvis du ikke angir en standard DMZ-server, forkaster ruteren alle innkommende tjenesteforespørsler som ikke er definert.<p> Slik angir du at en datamaskin eller server skal være en DMZ-server: <ol><li>Merk av for <i>Standard DMZ-server</i></li>.<li>Skriv inn IP-adressen for den serveren. </li><li>Klikk på <b>Bruk</b>. </li></ol><hr><a name=ping></a><p><b> Svar på ping på Internett-port  </b><p>Merk av for dette hvis du vil at ruteren skal svare på ping-forespørsler fra Internett. Dette kan brukes som et diagnoseverktøy. I likhet med DMZ-serveren kan dette utgjøre et sikkerhetsproblem. Du bør bare merke av for dette hvis du har en spesiell grunn til det.</p><a name=mtu></a><p><b>MTU-størrelse</b><p>Den vanlige MTU-verdien (MTU = Maximum Transmit Unit) for de fleste Ethernet-nettverk er 1500 byte, 1492 byte for PPPoE-tilkoblinger eller 1436 byte for PPTP-tilkoblinger. Det kan hende at du må redusere MTU-verdien for enkelte Internett-leverandører. Dette er imidlertid sjelden nødvendig, og det skal bare gjøres hvis du er sikker på at det kreves av Internett-leverandøren.</p><a name=nat></a><p><b>NAT-filtrering</b><p>Dette alternativet avgjør hvordan ruteren tar seg av innkommende trafikk. Alternativet Sikret oppretter en sikret brannmur for å beskytte PC-ene i det lokale nettverket mot angrep fra Internett. Det kan imidlertid føre til at enkelte Internett-spill, punkt-til-punkt-programmer eller multimedieprogrammer slutter å virke. Alternativet Åpen oppretter derimot en brannmur med mye mindre sikring, men der alle Internett-programmer virker.</p><p><b>Deaktiver SIP ALG</b><p>Noen programmer for tale-/videokommunikasjon fungerer ikke bra med SIP ALG. Å aktivere dette alternativet for å slå av SIP ALG kan hjelpe tale-/videoprogrammer med å opprette/godta en samtale via ruteren.</p>",
"AWNH02" : "<P><font size=4><B>Hjelp for WAN-konfigurering  </B></font></P><p>På denne siden kan du konfigurere en standard DMZ-server og angi at ruteren skal svare på ping fra Internett. Begge disse alternativene har sikkerhetsproblemer, så de må brukes med forsiktighet.</p><a name=spi></a><p><b>Deaktiver portsøk og DoS-beskyttelse</b> –DoS-beskyttelse beskytter det lokale nettverket mot tjenestenektangrep. Dette alternativet må bare deaktiveres i spesielle tilfeller.</p><a name=dmz></a><p><b> Standard DMZ-server  </b><p>Hvis du angir en standard DMZ-server, kan du konfigurere en datamaskin eller en server som er tilgjengelig for alle på Internett, for tjenester du ikke har definert. Det er sikkerhetsproblemer forbundet med dette, så det må bare gjøres hvis du er villig til å risikere åpen tilgang til nettverket. Hvis du ikke angir en standard DMZ-server, forkaster ruteren alle innkommende tjenesteforespørsler som ikke er definert.<p> Slik angir du at en datamaskin eller server skal være en DMZ-server: <ol><li>Merk av for <i>Standard DMZ-server</i></li>.<li>Skriv inn IP-adressen for den serveren. </li><li>Klikk på <b>Bruk</b>. </li></ol><hr><a name=ping></a><p><b> Svar på ping på Internett-port  </b><p>Merk av for dette hvis du vil at ruteren skal svare på ping-forespørsler fra Internett. Dette kan brukes som et diagnoseverktøy. I likhet med DMZ-serveren kan dette utgjøre et sikkerhetsproblem. Du bør bare merke av for dette hvis du har en spesiell grunn til det.</p><a name=igmp></a><p><b>Deaktivere IGMP-proxyi</b></p><p>IGMP-proxy-funksjonen gjør at en LAN-PC kan motta den trafikken den er interessert i fra Internett. Du kan klikke i denne avmerkingsboksen for å deaktivere funksjonen hvis du ikke trenger den.</p><a name=mtu></a><p><b>MTU-størrelse</b><p>Den vanlige MTU-verdien (MTU = Maximum Transmit Unit) for de fleste Ethernet-nettverk er 1500 byte, 1492 byte for PPPoE-tilkoblinger eller 1436 byte for PPTP-tilkoblinger. Det kan hende at du må redusere MTU-verdien for enkelte Internett-leverandører. Dette er imidlertid sjelden nødvendig, og det skal bare gjøres hvis du er sikker på at det kreves av Internett-leverandøren.</p><a name=nat></a><p><b>NAT-filtrering</b><p>Dette alternativet avgjør hvordan ruteren tar seg av innkommende trafikk. Alternativet Sikret oppretter en sikret brannmur for å beskytte PC-ene i det lokale nettverket mot angrep fra Internett. Det kan imidlertid føre til at enkelte Internett-spill, punkt-til-punkt-programmer eller multimedieprogrammer slutter å virke. Alternativet Åpen oppretter derimot en brannmur med mye mindre sikring, men der alle Internett-programmer virker.</p><p><b>Deaktiver SIP ALG</b><p>Noen programmer for tale-/videokommunikasjon fungerer ikke bra med SIP ALG. Å aktivere dette alternativet for å slå av SIP ALG kan hjelpe tale-/videoprogrammer med å opprette/godta en samtale via ruteren.</p>",
"AWNH04" : "<p><b>Aktiver IPv6 Pass-Through</b><p>Som standard er IPv6 pass-through deaktivert. Hvis du har enheter som støtter IPv6 i konfigurasjonen og ønsker å bruke IPv6 i stedet for IPv4, kan du merke av i boksen for å aktivere \&quot;IPv6 Pass-Through\&quot;. </p>",
"AWNH05" : "<P><font size=4><B>Trådløs WAN-hjelp</B></font></P><p>Du kan få Internett med WiFi-tilkobling. Noen Internett-leverandører kan ta betalt når du bruker tjenesten. Ta kontakt med tjenesteleverandøren for å få mer informasjon.</p><b>Jeg er i et offentlig nettverk</b><ol>Aktiver alternativet hvis du er på et offentlig sted, som en kafé, en flyplass, en togstasjon eller et hotell. Deaktiver alternativet hvis du er hjemme.</ol><b>Tilgjengelig trådløs liste</b><ol>Alle de oppdagede trådløse tilgangspunktene etter sekvens for signalstyrken. Velg ønsket alternativ.</ol><b>Sikkerhetskonfigurasjon</b><ol>Angi trådløspassord hvis det er nødvendig.</ol><b>Lagre som profil</b><ol>Ta vare på de gjeldende innstillingene for rask referanse senere. Fjern merkingen av alternativet hvis du ikke vil beholde innstillingene.</ol>",
