"ADDH01" : "<P><font size=4><B>Hjelp for Dynamic DNS</B></font></P><p> En DDNS-tjeneste (Dynamic DNS) gir tilgang til en sentral offentlig database der informasjon (for eksempel e-postadresser, vertsnavn og IP-adresser) kan lagres og hentes frem. Dynamic DNS-serveren lagrer også passordbeskyttet informasjon og tillater forespørsler basert på e-postadresser. </p><p>  Hvis du vil bruke en DDNS-tjeneste, må du registrere deg for det. Du får et passord eller en nøkkel fra tjenesteleverandøren av Dynamic DNS-klienten.</p><a name=setup></a><p>Slik konfigurerer du DDNS:<ol><li>Hvis du har registrert deg hos en DDNS-tjenesteleverandør, merker du av for <b>Bruk en Dynamic DNS-tjeneste</b> (Use A Dynamic DNS Service).  </li><li><a name=provider></a>Velg navnet på leverandøren av Dynamic DNS-tjenesten.&nbsp; </li><li>Skriv inn vertsnavnet du fikk av leverandøren av Dynamic DNS-tjenesten. <br>Leverandøren av DDNS-tjenesten refererer kanskje til dette som domenenavnet. </li><li>Skriv inn brukernavnet for DDNS-kontoen. </li><li>Skriv inn passordet (eller nøkkelen) for DDNS-kontoen. </li> <li>Klikk på <b>Bruk</b> (Apply) hvis du vil bruke DDNS-tjenesten.  </li></ol><p><b>Merk:</b> Ruteren støtter bare grunnleggende DDNS, og det er ikke sikkert at påloggingen og passordet er sikre. Hvis du har en privat WAN-IP-adresse, må du ikke bruke DDNS-tjenesten, da dette kan medføre problemer. </p>",
"ADDH02" : "<P><font size=4><B>Hjelp for Dynamic DNS</B></font></P><p> En DDNS-tjeneste (Dynamic DNS) gir tilgang til en sentral offentlig database der informasjon (for eksempel e-postadresser, vertsnavn og IP-adresser) kan lagres og hentes frem. Dynamic DNS-serveren lagrer også passordbeskyttet informasjon og tillater forespørsler basert på e-postadresser. </p><p>  Hvis du vil bruke en DDNS-tjeneste, må du registrere deg for det. Du får et passord eller en nøkkel fra tjenesteleverandøren av Dynamic DNS-klienten.</p><a name=setup></a><p>Slik konfigurerer du DDNS:<ol><li>Hvis du har registrert deg hos en DDNS-tjenesteleverandør, merker du av for <b>Bruk en Dynamic DNS-tjeneste</b> (Use A Dynamic DNS Service).  </li><li><a name=provider></a>Velg navnet på leverandøren av Dynamic DNS-tjenesten.&nbsp; </li><li>Skriv inn vertsnavnet du fikk av leverandøren av Dynamic DNS-tjenesten. <br>Leverandøren av DDNS-tjenesten refererer kanskje til dette som domenenavnet. </li><li>Skriv inn brukernavnet for DDNS-kontoen. </li><li>Skriv inn passordet (eller nøkkelen) for DDNS-kontoen. </li> <li>Klikk på <b>Bruk</b> (Apply) hvis du vil bruke DDNS-tjenesten.  </li></ol><p><b>Merk:</b> Ruteren støtter bare grunnleggende DDNS, og det er ikke sikkert at påloggingen og passordet er sikre. Hvis du har en privat WAN-IP-adresse, må du ikke bruke DDNS-tjenesten, da dette kan medføre problemer. </p>",
"ADDH03" : "<P><font size=4><B>Hjelp for Dynamic DNS</B></font></P><p> En DDNS-tjeneste (Dynamic DNS) gir tilgang til en sentral offentlig database der informasjon (for eksempel e-postadresser, vertsnavn og IP-adresser) kan lagres og hentes frem. Dynamic DNS-serveren lagrer også passordbeskyttet informasjon og tillater forespørsler basert på e-postadresser. </p><p>  Hvis du vil bruke en DDNS-tjeneste, må du registrere deg for det. Du får et passord eller en nøkkel fra tjenesteleverandøren av Dynamic DNS-klienten.</p><a name=setup></a><p>Slik konfigurerer du DDNS:<ol><li>Hvis du har registrert deg hos en DDNS-tjenesteleverandør, merker du av for <b>Bruk en Dynamic DNS-tjeneste</b> (Use A Dynamic DNS Service).  </li><li><a name=provider></a>Velg navnet på leverandøren av Dynamic DNS-tjenesten.&nbsp; </li><li>Skriv inn vertsnavnet du fikk av leverandøren av Dynamic DNS-tjenesten. <br>Leverandøren av DDNS-tjenesten refererer kanskje til dette som domenenavnet. </li><li>Skriv inn brukernavnet for DDNS-kontoen. </li><li>Skriv inn passordet (eller nøkkelen) for DDNS-kontoen. </li> <li>Klikk på <b>Registrer</b> (Register) for å registrere DDNS-tjenesten.  </li></ol><p><b>Merk:</b> Ruteren støtter bare grunnleggende DDNS, og det er ikke sikkert at påloggingen og passordet er sikre. Hvis du har en privat WAN-IP-adresse, må du ikke bruke DDNS-tjenesten, da dette kan medføre problemer. </p>",
"ADDH04" : "<P><font size=4><B>Hjelp for Dynamic DNS</B></font></P><p> En DDNS-tjeneste (Dynamic DNS) gir tilgang til en sentral offentlig database der informasjon (for eksempel e-postadresser, vertsnavn og IP-adresser) kan lagres og hentes frem. Dynamic DNS-serveren lagrer også passordbeskyttet informasjon og tillater forespørsler basert på e-postadresser. </p><p>  Hvis du vil bruke en DDNS-tjeneste, må du registrere deg for det. Du får et passord eller en nøkkel fra tjenesteleverandøren av Dynamic DNS-klienten.</p><a name=setup></a><p>Slik konfigurerer du DDNS:<ol><li>Hvis du har registrert deg hos en DDNS-tjenesteleverandør, merker du av for <b>Bruk en Dynamic DNS-tjeneste</b> (Use A Dynamic DNS Service).  </li><li><a name=provider></a>Velg navnet på leverandøren av Dynamic DNS-tjenesten.&nbsp; </li><li>Skriv inn vertsnavnet du fikk av leverandøren av Dynamic DNS-tjenesten. <br>Leverandøren av DDNS-tjenesten refererer kanskje til dette som domenenavnet. </li><li>Skriv inn brukernavnet for DDNS-kontoen. </li><li>Skriv inn passordet (eller nøkkelen) for DDNS-kontoen. </li> <li>Klikk på <b>Bruk</b> (Apply) hvis du vil bruke DDNS-tjenesten.  </li></ol><p><b>Merk:</b> Ruteren støtter bare grunnleggende DDNS, og det er ikke sikkert at påloggingen og passordet er sikre. Hvis du har en privat WAN-IP-adresse, må du ikke bruke DDNS-tjenesten, da dette kan medføre problemer. </p>",
