"ASRH01" : "<P><font size=4><B>Hjelp for Statiske ruter (Static Routes)</B></font></P><p>  Statiske ruter gir ruteren informasjon den ikke får automatisk på andre måter. Det kan være tilfellet hvis RIP er deaktivert i det lokale nettverket (LAN). (Se skjermbildet IP-konfigurasjon for LAN (LAN IP Setup)). Alle de statiske rutene som er definert, vises i tabellen. Du legger til eller sletter en rute i området under tabellen Statiske ruter (Static Routes).</p><hr><a name=str_table></a><p><b>Slik konfigurerer du en statisk rute:</b> </p><ol><li>Klikk på knappen <b>Legg til (Add)</b>. </li><li>Skriv inn et rutenavn for denne statiske ruten i feltet <b>Rutenavn (Route Name)</b> under tabellen.<br>(Dette et bare for identifikasjonsformål.) </li><li>Velg <b>Privat (Private)</b> hvis du vil begrense tilgangen til bare det lokale nettverket (LAN). </li><li>Velg <b>Aktiv (Active)</b> for å aktivere ruten. </li><li>Skriv inn mål-IP-adresse for det endelige bestemmelsesstedet. </li><li>Skriv inn IP-nettverksmasken for dette bestemmelsesstedet. <br>Hvis det er for en enkelt vert, skriver du <b>255.255.255.255</b>. </li><li>    Skriv inn IP-adressen for gatewayen, som må være en ruter i det samme segmentet. </li><li>Skriv inn et tall mellom to og 15 som <b>metrisk</b> verdi.   <br>Dette representerer nummeret for andre rutere i nettverket. Det fungerer vanligvis best å sette det til 2 eller 3, men hvis det er en direkte tilkobling, setter du det til 2. </li><li>    Klikk på <b>Bruk (Apply)</b> for å føre opp den statiske ruten i tabellen. </li></ol><p><b>Slik redigerer du en statisk rute:</b> <ol><li>Klikk på alternativknappen ved siden av ruten som skal redigeres. </li><li> Oppdater informasjonen.<li>Klikk på <b>Bruk (Apply)</b> når du er ferdig.</ol><p><b>Slik sletter du en statisk rute:</b> <ol><li>Klikk på alternativknappen ved siden av ruten som skal slettes. </li><li>Klikk på <b>Slett (Delete)</b>.</li><li>Klikk på <b>Bruk (Apply)</b> for å slette den statiske ruten fra tabellen. </li></ol>",
