"ARMH01" : "<P><font size=4><B>Hjelp for Ekstern administrasjon (Remote Management)</B></font></P><p>  I skjermbildet Ekstern administrasjon (Remote Management) kan du gi tillatelse til at en bruker kan konfigurere, oppgradere og kontrollere statusen til ruteren via Internett.</p><p> <b>VIKTIG: </b><i>Du må endre standardpassordet for ruteren til et svært sikkert passord.</i></p><hr><a name=turnon></a><p><b>Aktiver Ekstern administrasjon (Turn Remote Management On)</b></p><p><ul> 1. Merk av i avmerkingsboksen <b>Aktiver Ekstern administrasjon (Turn Remote Management On)</b>.<br> 2. Klikk på knappen <b>Bruk (Apply)</b> for å lagre endringen.</ul> </ul> </p> <hr> <a name=address></a><p><b>Adresse for ekstern administrasjon (Remote Management Address)</b></p><p>Dette er adressen som skal brukes når du kobler deg til ruteren fra Internett. Du får tilgang til ruteren ved å skrive inn ruterens WAN-IP-adresse i nettleserens adressefelt (i Internet Explorer) eller i feltet Location (i Netscape), etterfulgt av et kolon (:) og det egendefinerte portnummeret. Hvis for eksempel den eksterne adressen er 10.0.0.123 og du bruker portnummer 8080, skriver du følgende i nettleseren:</p> <p><screen>http://10.0.0.123:8080</screen></p><hr><a name=access></a><p><b>Tillat ekstern tilgang (Allow Remote Access)</b><p>  Du bør av sikkerhetshensyn begrense tilgangen til så få eksterne IP-adresser som mulig. <p><ul>Merk av for <b>Bare denne datamaskinen (Only This Computer)</b> for å gi tilgang til bare én IP-adresse.</ul><p><ul>Merk av for <b>IP-adresseområde (IP Address Range)</b> for å gi tilgang til et område av IP-adresser på Internett. Skriv inn en start- og slutt-IP-adresse for å definere det tillatte området.</ul><p><ul>Merk av for <b>Alle (Everyone)</b> for å gi tilgang til alle på Internett.</ul><hr><a name=port></a><p><b>Portnummer (Port Number)</b></p><p>Weblesertilgang bruker vanligvis standard HTTP-tjenesteport 80. Du kan øke sikkerheten ved å endre webgrensesnittet for ekstern administrasjon til en egendefinert port ved å skrive inn portens nummer i det angitte feltet. Velg et nummer mellom 1024 og 65534, men ikke bruk nummeret på en vanlig tjenesteport.</p><hr> <p><b>Slik lagrer eller avbryter du endringer:</b></p><a name=To></a><p>Klikk på <b>Bruk (Apply)</b> for at endringene skal bli aktivert.<br> Klikk på <b>Avbryt (Cancel)</b> for å gå tilbake til de forrige innstillingene.</p>",
