"AAUH01" : "<P><font size=4><B> USB-innstillinger (hjelp)</B></font></P><P> Hvis du vil ha ekstra sikkerhet, kan du konfigurere ruteren slik at den bare deler godkjente USB-enheter. Hvis du vil aktivere denne funksjonen, velger du Nei og klikker på Bruk.</P><P> Hvis du vil angi de godkjente enhetene, klikker du på Godkjente enheter. </P>",
"AAUH02" : "<P><font size=4><B> Godkjente enheter for USB-stasjon (hjelp)</B></font></P><P> Hvis du vil ha ekstra sikkerhet, kan du konfigurere ruteren slik at den bare deler godkjente USB-enheter. Hvis du vil aktivere denne funksjonen, merker du av for Tillat bare godkjente enheter og klikker på Bruk.</P><P> Slik legger du til en enhet i listen Godkjente USB-enheter:<OL><LI> Enheten må være koblet til ruteren.</LI><LI> Når enheten er tilkoblet, vises den i listen Tilgjengelige USB-enheter. </LI><LI> Velg enheten, og klikk på Legg til. </LI></OL></P><P> Slik fjerner du en enhet fra listen Godkjente USB-enheter:<OL><LI> Velg enheten fra listen Godkjente USB-enheter. </LI><LI> Klikk på Slett. </LI></OL></P>",
