"AUPH01" : "  <p><font size=4><b>       Hjelp for UPnP  </b></font></p><p>UPnP (Universal Plug and Play) hjelper enheter, for eksempel Internett-apparater og datamaskiner, med å få tilgang til nettverket og koble til andre enheter etter behov. UPnP-enheter oppdager automatisk tjenester fra andre registrerte UPnP-enheter i nettverket. </p><a name=turnon></a> <p><b>Aktiver UPnP (Turn UPnP On)</b></p><p>UPnP kan aktiveres for automatisk enhetskonfigurasjon, eller den kan deaktiveres. Standardinnstillingen for UPnP er aktivert. Hvis denne funksjonen er deaktivert, tillater ikke ruteren at enheter automatisk styrer ressursene til ruteren, for eksempel viderekobling av port (tilordning). </p><a name=adv></a>  <p><b>Annonseringsperiode (Advertisement Period)</b></p><p>Annonseringsperioden er hvor ofte ruteren annonserer (kringkaster) UPnP-informasjon. Denne verdien kan være på 1 til 1440 minutter. Standardperioden er 30 minutter. Kortere varighet sikrer at kontrollpunktene har oppdatert enhetsstatus, men innebærer ekstra nettverkstrafikk. Lengre varighet kan medføre at enhetsstatusen ikke er helt oppdatert, men kan redusere nettverkstrafikken betraktelig.</p><a name=live></a>  <p><b>Levetid for annonsering (Advertisement Time to Live)</b></p><p>Levetiden for annonseringen måles i hopp (trinn) for hver sendte UPnP-pakke. Et hopp er antallet trinn som er tillatt å overføre for hver UPnP-annonsering, før den forsvinner. Antallet hopp kan være fra 1 til 255. Standardverdien for annonseringens levetid er 4 hopp, noe som er passende for de fleste hjemmenettverk. Hvis du ser at det er noen enheter som ikke oppdateres eller nås riktig, kan det være nødvendig å øke verdien noe.</p><a name=table></a><p><b>Tabell over UPnP-porttilordning (UPnP Portmap Table)</b></p><p>Tabellen over UPnP-porttilordning viser IP-adressen til hver UPnP-enhet som er koblet til ruteren for øyeblikket, og hvilke porter (interne og eksterne) enheten har åpnet. Tabellen over UPnP-porttilordning viser også hvilken type port som er åpnet, og om porten fremdeles er aktiv, for hver IP-adresse.<p><b>Slik lagrer, avbryter eller oppdaterer du tabellen:</b></p><p>Klikk på <b>Bruk (Apply)</b> for å lagre de nye ruterinnstillingene. <br>Klikk på <b>Avbryt (Cancel)</b> for å forkaste endringer som ikke er lagret. <br>Klikk på <b>Oppdater (Refresh)</b> for å oppdatere tabellen over porttilordning og vise de aktive portene som for øyeblikket er åpnet av UPnP-enheter.  ",
