"ATMH01" : "<P><font size=4><B> Hjelp for Trafikkmåler  </B></font></P><A name=internet></A><H2 class=helpfile> <b>Trafikkmåler for Internett  </b></H2><A name=meter></A><P><B> Aktiver trafikkmåler  </B> <BR> Velg dette alternativet hvis du ønsker å registrere mengden av Internett-trafikk som passerer gjennom ruterens Internett-port.<P><B> Kontroll av trafikkmengde av  </B> <BR> Velg dette alternativet hvis du ønsker å registrere og begrense mengden av Internett-trafikk som passerer gjennom ruterens Internett-port.<UL><LI> Ingen grense – hvis dette alternativet er valgt, finnes det ingen angitt begrensning for når trafikkgrensen nås.<LI> Bare nedlasting – hvis dette alternativet er valgt, vil den angitte begrensningen bare gjelde for innkommende trafikk. <LI> Begge retninger – hvis dette alternativer er valgt, vil den angitte begrensningen gjelde både innkommende og utgående trafikk.</UL><P><B> Kontroll av tilkoblingstid</B> <BR> Velg dette alternativet hvis du ønsker å registrere og begrense tidsbruken til Internett-tilkoblingen.<P><B> Månedsgrense  </B><BR> Angi grensen for den månedlige mengden eller tidsgrensen for tilkoblingen.<P><B> Rund av datavolumet per tilkobling med</B> <BR> Noen Internett-leverandører tar betalt for en bestemt mengde med ekstra data når brukerne oppretter en ny tilkobling. Hvis det er tilfellet, angir du den ekstra datamengden her.<A name=counter></A><H2 class=helpfile> <b>Trafikkteller</b></H2><P><B> Start trafikktelleren på nytt</B><BR> Dette bestemmer når trafikktelleren skal starte på nytt. Velg ønsket klokkeslett og dag i måneden.<P><B> Start telleren på nytt nå</B> <BR> Klikk på denne knappen for å starte trafikktelleren umiddelbart.<A name=reached></A><H2 class=helpfile> <b> Trafikkontroll  </b></H2><P><B> Vis en advarselsmelding</B><BR> Angi en verdi som ikke er null, for at ruteren skal vise en advarselsmelding når den månedlige grensen for datamengde eller tilkoblingstid er nådd etter at den konfigurerte mengden er overskredet. Det er bare når vinduet Trafikkstatus er åpent at meldingen kan vises.<P><B> Når månedsgrensen er nådd</B><BR><P> Kontroller de ønskede handlingene:<UL> <LI> Lampen for Internett blinker grønt/gult – lampen for Internett skifter mellom grønt og gult lys. <LI> Koble fra og deaktiver Internett-tilkoblingen – all tilgang til Internett blokkeres. </UL><A name=statistics></A><H2 class=helpfile><b> Statistikk for Internett-trafikk</b></H2><P> Dette viser statistikken over Internett-trafikken via Internett-porten. <BR> Hvis du ikke har aktivert trafikkmåleren, er ikke denne statistikken tilgjengelig. <P><B> Trafikkstatus</B> <BR><BR> Klikk på denne knappen hvis du ønsker en live oppdatering av bruksstatusen til Internett-trafikken.<P></P>",
