"GDH01" : "<p><font size=4><B>NETGEAR Downloader</B></font></p><p><b>NETGEAR Downloader</b> støtter nedlastingsprotokollene HTTP, FTP, BT og eDonkey. Med NETGEAR Downloader kan du bruke en <b>NETGEAR-ruter</b> til å laste ned Internett-filer og lagre dem på en USB-lagringsenhet uten å ha en datamaskin på.</p><hr><a name=green_path></a><b>Lagre som bane:  </b>Velg en plassering der du ønsker å lagre nedlastede filer.</p>",
"GDH02" : "<p><b>FTP-/HTTP-nedlasting</b> tillater at brukeren laster ned filer fra Internett via FTP-/HTTP-protokoller.</p><hr><p><a name=http_url></a><b>Kobling til FTP-/HTTP-nedlasting:  </b>Dette er en Internett-adresse, og viser URL-adressen til filen du ønsker å laste ned fra Internett. Formatet er ftp:// eller http://.<br><a name=http_name></a><b>Brukernavn (valgfritt):  </b>Dette feltet er valgfritt. Skriv inn brukernavnet til serveren hvis serveren krever det. Maksimumslengden på et brukernavn er 32 tegn.<br><a name=http_password></a><b>Passord (valgfritt): </b> Dette feltet er valgfritt. Skriv inn passordet til serveren hvis serveren krever det. Maksimumslengden til et passord er 32 tegn.<br><b>Legg til:  </b>Klikk på knappen \&quot;Legg til\&quot; for å legge til en ny nedlastingsoppgave.<br><b>Tilbakestill:  </b>Klikk på knappen \&quot;Tilbakestill\&quot; for å tilbakestille alt innholdet du har skrevet inn.</p><hr><p><a name=http_table></a><b>Last ned informasjonstabell</b></p><p><b>Stopp midlertidig:  </b>Klikk på knappen \&quot;Stopp midlertidig\&quot; for å stoppe en nedlastingsoppgave midlertidig.<br><b>Gjenoppta:  </b>Klikk på knappen \&quot;Gjenoppta\&quot; for å gjenoppta en oppgave du har stoppet midlertidig.<br><b>Slett:  </b>Klikk på knappen \&quot;Slett\&quot; for å slette en eksisterende oppgave.</p><hr><p><a name=http_table></a><b>Nedlastede filer</b></p><p><b>Fjern historikk:  </b>Klikk på knappen \&quot;Fjern historikk\&quot; for å fjerne alle fullførte nedlastingsoppgaver.</p>",
"GDH03" : "<p><b>BT-nedlasting</b> tillater at brukeren laster ned filer fra Internett via BT-protokoll.</p><hr><p><a name=bt_loc></a><b>Torrent-plassering:  </b>Angi plassering for en torrent-fil, og klikk på knappen \&quot;Bla gjennom\&quot; for å velge torrentfilen fra en PC eller en USB-lagringsenhet.<br>",
"GDH04" : "<p><b>eDonkey-nedlasting</b> tillater at brukeren laster ned filer fra Internett via en eD2K-protokoll.</p><hr><p><a name=emule_url></a><b>Kobling til eDonkey-nedlasting:  </b>Dette er en Internett-adresse og viser URL-adressen til filen du ønsker å laste ned fra Internett. Formatet er ed2k://.<br>",
"GDH05" : "<p>Du kan installere en ny versjon av NETGEAR Downloader-programmet via denne siden.</p><p><a name=check></a>Klikk på knappen \&quot;<b>Kontroller</b>\&quot;. Da søker ruteren automatisk etter en <b>ny versjon</b> av NETGEAR Downloader-programmet på webområdet til <b>NETGEAR</b>. Hvis en ny versjon blir funnet, kan du gå til webområdet til <b>NETGEAR</b> for å hente den.</p>",
"GDH06" : "<P><font size=4><B>Innstillingshjelp for NETGEAR Downloader</B></font></p><HR><a name=gd_down_speed></a><P><B> Maks. antall samtidige nedlastingsoppgaver  </B><p>Spesifiser det maksimale antallet samtidige nedlastingsoppgaver. Standardinnstillingen er basert på den trådløse ruterens prosessorhastighet og DRAM-størrelse.</p><P><B>Maks. nedlastingshastighet per tjeneste (0 betyr ubegrenset)</B></P><p>Denne innstillingen begrenser den maksimale nedlastingshastigheten (enheten er KB/s) for hver tjeneste, HTTP/FTP, BT eller eDonkey. Standardinnstillingen er 0 (0 betyr at nedlastingshastigheten er ubegrenset).</p><a name=gd_up_speed></a><p><B>Maks. opplastingshastighet per tjeneste (0 betyr ubegrenset)  </B></p><p>Denne innstillingen begrenser den maksimale opplastingshastigheten (enheten er KB/s) for hver tjeneste, HTTP/FTP, BT eller eDonkey. Standardinnstillingen er 0 (0 betyr at opplastingshastigheten er ubegrenset).</P><a name=gd_task_num></a><P><B> Aktiver automatisk oppdatering av status  </B><p>Aktiver dette alternativet for automatisk å oppdatere oppgavestatusen til nedlastingen. Hvis dette alternativet ikke aktiveres, vil statusen bare oppdateres når knappen Refresh (Oppdater) klikkes på. Automatisk statusoppdatering krever mer prosessorkraft, så hvis du aktiverer den, kan det hende andre ruterfunksjoner fungerer tregere.</p><P><B> Sende et e-postvarsel  </B><p>Aktiver dette alternativet for å sende e-postvarsler når nedlastingsoppgaven er fullført. Bruk knappen Configure Email (Konfigurer e-post) for å konfigurere kontoinformasjonen til e-posten. </p>",
