"TVMH_001" : "<B>FastTrack</B> Første gang du slår på FastTrack, må du spesifisere båndbredden som du ønsker å reservere, og angi knappen for FastTrack. Fyll ut alle feltene på skjermen, og klikk på <B>Bruk</B> slik at endringene blir gjeldende. <B>FastTrack-status:</B> Dette feltet viser om FastTrack er slått av eller på. <B>Slå på FastTrack:</B> Som standard er FastTrack avslått, og knappen på front- eller bakpanelet fungerer som en WPS-knapp (Wi-Fi Protected Setup). (Hvis den trådløse ruteren ikke har en fysisk WPS-knapp, kan du gå til FastTrack-fanen i GUI for å konfigurere den.) Hvis du vil slå på FastTrack, velger du denne boksen. <B>Båndbredde reservert for klarert IP-adresse</B> Spesifiser hvilken prosentdel av båndbredden på den trådløse ruteren som skal reserveres når du kobler til fra en klarert IP-adresse. Dette hindrer at andre bruker all båndbredden. Når du kobler til ruteren fra den klarerte IP-adressen, er du garantert å ha nok båndbredde til programmer for direkteavspilling av video. Det er fire alternativer: 50 %, 60 %, 70 % og 80 %. <B>Knapp:</B> Du kan angi knappen på frontpanelet til å fungere på to forskjellige måter: WPS (standard) eller FastTrack. Velg antenneknappen for alternativet du ønsker.",
