"ASMH01" : "<P><font size=4><B>Hjelp for SmartZone</B></font></P><p>SmartZone er en Netgear-funksjon som dynamisk forbedrer tilkoblingen av de trådløse enhetene i miljøer med trådløs ruter og forlenger(e) fra Netgear. Den gjør at du finner bedre tilgangspunkter når de trådløse enhetene er koblet til i SmartZone-nettverket.</p><p>Når den er aktivert, vil SmartZone-aktiverte enheter oppdage nærliggende enheter og knyttes sammen som et SmartZone-nettverk når samme trådløse SSID, sikkerhetstype og passordinnstillinger brukes.</p><br><P><font size=4><B>Aktivér SmartZone</B></font></p><p>Når funksjonen er aktivert, vil enheten oppdage og samarbeide med andre SmartZone-enheter.</p><br><P><font size=4><B>Roamingfølsomhet</B></font></p><p>Dette alternativet definerer hvordan SmartZone dynamisk finner et bedre tilgangspunkt for de trådløse enhetene.</p><br><p><font size=4>",
"ASMH02" : "<P><font size=4><B>Hjelp for SmartZone</B></font></P><p>SmartZone er en Netgear-funksjon som dynamisk forbedrer tilkoblingen av de trådløse enhetene i miljøer med trådløs ruter og forlenger(e) fra Netgear. Den gjør at du finner bedre tilgangspunkter når de trådløse enhetene er koblet til i SmartZone-nettverket.</p><p>Når den er aktivert, vil SmartZone-aktiverte enheter oppdage nærliggende enheter og knyttes sammen som et SmartZone-nettverk når samme trådløse SSID, sikkerhetstype og passordinnstillinger brukes.</p><br><p><font size=4><B>Trådløst topologikart</B></font></P><p>Det viser alle trådløse enheter i SmartZone-nettverket, inkludert ruter, forlenger og dine enheter. Du kan klikke på nodene som vises på kartet, for detaljert informasjon.</p><p>Hvis du får tilgang til denne nettsiden fra en trådløs enhet, vil enheten du brukte merkes i gult på kartet.</p><br><p><font size=4><B>Endre</B></font></P><p>Endre vertsnavnet for SmartZone-enheten.</p><br><p><font size=4><B>Bytte</B></font></P><p>Endre uplink-tilgangspunktet til utvideren.</p><br><p><font size=4><B>Koble til</B></font></P><p>Tving tilkoblinger til trådløse stasjoner til et annet tilgangspunkt</p><br>",
