"LEDS009" : "<p><font size=4><B>Hjelp for lampekontrollinnstillinger</B></font></p><HR><p>På siden for lampekontrollinnstillinger kan du deaktivere eller aktivere blinkingen på Internett-lampen, LAN-lampen, trådløslampen og lamper for lagringsgrensesnitt når datatrafikken er registrert. Du kan også velge å slå av alle lamper bortsett fra strømlampen.</p>",
