"RAEM11" : "Trådløs nettverkstilkobling",
"RAEM12" : "<a tabindex=-1 href=&quot;javascript:loadhelp(&apos;_rae_router&apos;,&apos;mode&apos;)&quot;><b>Rutermodus:</b></a>Med denne modusen kan du benytte funksjonene til NETGEAR-ruteren. NETGEAR-ruteren konfigureres som en vanlig WiFi-ruter bak den eksisterende ruteren eller gatewayen. Denne modusen krever at alle enhetene dine kobles til den nye NETGEAR-ruteren, og ikke til den eksisterende gatewayen.",
"RAEM13" : "<a tabindex=-1 href=&quot;javascript:loadhelp(&apos;_rae_extender&apos;,&apos;ext_mode&apos;)&quot;><b>Utvidermodus:</b></a> NETGEAR-ruteren fungerer som en nettverksforlenger. Denne modusen gjør at du kan forlenge rekkevidden til det eksisterende WiFi-nettverket",
"RAEM14" : "Velg et eksisterende nettverk du ønsker å forlenge. Du kan forlenge 2,4 G-båndet, 5 G-båndet eller begge.",
"RAEM15" : "Klientenhetene kan kobles til SSID-en nedenfor.",
"RAEM16" : "Ethernet-portene til wifi bruker følgende bånd",
"RAEM17" : "<A tabindex=-1 href=&quot;javascript:loadhelp(&apos;_rae_ap&apos;,&apos;ip_tag&apos;)&quot;><b>AP-modus:</b></a>NETGEAR-ruteren fungerer som et trådløst tilgangspunkt. Denne modusen er passende for enkel konfigurering hvis enhetene allerede er koblet til den eksisterende ruteren eller gatewayen, eller hvis du bare vil bruke denne nye NETGEAR-ruteren til å forlenge WiFi-dekningen. Enkelte ruterfunksjoner er ikke tilgjengelige i tilgangspunktmodus.",
"RAEM18" : "<p>Hvis du vil forlenge WiFi-dekningen, kan du også konfigurere ruteren i rekkeviddeforlengermodus. WiFi-nettverksforlengeren forlenger det trådløse nettverket, slik at det inkluderer området utenfor rekkevidden til det eksisterende Wi-Fi-nettverket. For å konfigurere denne modusen kobler du NETGEAR-ruteren til den eksisterende ruterens/gatewayens SSID. NETGEAR anbefaler at du kun kobler til forlengerens trådløse nettverk når en PC eller trådløs enhet er i en &quot;dødsone&quot;, der nettverkstilkoblingen til den eksisterende ruteren er dårlig eller ikke-eksisterende. Dette er fordi datatrafikk som går gjennom forlengerens trådløse nettverk, er tregere enn trafikk direkte fra det opprinnelige trådløse ruternettverket.</p><p>I denne modusen blir IP-adressen til den nye ruteren som standard tilordnet dynamisk av gatewayen, og det er usannsynlig at den er 192.168.1.1. Du kan imidlertid fremdeles bruke URL-adressen http://www.routerlogin.net for å få tilgang til ruterens administrasjonsgrensesnitt fra en enhet som er koblet til ruteren. Enkelte ruterfunksjoner er ikke tilgjengelige i denne modusen, og du må bruke rutermodus hvis du vil bruke disse funksjonene.</p>",
"RAEM19" : "Bruk trådløsprofilen i administratorprogramvaren (Windows, NETGEAR Adapter Wizard osv.), og koble til forlengernettverket på nytt med informasjonen som vises nedenfor.",
"RAEM20" : "For å sørge for at enhetene har optimal trådløs ytelse, anbefaler NETGEAR at du har en unik SSID for forlengernettverket, og at du bare kobler til forlengernettverket når det eksisterende nettverket ikke leverer god nok dekning",
