"RAEM26" : "Navn (SSID)",
"RAEH1" : "<p><font size=4><b>Hjelp for rutermodus</b></font></p><a name=mode></a><p><b>Rutermodus:</b> Med denne modusen kan du benytte funksjonene til NETGEAR-ruteren. NETGEAR-ruteren konfigureres som en vanlig WiFi-ruter bak den eksisterende ruteren eller gatewayen. Denne modusen krever at alle enhetene dine kobles til den nye NETGEAR-ruteren, og ikke til den eksisterende gatewayen.</p><p><b>Ruterfunksjoner</b></p><p>De følgende ruterfunksjonene er ikke tilgjengelige hvis du velger tilgangspunkt- eller forlengermodus:</p><ul><li>gjestenettverk</li><li>foreldrekontroll</li><li>QoS</li><li>tilgangskontroll</li><li>trafikkmåler</li><li>blokkering av nettsteder</li><li>blokkering av nettsteder</li><li>blokkering av tjenester</li><li>statisk rute</li></ul><a name=inet></a><p><b>Internett-innstillinger:</b> Kobling til AVANSERT -> Konfigurering -> Side for Internett-konfigurering. Bruk denne siden for å endre Internett-innstillingene for ruteren.</p><a name=wifi></a><p><b>Trådløsinnstillinger:</b> Kobling til AVANSERT -> Konfigurering -> Side for Internett-konfigurering. Bruk denne siden for å endre Internett-innstillingene for ruteren.</p>",
"RAEH2" : "<p><font size=4><b>Hjelp for AP-modus</b></font></p><a name=ip_tag></a><p><b>AP-modus:</b> gjør at denne enheten kan fungerer som et enkeltstående tilgangspunkt på det eksisterende nettverket ditt. Denne modusen passer for enkel konfigurering hvis det allerede er enheter som er koblet til den eksisterende ruteren eller gatewayen, eller hvis du bare vil bruke denne nye NETGEAR-ruteren til å forlenge rekkevidden til WiFi-nettverket. Enkelte ruterfunksjoner er ikke tilgjengelige i tilgangspunktmodus.</p><p><b>Ruterfunksjoner</b></p><p>De følgende ruterfunksjonene er ikke tilgjengelige hvis du velger tilgangspunkt- eller forlengermodus:</p><ul><li>gjestenettverk</li><li>foreldrekontroll</li><li>QoS</li><li>tilgangskontroll</li><li>trafikkmåler</li><li>blokkering av nettsteder</li><li>blokkering av nettsteder</li><li>blokkering av tjenester</li><li>statisk rute</li></ul><a name=mac_tag></a><p><b>Hente dynamisk fra eksisterende ruter</b></p><p>Enheten finner en IP-adresse fra DHCP-serveren automatisk</p><a name=name_tag></a><p><b>Bruke fastsatt IP-adresse</b></p><p>Bruk dette alternativet hvis du vil konfigurere IP-adressen, nettverksmasken, gateway-IP-adressen og IP-adressen til DNS-serveren manuelt.</p><a name=priority_tag></a><p><b>Trådløsinnstillinger:</b> Kobling til AVANSERT -> Konfigurering -> Side for trådløs konfigurering. Bruk denne siden for å endre trådløsinnstillingene for tilgangspunktet.</p>",
"RAEH3" : "<p><font size=4><b>Hjelp for utvidermodus</b></font></p><a name=ext_mode></a><p><b>Utvidermodus</b>: WiFi-nettverksforlengeren forlenger det trådløse nettverket, slik at det inkluderer området utenfor rekkevidden til det eksisterende Wi-Fi-nettverket. NETGEAR anbefaler at du kun kobler til forlengerens trådløse nettverk når en PC eller trådløs enhet er i en &quot;dødsone&quot;, der nettverkstilkoblingen til den eksisterende ruteren er dårlig eller ikke-eksisterende. Dette er fordi datatrafikk som går gjennom forlengerens trådløse nettverk, er tregere enn trafikk direkte fra det opprinnelige trådløse ruternettverket. </p><p>Hvis du ikke kan utføre tilkoblingen fra den trådløse enheten til forlengeren, må du flytte forlengeren til et annet sted midt mellom enheten og ruteren. Hvis enheten ikke kan kobles til forlengeren etter at du har prøvd flere steder, kan du flytte forlengeren nærmere enheten.</p><a name=dyn></a><p><b>Hente dynamisk fra eksisterende ruter</b></p><p>Enheten finner en IP-adresse fra DHCP-serveren automatisk</p><a name=fix></a><p><b>Bruke fastsatt IP-adresse</b></p><p>Bruk dette alternativet hvis du vil konfigurere IP-adressen, nettverksmasken, gateway-IP-adressen og IP-adressen til DNS-serveren manuelt.</p><a name=uplink></a><p><b>Opplink</b></p><p>2,4 G / 5 G: Bruk disse fanene for å bytte mellom opplinkinnstillinger for 2,4 G og opplinkinnstillinger for 5 G. Velg ett bånd, og velg deretter SSID-en til den eksisterende ruteren/gatewayen. Et popup-vindu viser SSID-en og sikkerhetsalternativet. Skriv inn passordet for å koble til. Du kan bruke rullegardinfeltet for å bla opp og ned på listen. Hvis du ikke ser SSID-en til den eksisterende ruteren/gatewayen på listen, kan du klikke på Annet, skrive inn SSID-en, velge sikkerhetsalternativet fra rullegardinlisten og skrive inn passordet. Det tilkoblede båndet viser en hake på fanen.</p><a name=wireless></a><p><b>Trådløsinnstillinger:</b> Kobling til AVANSERT -> Konfigurering -> Side for trådløs konfigurering. Bruk denne siden for å endre gjeldende trådløsinnstillinger for tilgangspunktet.</p><a name=ethport></a><p><b>Ethernet-porter til WiFi bruker følgende bånd</b></p><p>Velg hvilke WiFi-bånd du ønsker å knytte Ethernet-portene til. Sørg for at du knytter til det WiFi-båndet som du har konfigurert opplinktilkoblingen for.</p><p><b>Opplinktilkobling mislyktes</b></p><p>Hvis tilkoblingen til AP-roten mislyktes, som indikert på grensesnittet, må du kontrollere følgende elementer:</p><p>  Kontroller om du har skrevet inn riktig passord for opplink-SSID-en.</p><p>  Prøv å flytte forlengeren nærmere AP-roten eller til et annet sted med bedre sikt.</p><p>  Hvis du har Access Control List (ACL) aktivert i AP-roten, må du sørge for at du har lagt til MAC-adressen nedenfor i ruterens Access Control List (ACL).</p><ul><li>MAC-adressen til forlengeren er: XXXXX</li><li>MAC-adressen til klientens trådløse adapter er: XXXXX</li></ul>",
