"DNH1" : "<p><font size=4><b>Hjelp for enhetsnavn</b></font></p><p><b>Enhetsnavn:</b> enhetsnavn identifiserer denne ruteren. Det gis til klientenheter som kobles til ruteren for å gjenkjenne denne enheten. </p><p>Det skal starte med en bokstav og skal bare inneholde bokstaver, tall, symbolene ‘-‘ og ‘_’, [a-zA-Z]+[a-zA-Z0-9\-\_]. Maksimumslengden er 16 tegn</p>",
