"PLC016" : "<P><font size=4><B>Hjelp for DST-innstillinger</B></font></P><p><font size=3><B>DST-ruternavn</B></font></p><p>Dette er et mnemoteknisk eller meningsfullt navn som brukere bruker til å identifisere denne DST-enheten. Dette navnet kan bestå av opptil 12 tegn. Standard enhetsnavn er modellnavnet til enheten. Du kan redigere dette tekstfeltet og deretter velge enhetsnavnet etter at du har klikket på Bruk.</p><p><font size=3><B>Innstillinger for ruterens DST-krypteringsnøkkel</B></font></p><p>Det finnes to alternativer som lar brukeren velge ønsket DST-krypteringsnøkkel.<br><br><b>Bruk gjeldende krypteringsnøkkel:</b> Når brukeren velger dette alternativet, vises den gjeldende krypteringsnøkkelen automatisk i feltet. Dette feltet kan ikke redigeres. Hvis kunden ikke har endret nøkkelen, betyr det at standard krypteringsnøkkel vises. Standard krypteringsnøkkel er HomePlugAV. Hver gang brukeren logger på siden for DST-innstillinger, velges dette alternativet.<br><br><b>Opprett ny krypteringsnøkkel:</b> Brukeren kan velge sin egen krypteringsnøkkel for nettverket i dette feltet. Denne krypteringsnøkkelen kan bestå av maks. 64 tegn.</p><p><font size=3><B>Konfigurere eksterne DST-innstillinger:</B></font></p><p>Her finnes en tabell som gir brukeren informasjon om alle DST-enhetene som har blitt oppdaget. <br><B>Enhetsnavn:</B> Her vises DST-enhetene som er oppdaget på DST-nettverket. Brukeren kan redigere det til et beskrivende navn som Kontor eller Kjøkken. Dette navnet kan bestå av opptil 12 tegn<br><B>Modellnavn:</B> Dette identifiserer modellnummeret til DST-adapteren.<br><B>MAC-adresse:</B> MAC-adressen til DST-enheten. Dette står også på produktetiketten, som kanskje ikke er synlig når enheten er koblet til.<br><B>Lampestatus:</B> Dette viser lampestatusen til den eksterne DST-enheten. Brukeren kan velge alternativet AV eller PÅ for å konfigurere lampen til den eksterne DST-enheten.<br><B>Krypteringsnøkkel:</B> Når alternativet <I>Bruk standard krypteringsnøkkel</I> er valgt, er dette alternativet grått og ikke merket av. Når alternativet Opprett ny kryperigsnøkkel er valgt, er dette alternativet ikke grått, og brukeren kan velge om han/hun vil merke av alternativet eller ikke. Hvis alternativet er merket av, kommer den eksterne DST-enheten til å bruke den samme krypteringsnøkkelen som den lokale DST-enheten.<br></p><p><font size=3><B>Lampestatus</B></font></p><p>Brukeren kan slå DST-lampen av og på. Standardverdien er PÅ.</p>",
"PLC017" : "<P><font size=4><B>Hjelp for DST-status</B></font></P><p><font size=3><B>Fastvareversjon for DST</B></font></p><p>Vis fastvareversjonen til den lokale DST-enheten.</p><p><font size=3><B>Tilkoblingsstatus for DST</B></font></p><p>Vis tilkoblingsstatusen til den lokale DST-enheten.</p><p><font size=3><B>Status for ekstern DST-adapter</B></font></p><p>Vis fastvareversjonen til den lokale DST-enheten. <br><B>Enhetsnavn:</B> Her vises navnet på den eksterne DST-adapteren som ble oppdaget på DST-nettverket.<br><B>Modellnavn:</B> Dette identifiserer modellnummeret til DST-adapteren.<br><B>Tx-hastighet (Mbps):</B> Hastigheten som enheten overfører data i.<br><B>Rx-hastighet (Mbps):</B> Hastigheten som enheten mottar data i.<br><B>MAC-adresse:</B> MAC-adressen til den eksterne DST-adapteren. Dette står også på produktetiketten, som kanskje ikke er synlig når enheten er koblet til.<br><B>IP-adresse:</B> IP-adressen til den eksterne DST-adapteren. <br><B>Fastvareversjon:</B> Fastvareversjonen til den eksterne DST-adapteren.<br><B>Lampestatus:</B> Lampestatus for den eksterne DST-adapteren.<br></p>",
