"PLC051" : "<p><font size=&quot;4&quot;><b>Hjelp for DST-innstillinger</b></font></p><p><font size=&quot;3&quot;><b>DST-ruternavn</b></font></p><p>Dette er et mnemoteknisk eller meningsfullt navn som brukere bruker til å identifisere denne DST-enheten. Dette navnet kan bestå av opptil 12 tegn. Standard enhetsnavn er modellnavnet til enheten. Du kan redigere dette tekstfeltet og deretter velge enhetsnavnet etter at du har klikket på knappen &quot;Bruk&quot;.</p><p><font size=&quot;3&quot;><b>Innstillinger for ruterens DST-krypteringsnøkkel</b></font></p><p>Det finnes tre alternativer som lar brukeren velge hva slags DST-krypteringsnøkkel han/hun vil ha.<br><br><b>Ingen endring i krypteringsnøkkelen:</b> Dette er standardalternativet når brukeren ser denne siden for nøkkelinnstillinger. For dette alternativet trenger du ikke å vise noe informasjon. Hvis brukeren fortsetter å velge dette alternativet, trenger vi ikke å endre nøkkelen eller velge den samme nøkkelen igjen etter at brukeren har klikket på knappen &quot;Bruk&quot;. Noe som betyr at DST-nettverket ikke blir frakoblet.<br><br><b>Bruk standard krypteringsnøkkel:</b> Når brukeren velger dette alternativet, vises standard krypteringsnøkkel automatisk i feltet. Standard krypteringsnøkkel er <b>HomePlugAV</b>. Etter at brukeren har klikket på knappen &quot;Bruk&quot;, blir denne krypteringsnøkkelen for standardnettverket tatt i bruk på enheten.<br><br><b>Opprett ny krypteringsnøkkel:</b> Brukeren kan angi sin egen nettverkskrypteringsnøkkel i feltet. Denne krypteringsnøkkelen kan bestå av maks. 64 tegn.</p><p><font size=&quot;3&quot;><b>Konfigurere eksterne DST-innstillinger:</b></font></p><p>Her finnes en tabell som gir brukeren informasjon om alle DST-enhetene som har blitt oppdaget. <br><b>Enhetsnavn:</b> Her vises DST-enhetene som er oppdaget på DST-nettverket. Brukeren kan redigere det til et beskrivende navn som Kontor eller Kjøkken. Dette navnet kan bestå av opptil 12 tegn<br><b>Modellnavn:</b> Dette identifiserer modellnummeret til DST-adapteren.<br><b>MAC-adresse:</b> MAC-adresse for DST-enhet. Dette står også på produktetiketten, som kanskje ikke er synlig når enheten er tilkoblet.<br><b>Nøkkeltype:</b> Dette viser nøkkeltypen for den eksterne DST-enheten. Det finnes bare to typer. Den ene er &quot;Offentlig&quot; og den andre er &quot;Privat&quot;. <br><b>Krypteringsnøkkel:</b> Når alternativet <i>Bruk standard krypteringsnøkkel</i> er valgt, vises dette alternativet i grått og er ikke huket av. Når alternativet Opprett ny kryperigsnøkkel er valgt, er dette alternativet ikke grått, og brukeren kan velge om han/hun vil merke av alternativet eller ikke. Hvis alternativet er huket av, bruker den eksterne DST-enheten den samme krypteringsnøkkelen som den lokale DST-enheten.<br><b>Indikatorstatus:</b> Dette viser indikatorstatusen for den eksterne DST-enheten. Brukeren kan velge alternativet &quot;AV&quot; eller &quot;PÅ&quot; for å konfigurere lampen til den eksterne DST-enheten.<br></p>",
