"PLC069" : "<P><font size=4><B>Hjelp for DST-innstillinger</B></font></P><p><font size=3><B>DST-ruternavn</B></font></p><p>Dette er et mnemoteknisk eller meningsfullt navn som brukere bruker til å identifisere denne DST-enheten. Dette navnet kan bestå av opptil 12 tegn. Standard enhetsnavn er modellnavnet til enheten. Du kan redigere dette tekstfeltet og deretter velge enhetsnavnet etter at du har klikket på knappen &quot;Bruk&quot;.</p><p><font size=3><B>Innstillinger for ruterens DST-krypteringsnøkkel</B></font></p><p>Det finnes tre alternativer som lar brukeren velge ønsket DST-krypteringsnøkkel.<br><br><b>Ingen endring på krypteringsnøkkelen:</b> Dette er standardalternativ når brukeren ser denne siden for nøkkelinnstillingen. For dette alternativet trenger du ikke å vise noe informasjon. Hvis brukeren fortsetter å velge dette alternativet, trenger vi ikke å endre nøkkelen eller velge den samme nøkkelen igjen etter at brukeren har klikket på knappen Bruk. Noe som betyr at DST-nettverket ikke blir frakoblet.<br><br><b>Bruk standard krypteringsnøkkel:</b> Når brukeren velger dette alternativet, vises den standard krypteringsnøkkelen automatisk i feltet. Standard krypteringsnøkkel er <i>HomePlugAV</i>. Etter at brukeren har klikket på knappen Bruk, brukes nettverkets standard krypteringsnøkkel på denne enheten.<br><br><b>Opprett ny krypteringsnøkkel:</b> Brukeren kan velge sin egen krypteringsnøkkel for nettverket i dette feltet. Denne krypteringsnøkkelen kan bestå av maks. 64 tegn.</p><p><font size=3><B>Konfigurere eksterne DST-innstillinger:</B></font></p><p>Her finnes en tabell som gir brukeren informasjon om alle DST-enhetene som har blitt oppdaget. <br><B>Enhetsnavn:</B> Her vises DST-enhetene som er oppdaget på DST-nettverket. Brukeren kan redigere det til et beskrivende navn som Kontor eller Kjøkken. Dette navnet kan bestå av opptil 12 tegn<br><B>Modellnavn:</B> Dette identifiserer modellnummeret til DST-adapteren.<br><B>MAC-adresse:</B> MAC-adressen til DST-enheten. Dette står også på produktetiketten, som kanskje ikke er synlig når enheten er koblet til.<br><B>Nøkkeltype:</B> Nøkkeltype for ekstern DST-enhet. Det finnes bare to typer. Den ene er &quot;Offentlig&quot; og den andre er &quot;Privat&quot;. Hvis den gjeldende nøkkelen er <i>HomePlugAV</i>, vises nøkkeltypen som Offentlig. Hvis ikke vises den som Privat.<br><B>Krypteringsnøkkel:</B> Når alternativet <I>Bruk standard krypteringsnøkkel</I> er valgt, er dette alternativet grått og ikke merket av. Når alternativet Opprett ny krypteringsnøkkel er valgt, er dette alternativet IKKE grått, og brukeren kan velge om han/hun vil merke av alternativet eller ikke. Hvis alternativet er merket av, kommer den eksterne DST-enheten til å bruke den samme krypteringsnøkkelen som den lokale DST-enheten.<br><B>Lampestatus:</B> Dette viser lampestatusen til den eksterne DST-enheten. Brukeren kan velge alternativet &quot;AV&quot; eller &quot;PÅ&quot; for å konfigurere lampen til den eksterne DST-enheten.<br></p>",
