"EAggr_help001" : "<P><font size=4><B>Ethernet-portaggregasjon</B></font></P><p>Ethernet-portaggregasjon gjør at ruteren kan kombinere Ethernet-port 1 og 2 for dataoverføring til en støttet enhet, for eksempel en NAS-enhet. Merk deg at Ethernet-portaggregasjon også kalles for koblingsaggregasjon, portgruppering og porttrunkering.</p><p name=agg_setup id=agg_setup></p><p><b>Miljøkonfigurering</b><p><ol><li>Koble en enhet som støtter Ethernet-portaggregasjon, for eksempel en NAS-enhet eller en nettverkssvitsj, til Ethernet-port 1 og 2 på ruteren med Ethernet-kabler.</li><li>Konfigurer Ethernet-portaggregasjon på den enheten som er koblet til Ethernet-port 1 og 2 på ruteren.</li> Hvis du vil ha mer informasjon om hvordan du konfigurerer Ethernet-portaggregasjon på enheten din, kan du se i dokumentasjonen som fulgte med enheten.<br></ol><p name=agg_config id=agg_config></p><p><b>Ruterkonfigurering</b><p><ul><li>Déaktiver. Deaktiverer funksjonen for Ethernet-portaggregasjon på ruteren. Ethernet-port 1 og 2 kan brukes som uavhengige Ethernet-porter.<li>Dynamisk (IEEE 802.3ad). Ruteren kommuniserer med enheten som er koblet til Ethernet-port 1 og 2 på ruteren, og kontrollerer om Ethernet-portaggregasjon er støttet på enheten. <br>Hvis Ethernet-portaggregasjon er støttet, slår ruteren automatisk sammen Ethernet-port 1 og 2. Hvis ikke fungerer Ethernet-port 1 og 2 som uavhengige Ethernet-porter. </ul><p name=agg_status id=agg_status></p><p><b>Status for Ethernet-portaggregasjon</b><p><ul><li>Inaktiv. En enhet med Ethernet-portaggregasjon er ikke koblet til Ethernet-port 1 og 2 på ruteren.<li>Aktiv. En enhet med Ethernet-portaggregasjon er koblet til Ethernet-port 1 og 2 på ruteren. </ul>",
"EAggr_help002" : "<P><font size=4><B>Ethernet-portaggregasjon</B></font></P><p>Ethernet-portaggregering gjør at ruteren kan kombinere Ethernet-portene 1 og 2 for dataoverføring til en støttet enhet, for eksempel en NAS-enhet. Merk deg at Ethernet-portaggregering også kalles for koblingsaggregering, portgruppering og porttrunkering.</p><p name=agg_setup id=agg_setup></p><p><b>Miljøkonfigurering</b><p><ol><li>Koble en enhet som støtter IEEE-802.3ad LACP, for eksempel en NAS- eller en nettverkssvitsj, til Ethernet-portene 1 og 2 på ruteren med Ethernet-kabler.</li><li>Konfigurer Ethernet-portaggregering på den enheten som er koblet til Ethernet-portene 1 og 2 på ruteren.</li> <li>Hvis du kobler port 1 og 2 til en Ethernet-svitsj, må du sørge for at den støtter 802.3ad LACP, og at den er konfigurert riktig før du kobler til ruteren med to Ethernet-kabler.</li><li>Ikke koble den uadministrerte svitsjen til port 1 og 2, siden dette vil gjøre at nettverket går ned.</li><br>Hvis du vil ha mer informasjon om hvordan du konfigurerer Ethernet-portaggregering på enheten din, kan du se i dokumentasjonen som fulgte med enheten.<br><br>Tips: For å få den raskeste ytelsen med portaggregering ved hjelp av kablede tilkoblinger brukes Ethernet-port 3 for den første datamaskinen, mens Ethernet-port 4, 5 eller 6 brukes for den andre datamaskinen. Dette gir hastigheter på opptil 2 Gbps med portaggregering. Maksimumshastigheten mellom port 4, 5 og 6 er begrenset til 1 Gbps.<br></ol><p name=agg_config id=agg_config></p><p><b>Ruterkonfigurering</b><p><ol><li>Deaktivér: Ruteren deaktiverer funksjonen for Ethernet-portaggregering. LAN-port 1 og 2 fungerer.<li>Aktivér (LACP- IEEE 802.3ad): Ruteren kommuniserer med enhetene som er koblet til LAN-port 1 og 2. Kontroller også om tilkoblingsaggregering er mulig. <br>Hvis ja så vil ruteren automatisk slå sammen LAN-port 1 og 2. Hvis ikke så fungerer LAN-port 1 og 2 som en normal LAN-port.</ol><p name=agg_status id=agg_status></p><p><b>Status for Ethernet-portaggregasjon</b><p><ol><li>Inaktiv: Ingen enhet for tilkoblingsaggregering er koblet til LAN-port 1 og 2.<li>Aktiv: En enhet for tilkoblingsaggregering er koblet til LAN-port 1 og 2.</ol>",
