"plex_026" : "<p><font size=4><b>Hjelp for Plex Media Server</b></font></p><a name=ip_tag></a><p>Plex Media Server administrerer musikk, videoer og bilder som er lagret på en lokalt tilkoblet USB-lagringsenhet, og streamer disse mediefilene til enhetene dine, for eksempel datamaskiner, mobiltelefoner og nettbrett.</p><p>Disse enheten kan kobles til ruteren eksternt eller lokalt. Hvis du vil koble til ruteren lokalt, bruker du en kablet Ethernet-tilkobling eller en WiFi-tilkobling.</p><p>Plex Media Server er aktivert som standard. Den kan deaktiveres dersom du ikke ønsker å bruke den.</p><p>Hvis Plex ikke registrerer en tilkoblet USB-lagringsenhet, vil Plex være utilgjengelig frem til en enhet kobles til.</p><p>Hvis flere USB-lagringsenheter er tilkoblet, kan du velge én USB-enhet som Plex Media Server kan bruke til å lagre og oppbevare mediefiler og tilknyttede metadatafiler.</p><p>Ruteren søker jevnlig etter nye binærversjonsoppdateringer av Plex når nye funksjoner eller feilrettinger er tilgjengelige. Dersom en ny versjon oppdages, må du logge på ruteren og oppdatere Plex Media Server til den nye versjonen.</p><p>Dersom du aktiverer automatisk oppdatering, utfører ruteren automatiske oppdateringer klokken 03.00 når nye binærversjonsoppdateringer er tilgjengelige. Dette fører til færre avbrudd når du streamer medier på andre tidspunkt.</p><p>Plex Media Server starter på nytt etter oppdateringen til den nye versjonen eller etter at du har byttet til en annen USB-lagringsenhet.</p><p>Ruteren støtter et lokalt nettverkstilsluttet datalager som bruker Samba-protokollen til Plex-mediebibliotekene. Følg ruterens GUI for å legge til en nettverkstilkobling. Tilkoblingen vises på Plex Media Server-siden. Kontakt nettverkenhetens leverandør for instruksjoner om deling av en mappe med andre nettverksenheter.</p><p>Du må bruke en USB 3.0 lagringsenhet til Plex-metadata og konfigureringsfiler. USB-lagringsenheten må ha minst 5 GB lagringsplass.</p>",
