"ACB_113" : "Ruter-/AP-modus",
"ACBH_001" : "<p><font size=4><B>Hjelp for nettskybasert sikkerhetskopiering</B></font></p><p><B>Nye brukere kan registrere seg her for å få seks måneder gratis:</B> Hvis du ikke har en Amazon Drive Cloud-konto, kan du få en konto i seks måneder gratis ved å klikke på koblingen og følge nettsiden til Amazon Drive Cloud.</p><p><B>Eksisterende brukere kan logge seg på her:</B> Hvis du allerede har en Amazon Drive Cloud-konto, kan du klikke på denne koblingen for å logge på kontoen din.</p>",
"ACBH_002" : "<p><font size=4><B>Hjelp for nettskybasert sikkerhetskopiering</B></font></p><p><B>Logg på eller registrer deg her:</B> Hvis du allerede har en Amazon Drive Cloud-konto, kan du klikke på denne koblingen for å logge på kontoen din eller registrere deg.</p>",
"ACBH_003" : "<p><font size=4><B>Hjelp for nettskybasert sikkerhetskopiering</B></font></p><p><B>Bruk-knapp:</B> Klikk på Bruk-knappen for å lagre endringer som blir gjort på denne siden.</p><p><B>Avbryt-knapp:</B> Trykk på Avbryt-knappen for å gå tilbake til de tidligere innstillingene.</p><p><B>Bytt konto-knapp:</B> Klikk på Bytt konto-knappen for å logge av den gjeldende kontoen og gå tilbake til påloggingssiden.</p><p><b>Amazon Drive Cloud-kontoen din er:</B> Denne delen viser kontonavnet ditt.</p><p><B>Konfigurere e-postvarslinger:</B> Klikk på denne koblingen for å administrere e-postvarslingene.</p> <p><B>USB-status: Tilkoblet | USB-status: Frakoblet:</B> USB-statusen viser den gjeldende tilkoblingsstatusen for USB-enheten.</p><p><B>Velg mappen du vil sikkerhetskopiere:</B> Velg en mappe på USB-enheten som du ønsker å sikkerhetskopiere til nettskyen.</p><p><B>Endre mappe som skal sikkerhetskopieres:</B> Etter at du har valgt en mappe, kan du klikke på koblingen Endre mappe for å endre mappe.</p><p><B>Sikkerhetskopier nå-knapp:</B> Klikk på Sikkerhetskopier nå-knappen for å sikkerhetskopiere umiddelbart.</p><p><B>Velg sikkerhetskopieringsplan:</B></p><ul><li><B>Synkronisering i sanntid:</B> Den standard sikkerhetskopiplanen har synkronisering i sanntid, noe som betyr at dataene blir sikkerhetskopiert til nettskyen i sanntid når det blir gjort endringer på dataene på USB-enheten.</li><li><B>Planlagt sikkerhetskopiering:</B> Planlagt sikkerhetskopiering betyr at du kan velge dagen og tidspunktet for når dataene skal sikkerhetskopieres til nettskyen.</li></ul><p><b>Vellykket! Sikkerhetskopiering fullført:</B> Denne meldingen gir deg beskjed om at den siste sikkerhetskopieringsjobben har blitt fullført.</p><p><B>Feilinformasjon om mislykket sikkerhetskopiering >>:</B> Denne meldingen gir deg beskjed om at den siste sikkerhetskopieringsjobben mislyktes. Hvis du vil ha mer informasjon, kan du klikke på Feilinformasjon.</p>",
