"usb_dev_setting_h=" : "<h1 class=\&quot;helpfile\&quot;>Hjelp for innstillinger for USB-stasjon</h1> <p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>DGN2200 tillater fildeling når en USB-harddisk eller et Flash-minne er koblet til USB-porten.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Se i referansehåndboken hvis du vil ha mer detaljert konfigureringsinformasjon.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Hvis du vil ha tilgang til USB-stasjonen via FTP, kan du bruke et FTP-verktøy eller skrive inn ftp://nettverksressurs i en nettleser, for eksempel Microsoft Internet Explorer eller Netscape. Den angitte IP-adressen er IP-adressen til ruteren på Internett, og du finner den som IP-adressen til Internett-porten på menyen Ruterstatus. </span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> Hvis du vil ha tilgang til USB-stasjonen via Microsofts nettverkstilkoblinger, klikker du på Start -&gt; Kjør i Windows og skriver inn \\nettverksressurs. Den angitte IP-adressen er den lokale IP-adressen til ruteren, for eksempel 192.168.0.1. Du kan også skrive inn \\vertsnavnet i Windows Explorer. Vertsnavnet er navnet som er angitt i delen Nettverkstilgang, for eksempel DGN2200.</span></p><hr><a name=\&quot;network access\&quot;> </a><h2>Nettverstilgang</h2><p class=\&quot;MsoNormal\&quot;><B>Vertsnavn og arbeidsgruppe </B></p><p class=\&quot;MsoNormal\&quot;> <span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> Vertsnavnet og arbeidsgruppen utgjør til sammen navnet som brukes til å identifisere ruteren i nettverket. Du får enkelt tilgang til den tilkoblede USB-stasjonen ved å skrive inn \\vertsnavnet i Windows Explorer.</span></p><p class=\&quot;MsoNormal\&quot;> <B>FTP-port</B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> FTP-porten er TCP-portnummeret i den innebygde FTP-serveren. Standardverdien er 21. </span></p><hr><a name=\&quot;ftp access\&quot;></a><p class=\&quot;MsoNormal\&quot;> <B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> FTP-tilgang</span></B></p><p class=\&quot;MsoNormal\&quot;> <span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> Du kan opprette FTP-kontoer ved å klikke på knappen Legg til. FTP-kontoene gir brukere i lokalnettet eller på Internett tilgang til filene på den tilknyttede USB-stasjonen.</span></p><p><B>Valgene Legg til, Rediger, Slett</B> eller <B>Løs ut disk</B><BR><BR>Klikk på <B>Legg til</B> for å legge til ny informasjon. Klikk på <B>Rediger</B> for å redigere den valgte informasjonen. Klikk på <B>Slett</B> for å slette den valgte informasjonen. Klikk på <B>Løs ut disk</B> for å løse ut USB-enheten.<BR></p><hr><a name=\&quot;attached device\&quot;></a><p class=\&quot;MsoNormal\&quot;> <B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> Tilkoblet enhet</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot;  style=\&quot;font-family:Arial\&quot;> Denne tabellen viser partisjonsinformasjon om den tilkoblede USB-stasjonen, blant annet navnet på den delte ressursen og filsystemtypen. </span></p>",
"usb_mount=" : "Frakobling av USB-enhet",
