"usb_wiz_h=" : "<h1 class=\&quot;helpfile\&quot;>Veiviser for smart oppsett – hjelp for USB-stasjon</h1> <p>DGN2200 tillater fildeling når en USB-harddisk eller et Flash-minne er koblet til USB-porten. Se i referansehåndboken hvis du vil ha mer detaljert konfigureringsinformasjon.</P><p>Når du har koblet en USB-harddisk eller et Flash-minne til DGN2200 USB-porten, får brukerne i lokalnettet tilgang til USB-stasjonen med full lese- og skrivetilgang.</P><p>Brukere i et lokalnett eller på Internett har også tilgang til USB-stasjonen via FTP. Veiviseren for smart oppsett hjelper deg med å konfigurere FTP-kontoen.</P><P><a name=\&quot;folder\&quot;></a><b class=\&quot;helpfile\&quot;>Angi navnet på mappen som skal deles</b><BR>Når brukeren får tilgang til filer via FTP, er dette rotmappen som vil bli vist.</P><P><a name=\&quot;loginname\&quot;></a><b class=\&quot;helpfile\&quot;>Angi FTP-påloggingsnavnet for å gi tilgang til denne mappen</b><BR>Skriv inn påloggingsnavnet til FTP-kontoen for å få tilgang til mappen.</P><P><a name=\&quot;password\&quot;></a><b class=\&quot;helpfile\&quot;>Angi FTP-påloggingspassordet</b><BR>Skriv inn et passord for pålogging til FTP-kontoen.</P><p><a name=\&quot;rights\&quot;></a><b class=\&quot;helpfile\&quot;>Velg FTP-tilgangsrettigheter</b><BR>Hvis du velger Skrivebeskyttet, kan brukeren hente datafiler via FTP. Hvis du velger Lese- og skrivetilgang, kan brukeren lese og skrive datafiler.</p><p><B>Merk:</B> FTP-tilgang via Internett gir bare skrivebeskyttet tilgang, uavhengig av hvilke kontorettigheter som er tildelt.</p><p><B>Valgene Fortsett eller Stopp veiviser</B><BR>Klikk på <B>Fortsett </B>for å gå til neste side. <BR>Klikk på <B>Stopp veiviser</B> for å stoppe veiviseren og gå til USB-stasjonsinnstillingene.\&quot;max_reached=\&quot;Maks. mengde nådd\&quot;swiz_usb=\&quot;Veiviser for smart oppsett – USB-stasjon\&quot;stop_wiz=\&quot;Stopp veiviser\&quot;continue=\&quot;Fortsett\&quot;enter_login=\&quot;Angi påloggingsnavnet til denne mappen\&quot;share_folder_list=\&quot;Liste over delte mapper\&quot;finish_mark=\&quot;Fullfør\&quot;dev_no_empty=\&quot;Enhetsnavnet kan ikke være tomt\&quot;vista_set=\&quot;Vista-innstillinger\&quot;enable_bult=\&quot;Aktiver innebygd registrator\&quot;allow_config_router=\&quot;Tillat at en registrar konfigurerer ruteren\&quot;VST_vista_h=\&quot;<h1>Hjelp for Vista-innstillinger</h1></P><p><B>Enhetsnavn</B><BR>Dette er et brukervennlig navn på ruteren. Du ser ruteren i Vista-nettverkskartet, og Network Explorer er merket med dette navnet.</p><p><B>Aktiver innebygd registrator</B><BR>Når den innebygde registratoren er aktivert, kan du bruke funksjonen Legg til en trådløs klient på denne siden for å legge til en trådløs klient i nettverket via WPS-prosedyren. Da trenger du ikke en Windows Vista-PC for å legge til en trådløs klient.</p><p><B>Tillat at en registrator konfigurerer ruteren</B><BR>Merk av for dette alternativet hvis du vil at brukere skal kunne konfigurere ruteren med en Windows Vista-PC. Med en standard ruterkonfigurasjon kan brukerne konfigurere ruteren via Windows Vista-PC-en. Når ruteren er konfigurert av en registrator, må du merke av for dette alternativet for at en registrator skal kunne konfigurere ruteren igjen. Når den innebygde registratoren er aktivert, blir dette alternativet inaktivt.</p><p><B>Legg til en trådløs klient </B><BR>Når den innebygde registratoren er aktivert, kan du legge til en trådløs klient i nettverket ved å klikke på denne knappen først. I dialogboksen som vises, blir du bedt om å oppgi PIN-koden for klienten. PIN-koden for klienten vises i brukergrensesnittet for klienten.</p>",
