"h_wlg_sec_profile=" : "<H1>Hjelp for innstilling for sikkerhetsprofil</H1><P>Med denne ruteren kan du ha flere trådløse nettverk. Du finner mer informasjon om de trådløse nettverkene i en sikkerhetsprofil. Informasjon om de enkelte sikkerhetsprofilene er oppført. <UL><LI>Profilnavn <BR>Det gjeldende profilnavnet vises. <LI>SSID <BR>Den gjeldende SSID-en som er tilknyttet denne profilen. <LI>Sikkerhet <BR>Det gjeldende sikkerhetssystemet (f.eks. WPA-PSK) vises. <LI>Aktiver <BR>Merk av for dette alternativet hvis du vil aktivere eller deaktivere de enkelte sikkerhetsprofilene. Klikk på <B>Bruk</B> for å lagre endringene. <LI>WMM <BR>Merk av for dette alternativet hvis du vil aktivere eller deaktivere WMM-annonsering i de enkelte sikkerhetsprofilene. Klikk på <B>Bruk</B> for å lagre endringene. <LI>Broadcast SSID <BR>Merk av for dette alternativet hvis du vil aktivere eller deaktivere SSID-kringkasting i de enkelte sikkerhetsprofilene. Klikk på <B>Bruk</B> for å lagre endringene. </UL></P><p><B>Knappen Rediger</B><BR></P><p>Klikk på denne knappen for å endre innstillingene for den valgte profilen. Bruk alternativknappene på venstre side for å velge ønsket profil. </P>",
