"thank_login_info" : "Takk for at du kjøpte NETGEARs trådløse ruter DGN2200 RangeMax&#08482 NEXT. Med jevne mellomrom bør du bruke Oppgraderingsassistent for fastvare for å få fullt utbytte av forbedringer og nye funksjoner som NETGEAR tilbyr for dette produktet.",
