"h_wds" : "<P><font size=4><B>Hjelp for Innstillinger for funksjonen for trådløs repetisjon (Wireless Repeating Function Settings)</B></font></P> <a name=en_repeat></a> <p><b>Aktiver trådløs repetisjon (Enable Wireless Repeating)</b></p> <p>Aktiver denne funksjonen hvis du vil bruke bromodus (Bridge mode) eller repeatermodus (Repeater mode), og velg deretter modusen du ønsker for miljøet ditt. </p><ul>     <p><li><a name=repeat></a><strong>Trådløs repeater (Wireless Repeater). </strong>  <p>I denne modusen kommuniserer ",
"h_CF_log" : "<P><font size=4><B>Inkluder i logg</B></font></P><p>En logg er en detaljert registrering av webområdene som brukerne i nettverket har vært inne på, eller som de har prøvd å få tilgang til. Hvis du har konfigurert innholdsfiltrering på skjermbildet Blokker områder, viser skjermbildet Logger når noen i nettverket prøver å få tilgang til et blokkert område. Hvis e-postvarsling er aktivert, mottar du disse loggene i en e-postmelding. Hvis du ikke har konfigurert e-postvarsling, kan du vise loggene her.</p><p><ul><li>Klikk på <b>Tøm logg</b> for å slette alle loggoppføringene.</ul><p><ul><li>Klikk på <b>Oppdater </b>for å se de siste tilkoblingsforsøkene.</ul><p><ul><li>Klikk på <b>Send logg</b> for å sende loggfilen til e-postkontoen din. Denne funksjonen kan være svært nyttig for å teste e-postinnstillingene dine.</ul><a name=&quot;syslog&quot;></a><P><b>Syslog</b><p>Loggene kan sendes til en Syslog-server. Aktiver ett av disse tre alternativene etter behov:<ul><li> Deaktiver – velg dette hvis du ikke har en Syslog-server.<li> Kringkast på LAN – Syslog-data kringkastes i stedet for å sendes til en bestemt Syslog-server. Bruk dette alternativet hvis Syslog-serveren ikke har en fast IP-adresse.<li> Send til denne IP-adressen for Syslog-server – hvis Syslog-serveren har en fast IP-adresse, velger du dette alternativet og angir IP-adressen til Syslog-serveren. </ul><p> </p>",
