"gui_lang_conflict_help" : "<title>Hjelp</title><link rel=stylesheet href=help.css></head><h1>Hjelp for språkkontroll</h1><p>Brukergrensesnittspråket er forskjellig fra nettleserspråket. Hvis du vil bytte brukergrensesnittspråket til nettleserspråket, klikker du på <B>Ja</B>, ellers klikker du på <B>Nei</B></p>",
