"h_wlg_wireless2" : "<P><font size=4><B>Innstillinger for gjestenettverk</B></font></P><p><B>Gjennom disse innstillingene kan du gi besøkende tilgang til Internett hjemme hos deg hvis du ikke vil at de skal få vite sikkerhetskoden for trådløs tilgang.</B></p><HR><A name=network></A><P><B>Nettverksprofiler </B></P><p>Du kan klikke på alternativknappen til hver profil for å få detaljert informasjon om eller endre innstillingene til profilen. Tabellen gir en kort oppsummering av hvor mange profiler du kan opprette, og inneholder profilnummeret og SSID-en for denne profilen, sikkerhetstypen for denne profilen, informasjon om dette trådløse gjestenettverket er aktivert eller ikke og om SSID-en vil vises eller ikke.</p><A name=wireless></A><P><B>Trådløsinnstillingene til profilen</B></P><A name=enable_guest></A><p>Aktiver gjestenettverk </P><p>Hvis det er merket av for dette alternativet, er dette gjestenettverket aktivert. Du og de besøkende kan koble til nettverket via SSID-en for denne profilen. <A name=enable_ssid></A></P><p>Aktiver SSID Broadcast </P><p>Hvis dette alternativet er aktivert, vil det trådløse tilgangspunktet sende ut navnet (SSID) til alle trådløse stasjoner. Stasjoner som ikke har en SSID (eller en &quot;null&quot;-verdi), kan deretter ta i bruk riktig SSID for tilkoblinger til dette tilgangspunktet.<A name=allow_guest></A></P><p>Gi gjesten tilgang til det lokale nettverket mitt </P><p>Hvis det ikke er merket av for dette alternativet, har alle brukere som kobler til dette SSID-nettverket, direkte tilgang bare til Internett og andre klienter i det samme SSID-nettverket. Ingen av klientene i dette SSID-nettverket får tilgang til ruterens webgrensesnitt, klienter i andre SSID-nettverk, Ethernet-nettverk eller andre tjenester på denne trådløse ruteren.<BR>Hvis det er merket av for dette alternativet, får alle brukere som kobler til dette SSID-nettverket, tilgang ikke bare til Internett, men også til de lokale nettverkene til denne trådløse ruteren, på lik linje med brukere i det primære SSID-nettverket.<A name=guest_ssid></A></P><p>Navn på det trådløse nettverket gjesten skal bruke (SSID) </P><p>Angi en verdi på opptil 32 alfanumeriske tegn. Det samme navnet (SSID) må tilordnes til alle de trådløse enhetene i nettverket. Standard SSID er NETGEAR_Guest<B>N</B>. N er profilnummeret, men NETGEAR anbefaler på det sterkeste at du endrer nettverksnavnet (SSID) til en annen verdi. I denne verdien skilles det også mellom små og store bokstaver. <I>NETGEAR</I> er for eksempel ikke det samme som <I>NETGEAr</I>.</p><HR><A name=security></A><p><B>Sikkerhetsalternativer</B></p><UL><LI>Ingen – ingen datakryptering<LI>WEP – Wired Equivalent Privacy. Bruk WEP 64- eller 128-biters datakryptering<BR><B>Merk: </B>Wi-Fi Protected Setup-funksjonen er deaktivert når sikkerhetsinnstillingen er WEP med godkjenning med delt nøkkel.<LI>WPA-PSK [TKIP] – Wi-Fi Protected Access med forhåndsdelt nøkkel. Bruk standard WPA-PSK-kryptering med TKIP-krypteringstype<LI>WPA2-PSK [AES] – Wi-Fi Protected Access versjon 2 med forhåndsdelt nøkkel. Bruk standard WPA2-PSK-kryptering med AES-krypteringstypen<LI>WPA-PSK [TKIP] + WPA2-PSK [AES] – tillat klienter som bruker enten WPA-PSK [TKIP] eller WPA2-PSK [AES]</LI><LI>WPA/WPA2 Enterprise - Dette alternativet støtter 802.1x-godkjenning, ikke for hjemmebruk, og du må ha en RADIUS-server i nettverket.</LI></UL><p>Hvis du vil oppnå best mulig ytelse med trådløse 11N-kort eller robuste sikkerhetsnettverk, anbefaler NETGEAR at du endrer sikkerhetsalternativet for nettverket til WPA2-PSK.</p><HR><A name=wep></A><p><B>Sikkerhetskryptering (WEP) </B></p><P>Godkjenningstype </P><p>Vanligvis kan du bruke standardverdien \&quot;Automatic\&quot; (Automatisk). Kortene kan bruke enten &quot;Open System&quot; (Åpent system) eller &quot;Shared Key&quot; (Delt nøkkel) til godkjenning. Hvis du vil ha bedre sikkerhetsgodkjenning, kan du velge &quot;Shared Key&quot; (Delt nøkkel), slik at de trådløse kortene bare kan bruke &quot;Shared Key&quot; til å koble til dette nettverket.</P><p>Krypteringsstyrke </P><p>Velg WEP-krypteringsnivå: <UL><LI>64-biters (noen ganger kalt 40-biters) kryptering <LI>128-biters kryptering </LI></UL><HR><A name=wepkey></A></P><p><B>Sikkerhetskrypteringsnøkkel (WEP)</B></p><p>Hvis WEP er aktivert, kan du programmere de fire datakrypteringsnøklene manuelt eller automatisk. Disse verdiene må være identiske for alle PC-er og tilgangspunkter i nettverket. </P><p>Automatisk nøkkelgenerering (passord) </P><p>Skriv inn et ord eller en gruppe utskrivbare tegn i boksen Passord, og klikk på knappen Generer for å generere WEP-nøklene automatisk. Hvis krypteringsstyrken er satt til 64 biter, skrives det automatisk inn en nøkkelverdi i alle de fire nøkkelboksene. Hvis krypteringsstyrken er satt til 128 biter, skrives det automatisk inn en nøkkelverdi bare i den valgte WEP-nøkkelboksen. </P><p>Manuell angivelsesmodus </P><p>Velg hvilken av de fire nøklene som skal brukes, og skriv inn den tilhørende WEP-nøkkelinformasjonen for nettverket i den valgte nøkkelboksen. </P><p>For 64-biters WEP – skriv inn 10 heksadesimale sifre (enhver kombinasjon av 0–9 og A–F). </P><p>For 128-biters WEP – skriv inn 26 heksadesimale sifre (enhver kombinasjon av 0–9 og A–F). </P><p>Pass på at du klikker på Bruk for å lagre innstillingene på denne menyen.</P><HR><A name=wpa-psk></A><p><B>Sikkerhetskryptering (WPA-PSK)</B></p><p>Hvis dette alternativet velges, må du bruke TKIP-kryptering og angi WPA-passordet (nettverksnøkkelen). Skriv inn et ord eller en gruppe utskrivbare tegn i boksen Passord. Passordet må bestå av enten 8 til 63 ASCII-tegn eller nøyaktig 64 heksadesimale sifre. Et heksadesimalt siffer er ett av følgende tegn: <BR>0, 1, 2, ..., 8, 9, A, B, C, D, E og F. </P><p>Klikk på Bruk for å lagre innstillingene. </p><HR><A name=wpa2-psk></A><p><B>Sikkerhetskryptering (WPA2-PSK)</B></p><p>WPA2 er en nyere versjon av WPA. Velg dette alternativet bare hvis alle trådløsklientene i nettverket støtter WPA2. Hvis dette alternativet velges, må du bruke AES-kryptering og angi WPA-passordet (nettverksnøkkelen). Skriv inn et ord eller en gruppe utskrivbare tegn i boksen Passord. Passordet må bestå av enten 8 til 63 ASCII-tegn eller nøyaktig 64 heksadesimale sifre. Et heksadesimalt siffer er ett av følgende tegn: <BR>0, 1, 2, ..., 8, 9, A, B, C, D, E og F. </p><HR><A name=wpa-psk+wpa2-psk></A><p><B>Sikkerhetskryptering (WPA-PSK + WPA2-PSK) </B></p><p>Med dette alternativet kan klienter bruke enten WPA (med TKIP, kringkastede pakkerbruker også TKIP) eller WPA2 (med AES). Hvis dette alternativet velges, må krypteringen være TKIP + AES. Du må også angi WPA-passordet (nettverksnøkkelen). For at du skal få maksimal trådløs ytelse, må 11N-klienter kobles til denne ruteren ved hjelp av WPA2-PSK (med AES). For klienter som kobler til via WPA-PSK (med TKIP), er den maksimale trådløshastigheten 802.11g. Skriv inn et ord eller en gruppe utskrivbare tegn i boksen Passord. Passordet må bestå av enten 8 til 63 ASCII-tegn eller nøyaktig 64 heksadesimale sifre. Et heksadesimalt siffer er ett av følgende tegn: <BR>0, 1, 2, ..., 8, 9, A, B, C, D, E og F. </p><HR><p><B>Slik lagrer eller avbryter du endringer:</B></p><p>Klikk på <B>Bruk</B> for at endringene skal bli aktivert. <BR>Klikk på <B>Avbryt</B> for å gå tilbake til de forrige innstillingene.</p>",
