"h_wiz_pppoa" : "<div class=Section1><h1 class=\&quot;helpfile\&quot;>Hjelp </h1><p>I skjermbildet Grunnleggende innstillinger (Basic Settings) kan du konfigurere, oppgradere og kontrollere statusen til den trådløse NETGEAR Cable/DSL-ruteren.</p> <p>Klikk på et element i kolonnen lengst til venstre. De gjeldende innstillingene eller informasjonen for det området vises i den midterste kolonnen. <p>I denne kolonnen finner du nyttig informasjon om den valgte siden med innstillinger. Hvis du bruker Internet Explorer, kan du klikke på et element i den midterste kolonnen for å hoppe direkte til den relaterte hjelpedelen. Ellers kan du bla nedover til du kommer til den. <hr><a name=\&quot;bsetting\&quot;></a><h1>Hjelp for grunnleggende innstillinger</h1><p><b>Merk:</b> Hvis du konfigurerer ruteren for første gang, kan det hende at du kan bruke standardinnstillingene uten å endre dem. <a name=question></a><p><b>Krever Internett-tilkoblingen pålogging?</b> <p>Velg dette alternativet på grunnlag av hvilken type konto du har hos Internett-leverandøren. Hvis du må oppgi påloggingsinformasjon hver gang du kobler deg til Internett, eller hvis du har en PPPoE-konto hos Internett-leverandøren, velger du <b>Ja</b>. I motsatt fall velger du <b>Nei</b>. <a name=\&quot;en\c&quot;></a><h2 class=\&quot;helpfile\&quot;>Innkapsling</h2><p>Velg tjenesten som tilbys av Internett-leverandøren. De to valgene er PPPoE (PPP over Ethernet) og PPPoA (PPP over ATM).</p><h2 class=\&quot;helpfile\&quot;><a name=\&quot;login\&quot;></a>Logg på </h2><p>Dette er vanligvis navnet som du bruker i e-postadressen din. Hvis for eksempel e-postkontoen du bruker mest, er JerAB@ISP.com, skriver du JerAB i denne boksen. </p><p>Noen Internett-leverandører krever at du bruker den fullstendige e-postadressen når du logger på. Hvis Internett-leverandøren krever at du bruker hele e-postadressen, skriver du den inn i boksen Pålogging. </p><a name=\&quot;password\&quot;></a><h2 class=\&quot;helpfile\&quot;>Passord</h2><p>Angi passordet som du bruker til å logge på Internett-tjenesten. </p><a name=\&quot;idletime\&quot;></a><h2 class=\&quot;helpfile\&quot;>Tidsavbrudd ved inaktivitet</h2><p>En inaktiv Internett-tilkobling avsluttes etter denne tidsperioden.<p>Hvis denne verdien er null (0), holdes tilkoblingen oppe ved å koble til på nytt umiddelbart hver gang tilkoblingen brytes.</p><p><a name=\&quot;InternetIP\&quot;></a><b>Internett-IP-adresse  </b><p>Hvis du logger deg på tjenesten, eller hvis du ikke fikk en fast IP-adresse av Internett-leverandøren, tilordner ruteren automatisk en IP-adresse til deg når du kobler deg til. Velg <b>Hent dynamisk fra Internett-leverandør</b>. <p>Hvis du har en fast (eller statisk) IP-adresse, har Internett-leverandøren gitt deg den nødvendige informasjonen. Velg <b>Bruk statisk IP-adresse</b>, og skriv inn IP-adressen, nettverksmasken og gateway-IP-adressen i de riktige feltene.<p>For eksempel: <ul><li>      IP-adresse: 24.218.156.183 <li>      Nettverksmaske: 255.255.255.0 <li>      Gateway-IP-adresse: 24.218.156.1 </ul><a name=\&quot;DNSaddress\&quot;></a><h2 class=\&quot;helpfile\&quot;>DNS-adresse (Domain Name Server) </h2><p>DNS-serveren brukes til å slå opp områdeadresser basert på navnene. </p><p>Hvis du fikk én eller to DNS-adresser av Internett-leverandøren, velger du <b>Bruk disse DNS-serverne </b> og skriver inn den primære og den sekundære adressen. </p><p>I motsatt fall velger du <b>Hent automatisk fra Internett-leverandør</b>. </p><p><b>Merk:  </b>Hvis du får feilmeldingen Finner ikke adresse når du går til et webområde, er det sannsynligvis fordi DNS-serverne ikke er riktig konfigurert. Da bør du kontakte Internett-leverandøren for å få DNS-serveradresser.</p><p><a name=\&quot;nat\&quot;></a><b>NAT (Network Address Translation)</b><p>NAT tillater at alle LAN-PC-er får tilgang til Internett via denne ruteren, ved å dele ruterens WAN-IP-adresse. I de fleste tilfeller er NAT helt avgjørende for Internett-tilang via denne ruteren. Du bør bare deaktivere NAT hvis du er sikker på at du ikke trenger det. Når NAT er deaktivert, utfører denne ruteren bare standardruting.</p><a name=\&quot;buttons\&quot;>  </a><h2 class=\&quot;helpfile\&quot;>Knappene Bruk, Avbryt og Test</h2><p>Klikk på <b>Bruk</b> når du er ferdig med å endre innstillingene. </p><p>Klikk på <b>Avbryt</b> for å gå tilbake til de opprinnelige innstillingene. </p> <p>Klikk på <b>Test</b> for å koble til webområdet til NETGEAR. Hvis du får koblet til, er innstillingene riktige, og du kan klikke på <b>Logg av</b> for å gå ut av disse sidene og ... begynne å surfe på <b>Internett!</b></p><p>Hvis du ikke klarer å koble til,</p><ul><li>går du gjennom innstillingene og kontrollerer at du har valgt de riktige alternativene og skrevet inn alt riktig.</li><li>Kontakt Internett-leverandøren for å få bekreftet konfigurasjonsinformasjonen. </li><li>Les feilsøkingsdelen i <i>installeringsveiledningen.for enheten.</i></li><li>På <i>ressurs-CD-en for enheten</i> leser du <i>feilsøkingsveiledningen</i> eller feilsøkingsdelen i <i>referansehåndboken</i>.</li><li>Kontakt NETGEARs kundestøtte.</li></ul> </div>",
