"h_dsl_bas" : "<h1 class=&quot;helpfile&quot;>Hjelp for ADSL-innstillinger</h1><p>Standardparameterne må være riktige for å samsvare med systemet som brukes av Internett-leverandøren.</p><ul><li>Multipleksingmetode – Internett-leverandøren angir om multipleksingmetoden din er VC-BASERT eller LLC-BASERT.<li>Virtuell krets – Internett-leverandøren angir hvilken VPI/VCI-kombinasjon som brukes for tjenesten.<li>DSL-modus – i de fleste tilfeller vil Auto-modus, standardmodusen, fungere. I sjeldne tilfeller kan problemer med interoperabilitet løses ved å sette modusen til ADSL-modus eller ADSL2+-modus i stedet for å forhandle modusen automatisk.</ul>",
