"h_modem_status" : "<p><B>Modem</B>: Gjeldende modemstatus og -innstillinger vises i denne delen. <ul> <li>ADSL-fastvareversjon – dette er versjonsnummeret til ADSL-fastvaren på lavt nivå. Dette følger med i ruterens fastvare. <li>Modemstatus – den gjeldende tilstanden til ADSL-tilkoblingen til telefonselskapet ditt. <li>Nedstrøms tilkoblingshastighet – tilkoblingshastigheten til ADSL-tilkoblingen fra telefonselskapet til ruteren. <li>Oppstrøms tilkoblingshastighet – tilkoblingshastigheten til ADSL-tilkoblingen fra ruteren til telefonselskapet. <li>VPI – VPI-innstillingen som er angitt på siden ADSL-innstillinger. <li>VCI – VCI-innstillingen som er angitt på siden ADSL-innstillinger. </ul>",
