"h_syslog" : "<P><B>Syslog</B></P><p>Loggene kan sendes til en Syslog-server. Aktiver ett av disse tre alternativene etter behov:<ul><li> Deaktiver – velg dette hvis du ikke har en Syslog-server.<li> Kringkast på LAN – Syslog-data kringkastes i stedet for å sendes til en bestemt Syslog-server. Bruk dette alternativet hvis Syslog-serveren ikke har en fast IP-adresse.<li> Send til denne IP-adressen for Syslog-server – hvis Syslog-serveren har en fast IP-adresse, velger du dette alternativet og angir IP-adressen til Syslog-serveren. </ul>",
