"usb_edit_h" : "<p class=\&quot;MsoNormal\&quot;><B><span lang=\&quot;EN-US\&quot; style=\&quot;font-size: 14.0pt; line-height: 115%; font-family: Arial\&quot;>Hjelp for innstilling for USB-stasjon</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> </span></p><a name=\&quot;status\&quot;></a><p class=\&quot;MsoNormal\&quot;><B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Status</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Når FTP-kontoen er aktivert, har brukeren tilgang til USB-stasjonen via FTP-programmet.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> </span></p><a name=\&quot;namepass\&quot;></a><p class=\&quot;MsoNormal\&quot;><B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Påloggingsprogram og -passord</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Dette er FTP-påloggingsnavnet og -passordet som brukes for å få FTP-tilgang til USB-stasjonen</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> </span></p><a name=\&quot;sharefolder\&quot;></a><p class=\&quot;MsoNormal\&quot;><B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Delt mappe</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Etter at du har logget deg på FTP, blir denne mappen rot- eller startmappen for FTP-økten.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> </span></p><a name=\&quot;accessright\&quot;></a><p class=\&quot;MsoNormal\&quot;><B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Tilgangsrettigheter</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Hvis du har merket av for lese- og skrivetilgang, kan FTP-brukeren utføre lese- og skriveoperasjoner (FTP PUT-operasjon) på USB-stasjonen.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Hvis ikke har FTP-brukeren skrivebeskyttet tilgang</span></p><p>?</p>",
