"h_diag_diag" : "<p><font size=4><b>Hjelp med diagnostikk</b></font></p><p>Du kan bruke denne siden til å utføre ulike former for diagnostikk. Det er ikke nødvendig ved normal drift.</p><a name=&quot;ping&quot;></a><p><b>Ping en IP-adresse eller et vertsnavn</b> Bruk dette for å sende en &quot;ping&quot;-pakkeforespørsel til den spesifiserte IP-adressen eller vertsnavnet. Dette brukes ofte for å teste en tilkobling. Hvis forespørselen blir tidsavbrutt (det mottas ikke noe svar), betyr dette vanligvis at målet ikke kan nås.<br> Enkelte nettverksenheter kan imidlertid konfigureres til ikke å svare på ping-forespørsler.<BR><B>Ping VPN</B> – når Ping VPN er aktivert, går ping-pakken gjennom VPN-tunnelen når VPN-tunnel er aktivert og fungerer.<a name=&quot;dnslookup&quot;></a><p><b>Utfør et DNS-oppslag</b><BR>En DNS (domenenavnserver) konverterer Internett-navnet (f.eks. www.netgear.com) til en IP-adresse. Hvis du trenger IP-adressen til en FTP-server, web-, e-post- eller annen server på Internett, kan du utføre et DNS-oppslag for å finne IP-adressen.</p><a name=&quot;rtable&quot;></a><p><b>Vis rutingtabellen</b><BR>Denne handlingen viser den interne rutingtabellen. Denne informasjonen brukes av teknisk støtte og andre ansatte som forstår rutingtabeller.</p><a name=&quot;reboot&quot;></a><p><b>Start ruteren på nytt</b><BR>Bruk denne knappen til å utføre en ekstern omstart. Du kan bruke denne hvis det virker som om ruteren har blitt ustabil eller ikke fungerer som normalt.</p><p><b>Merk:</b>   Hvis du starter på nytt, brytes alle eksisterende tilkoblinger enten til ruteren (som denne) eller gjennom ruteren (for eksempel LAN-brukere som har tilgang til Internett). Tilkoblinger til Internett vil imidlertid automatisk bli gjenopprettet når det er mulig.</p>",
"h_diag_IP" : "<p><font size=4><b>Hjelp med diagnostikk</b></font></p><p>Du kan bruke denne siden til å utføre ulike former for diagnostikk. Det er ikke nødvendig ved normal drift.</p><a name=&quot;ping&quot;></a><p><b>Ping en IP-adresse eller et vertsnavn</b> Bruk dette for å sende en &quot;ping&quot;-pakkeforespørsel til den spesifiserte IP-adressen eller vertsnavnet. Dette brukes ofte for å teste en tilkobling. Hvis forespørselen blir tidsavbrutt (det mottas ikke noe svar), betyr dette vanligvis at målet ikke kan nås.<br> Enkelte nettverksenheter kan imidlertid konfigureres til ikke å svare på ping-forespørsler.<a name=&quot;dnslookup&quot;></a><p><b>Utfør et DNS-oppslag</b><BR>En DNS (domenenavnserver) konverterer Internett-navnet (f.eks. www.netgear.com) til en IP-adresse. Hvis du trenger IP-adressen til en FTP-server, web-, e-post- eller annen server på Internett, kan du utføre et DNS-oppslag for å finne IP-adressen.</p><a name=&quot;rtable&quot;></a><p><b>Vis rutingtabellen</b><BR>Denne handlingen viser den interne rutingtabellen. Denne informasjonen brukes av teknisk støtte og andre ansatte som forstår rutingtabeller.</p><a name=&quot;reboot&quot;></a><p><b>Start ruteren på nytt</b><BR>Bruk denne knappen til å utføre en ekstern omstart. Du kan bruke denne hvis det virker som om ruteren har blitt ustabil eller ikke fungerer som normalt.</p><p><b>Merk:</b>   Hvis du starter på nytt, brytes alle eksisterende tilkoblinger enten til ruteren (som denne) eller gjennom ruteren (for eksempel LAN-brukere som har tilgang til Internett). Tilkoblinger til Internett vil imidlertid automatisk bli gjenopprettet når det er mulig.</p>",
