"DG009" : "<P><font size=4><B>Hjelp for innstillinger for den trådløse repeaterfunksjonen</B></font></P><p> Hvis du vil bruke den trådløse repeaterfunksjonen på modemruteren, må du konfigurere en Uplink-ruter.</p><p><b>Slik konfigurerer du en Uplink-ruter:</b> </p><ol><li>Velg avmerkingsboksen <b>Aktiver trådløs repeaterfunksjon</b>.</li><li>Legg inn SSID-en for Uplink-ruteren.<br>Du har følgende alternativer:<ul><li>Klikk på knappen <b>Sjekk</b> for å finne Uplink-ruteren og velg radioknappen ved siden av SSID-en for Uplink-ruteren.</li><li>Skriv inn SSID-en for Uplink-ruteren i feltet <b>SSID for Uplink-ruteren</b>.</li></ul></li><li> Under delen <b>Sikkerhetsalternativer</b> velger du en radioknapp ved siden av sikkerhetsmodusen for Uplink-ruteren.<br><b>Merk:</b> Hvis du brukte knappen <b>Sjekk</b> til å finne Uplink-ruteren, blir sikkerhetsmodusen valgt automatisk.</li><li>I feltet <b>Passord</b> skriver du inn passordet for Uplink-ruteren. </li><li>Klikk på knappen <b>Bruk</b>.<br>Endringene dine blir lagret. </li></ol>",
