"firewall_help001" : "<h1 class=helpfile>Hjelp for Brannmurregler</h1> <p>Du kan bruke dette skjermbildet til å opprette brannmurregler for å blokkere eller tillate bestemt trafikk. <B>Denne funksjonen er bare for avanserte administratorer.</b> Feil konfigurering vil føre til alvorlige problemer.</p><a name=out></a><h2 class=helpfile>Utgående tjenester</h2><p>Denne tabellen viser alle eksisterende regler for utgående trafikk. Hvis du ikke har definert noen regler, vises bare standardregelen. Standardregelen tillater all utgående trafikk.<p>Slik oppretter du en ny regel:<ol><li>Klikk på knappen Legg til. (Det spiller ingen rolle hvilket alternativ det er merket av for.)<li>Skjermbildet for utgående tjeneste vises. Dette skjermbildet har en egen hjelpefil. <li>Fyll ut feltene i skjermbildet for utgående tjeneste, og lagre dataene. Den nye regelen vises i tabellen når du går tilbake til dette skjermbildet.</ol><p>Slik endrer du en eksisterende regel:<ol><li>Klikk på alternativknappen ved siden av en rad i tabellen. </li><li>Klikk på knappen for de ønskede handlingene:<ul><li>Rediger – for å gjøre endringer i regeldefinisjonen. Skjermbildet for utgående tjeneste vises med dataene for den valgte regelen.<li>Flytt – for å flytte den valgte regelen til en ny plassering i tabellen. Du får beskjed om å angi den nye plasseringen.<li>Slett – for å slette den valgte regelen.</ul></ol><a name=in></a><h2 class=helpfile>Innkommende tjenester</h2><p>Denne tabellen viser alle eksisterende regler for innkommende trafikk. Hvis du ikke har definert noen regler, vises bare standardregelen. Standardregelen blokkerer all innkommende trafikk.<p>Slik oppretter du en ny regel:<ol><li>Klikk på knappen Legg til. (Det spiller ingen rolle hvilket alternativ det er merket av for.)<li>Skjermbildet for innkommende tjeneste vises. Dette skjermbildet har en egen hjelpefil. <li>Fullfør skjermbildet for innkommende tjeneste og lagre dataene. Den nye regelen vises i tabellen når du går tilbake til dette skjermbildet.</ol><p>Slik endrer du en eksisterende regel:<ol><li>Klikk på alternativknappen ved siden av en rad i tabellen. </li><li>Klikk på knappen for de ønskede handlingene:<ul><li>Rediger – for å gjøre endringer i regeldefinisjonen. Skjermbildet for innkommende tjeneste vises med dataene for den valgte regelen.<li>Flytt – for å flytte den valgte regelen til en ny plassering i tabellen. Du får beskjed om å angi den nye plasseringen.<li>Slett – for å slette den valgte regelen.</ul></ol><p><b>Slik tar du i bruk eller avbryter:   </b></p><p>Klikk på <b>Bruk</b> for å oppdagere endringene i tabellene <b>Utgående tjenester</b> og <b>Innkommende tjenester</b>. <br>Klikk på <b>Avbryt</b> for å forkaste endringer som ikke er lagret.<br>",
"firewall_help002" : "<h1 class=helpfile>Hjelp for Innkommende tjenester</h1> <p>Du kan bruke dette skjermbildet til å definere en ny innkommende brannmurregel eller redigere en eksisterende regel. Brannmurregler kan brukes til å blokkere eller tillate spesifikk trafikk. <B>Denne funksjonen er bare for avanserte administratorer.</b> Feil konfigurering vil føre til alvorlige problemer.</p><a name=serv>  </a><p><b>Tjeneste</b><br>Velg ønsket tjeneste. Dette angir hvilke pakker som dekkes av denne regelen. Om nødvendig kan du definere en ny tjeneste på skjermbildet Tjenester, ved å definere protokollene og portnumrene som brukes av tjenesten.<a name=action>  </a><p><b>Handling</b><br>Velg ønsket handling for pakkene som dekkes av denne regelen:<ul><li>TILLAT alltid<li>TILLAT etter tidsplan, blokker ellers<li>BLOKKER alltid<li>BLOKKER etter tidsplan, tillat ellers</ul>Merk:<ul><li>All innkommende trafikk som ikke er tillatt etter reglene du oppretter, blokkeres av standardregelen.<li>BLOKKER-regler er bare nyttige hvis trafikken allerede er dekket av en TILLAT-regel. (Det vil si at du ønsker å blokkere et delsett av trafikk som er tillatt av en annen regel.)<li>Hvis du vil definere tidsplanen som brukes i disse valgene, bruker du skjermbildet Tidsplan.</ul><a name=dest></a><p><B>LAN-server</b><BR>Angi IP-adressen til PC-en eller serveren på LAN-et som mottar den innkommende trafikken som dekkes av denne regelen.<a name=source></a><p><b>WAN-brukere</b><BR>Disse innstillingene angir hvilke pakker som dekkes av regelen, basert på kilde-IP-adressen (WAN). Velg ønsket alternativ:<ul><li>Alle &nbsp; &nbsp; alle IP-adresser dekkes av denne regelen.<li>Adresseområde &nbsp; &nbsp; hvis dette alternativet er valgt, må du fylle ut Start- og Slutt-feltene.<li>Én adresse &nbsp; &nbsp; angi ønsket adresse i Start-feltet.</ul><a name=log></a><p><b>Logg</b><br>Dette alternativet angir om pakkene som dekkes av denne regelen, logges. Velg ønsket handling.<ul><li>Alltid – logg alltid trafikk som dekkes av denne regelen, enten den samsvarer eller ikke. (Dette er nyttig når du skal feilsøke reglene.)<li>Aldri – logg aldri trafikk som dekkes av denne regelen, enten den samsvarer eller ikke.</ul><pre></pre><p>Klikk på <b>Bruk</b> for at endringene skal bli aktivert.<p>Klikk på <b>Avbryt</b> for å gå tilbake til det forrige skjermbildet.",
"firewall_help003" : "<h1 class=helpfile>Hjelp for Utgående tjenester</h1> <p>Du kan bruke dette skjermbildet til å definere en ny utgående brannmurregel eller redigere en eksisterende regel. Utgående brannmurregler brukes til å blokkere eller tillate tilgang fra datamaskiner i nettverket til tjenester eller programmer på Internett.</p><a name=serv>  </a><p><b>Tjeneste</b><br>Velg ønsket tjeneste eller program som skal dekkes av denne regelen. Hvis ønsket tjeneste eller program ikke vises i listen, må du definere den ved hjelp av menyen Tjenester.<a name=action>  </a><p><b>Handling</b><br>Velg ønsket handling for pakkene som dekkes av denne regelen:<ul><li>BLOKKER alltid<li>BLOKKER etter tidsplan, tillat ellers<li>TILLAT alltid<li>TILLAT etter tidsplan, blokker ellers</ul>Merk:<ul><li>All utgående trafikk som ikke blokkeres av reglene du oppretter, tillates av standardregelen.<li>TILLAT-regler er bare nyttige hvis trafikken allerede er dekket av en BLOKKER-regel. (Det vil si at du ønsker å tillate et delsett med trafikk som ikke er blokkert av en annen regel.)<li>Hvis du vil definere tidsplanen som brukes i disse valgene, bruker du skjermbildet Tidsplan.</ul><a name=source></a><p><B>LAN-brukere</b><BR>Disse innstillingene angir hvilke datamaskiner i nettverket som berøres av denne reglen, basert på kilde-IP-adressen (LAN). Velg ønsket alternativ:<ul><li>Alle – alle lokale IP-adresser dekkes av denne regelen.<li>Adresseområde – hvis dette alternativet er valgt, må du fylle ut Start- og Slutt-feltene.<li>Én adresse – angi ønsket adresse i Start-feltet.</ul><a name=dest></a><p><b>WAN-servere</b><BR>Disse innstillingene angir hvilke Internett-plasseringer som dekkes av regelen, basert på mål-IP-adressen (WAN). Velg ønsket alternativ:<ul><li>Alle – alle Internett-IP-adresser dekkes av denne regelen.<li>Adresseområde – hvis dette alternativet er valgt, må du fylle ut Start- og Slutt-feltene.<li>Én adresse – angi ønsket adresse i Start-feltet.</ul><a name=log></a><p><b>Logg</b><br>Dette alternativet angir om pakkene som dekkes av denne regelen, logges. Velg ønsket handling:<ul><li>Alltid – logg alltid trafikk som dekkes av denne regelen, enten den samsvarer eller ikke. (Dette er nyttig når du skal feilsøke reglene.)<li>Aldri – logg aldri trafikk som dekkes av denne regelen, enten den samsvarer eller ikke.</ul><pre></pre><p>Klikk på <b>Bruk</b> for at endringene skal bli aktivert.<p>Klikk på <b>Avbryt</b> for å gå tilbake til det forrige skjermbildet.",
