"3G329" : "Hjelp for Setup Wizard (konfigureringsveiviser)",
"3G330" : "<p>NETGEAR-ruteren for mobilt bredbånd må konfigureres etter at den er koblet til nettverket ditt. Dette kan du gjøre ved hjelp av Setup Wizard – veiviseren vil prøve å opprette en tilkobling til Internett-tjenesten via Internett-leverandøren – eller du kan konfigurere ruteren manuelt. Hvis du ikke er vant til å konfigurere Internett-tilkoblinger, anbefales det at du lar Setup Wizard (konfigureringsveiviseren) gjøre noe av jobben for deg.",
"3G331" : "<p>Hvis du vil konfigurere NETGEAR-ruteren for mobilt bredbånd, må du bruke informasjonen som du fylte ut tidligere i installeringsveiledningen.",
"3G332" : "<p>Klikk på <b>Next</b> (Neste) for å komme i gang.",
"3G333" : "Nettleseren støtter ikke utskriftsfunksjonen.",
"3G334" : "<p>Ruteren bruker følgende innstillinger. Du trenger de trådløse innstillingene når du konfigurerer datamaskiner slik at de kan koble til Internett trådløst via denne ruteren.</p>",
"3G335" : "<p><strong>Merk:</strong> Leverandøren din av mobilt bredbånd kan ha begrensninger for databruk på bredbåndet per måned. Ta kontakt med tjenesteleverandøren ved jevne mellomrom for å forsikre deg om at du ikke overskrider grensen for databruk.</p>",
"3G336" : "<p><strong>Viktig:</strong> Skriv ut skjermbildet, eller skriv ned innstillingene.</p>",
"3G337" : "<p>Klikk på <strong>Finish</strong> (Fullfør) for å fullføre konfigurasjonen.</p>",
