"3G339" : "Hjelp for profil til mobilt bredbånd",
"3G340" : "Denne siden gjør at du kan konfigurere profiler til det mobile bredbåndet for NETGEAR-ruteren",
"3G341" : "<p>Profilen til et mobilt bredbånd representerer tilkoblingsinformasjon tilknyttet et SIM-kort. NETGEAR-ruteren lar deg ha fem mobile profiler.",
"3G342" : "Med mobilprofiler kan du raskt koble til Internett med NETGEAR-ruteren trådløst. </P>",
"3G343" : "<p><b>Profil</b> – Profilnavn, bruk et navn som representerer kontoen til det mobile bredbåndet ditt.</p>",
"3G344" : "<p><b>PIN-kode</b> – PIN-kode til SIM-kort</p>",
"3G345" : "<p>Klikk på <b>Check</b> (Velg) når du vil velge og angi PIN-koden.</p>",
"3G346" : "<p>Klikk på <b>New</b> (Ny) for å opprette en ny mobilprofil.</p>",
