"3G497" : "<p> Short Message Service (SMS) er en tekstmeldingstjeneste. Ruteren må være tilkoblet nettverket med et gyldig SIM-kort.</p><p></p><p>Du kan se mappene Innboks, Sendte elementer og Kladd. Velg en mappe fra menyen for å se innholdet.",
"3G498" : "<b>Innboks:</b> Sammendragsside for mottatte SMS-meldinger.<ol>Klikk på en SMS-melding for å vise hele meldingen.<br><b>Ny:</b> Skriv en ny melding.<br><b>Videresend og svar:</b> Åpne den valgte meldingen for å videresende eller svare på meldingen.<br><b>Oppdater:</b> Oppdater alle meldingene.<br><b>Slett:</b> Slett den valgte meldingen.<br><b>Slett alle:</b>Slett alle meldinger.</ol>",
"3G499" : "<b>Sendte elementer:</b> Sammendragssiden for sendte SMS-meldinger.<ol>Klikk på den valgte SMS-meldingen for å vise hele meldingen. <br><b>Ny:</b> Skriv en ny melding. <br><b>Videresend:</b> Åpne den valgte SMS-meldingen for å videresende meldingen. <br><b>Send på nytt:</b> Send den valgte SMS-meldingen på nytt. <br><b>Slett:</b> Slett den valgte SMS-meldingen.<br><b>Slett alle:</b> Slett alle SMS-meldingene på SIM-kortet.</ol>",
"3G500" : "<b>Kladd:</b> Sammendragsside for kladdede SMS-meldinger.<ol>Klikk på den valgte SMS-meldingen for å vise hele meldingen. <br><b>Ny:</b> Skriv en ny SMS-melding. <br><b>Rediger:</b> Åpne den valgte SMS-meldingen for å redigere meldingen. <br><b>Send:</b> Send den valgte kladdede SMS-meldingen. <br><b>Slett:</b> Slett den valgte kladdede SMS-meldingen.</ol>",
"3G501" : "<b>Ny SMS:</b> Brukes til å opprette en ny SMS- eller e-postmelding.<ol><b>Til:</b> Telefonnummeret eller e-postadressen du ønsker å sende meldingen til.<br><b>Innhold:</b> Meldingsinnhold Meldingsgrensen vises under innholdet.<br><b>Send-knapp:</b> Trykk på <b>Send</b>-knappen for å sende meldinger.<br><b>Slett-knapp:</b> Trykk på <b>Slett</b>-knappen for å slette meldinger. <br><b>Lagre-knapp:</b> Trykk på <b>Lagre</b>-knappen for å lagre meldingen i Kladd-mappen. <br><b>Avbryt-knapp:</b> Trykk på <b>Avbryt</b>-knappen for å gå tilbake til innboksen.<br> </ol>",
