"genie_156" : "Du er pålogget fra en annen enhet. Bare én enhet kan være logget på om gangen. Hvis du logger på fra denne enheten, vil den andre enheten logges av. Vil du fortsette?",
"genie_157" : "Du er ennå ikke tilkoblet Internett.",
"genie_158" : "Du er tilkoblet Internett.",
"genie_159" : "Du kan nå logge på ruteren med brukernavnet \&quot;admin\&quot; og det gjenopprettede passordet.",
"genie_160" : "Du har gjenopprettet administratorpassordet.",
"genie_161" : "Ruteren er forhåndsinnstilt med WPA2-PSK trådløs sikkerhet for å beskytte nettverket ditt mot uønsket tilgang. For å koble til det trådløse nettverket må du angi nettverksnøkkelen (passord). Disse forhåndsinnstillingene er unike for denne enheten, som et serienummer.  Hvis du vil endre dem, kan du gjøre det senere på skjermbildet Wireless Settings (Trådløsinnstillinger) på ruterens webgrensesnitt.",
"genie_162" : "Trådløs sikkerhet er ikke aktivert på denne ruteren. NETGEAR anbefaler at du",
"genie_163" : "for å aktivere trådløs sikkerhet og beskytte nettverket.",
"genie_164" : "Serienummer",
"genie_165" : "Se etter oppdateringer",
"genie_166" : "Hva er det",
"genie_167" : "Pålogging mislyktes. Angi riktig adminpassord for NETGEAR-ruteren.",
"genie_168" : "Koble enheten trådløst til NETGEAR-ruteren og prøv igjen.",
"genie_169" : "Ingen sikkerhet",
"genie_170" : "Logg på ruteren og gå til AVANSERT->Administrasjon->Oppdateringsside for fastvare, og klikk deretter på <B>Velg</B> for å finne og oppdatere ruteren til den nye fastvaren. Brukernavnet til ruterens pålogging er <B>admin</B>. Standardpassordet er <B>password</B>.",
"genie_171" : "Du kan bruke NETGEAR genie til å konvertere en vanlig skriver til en AirPrint-skriver. Deretter kan du bruke AirPrint på enheter med Apple iOS (iPad, iPhone eller iPod Touch) for å skrive ut trådløst.",
"genie_172" : "Trinn 1: Kontroller at datamaskinen kan skrive ut til skriveren.",
"genie_173" : "Skriveren kan kobles til datamaskinen med USB, eller den kan kobles til ruteren enten trådløst eller med ruterens USB-port med støtte for NETGEAR ReadySHARE Printer.",
"genie_174" : "Trinn 2: Velg skriveren.",
"genie_175" : "Din iPad, iPhone eller iPod Touch som trådløst er koblet til ruteren, kan nå se denne skriveren i utskriftsfunksjonen.",
"genie_176" : "Hvis du vil bruke AirPrint, må du installere Apple iTunes- og Adobe Acrobat Reader-program på datamaskinen hvis du ikke har gjort det ennå.",
"genie_177" : "For iTunes kan du gå til<a href=&quot;http://www.apple.com/itunes/&quot;><br>http://www.apple.com/itunes/</a> for å laste ned og installere det.",
"genie_178" : "For Acrobat Reader kan du gå til<a href=&quot;http://get.adobe.com/reader/&quot;><br>http://get.adobe.com/reader/</a> for å laste ned og installere det.",
"genie_179" : "Klikk på Oppdater-knappen etter at du har installert begge programmene.",
"genie_180" : "Liste over skrivere som denne datamaskinen kan se:",
"genie_181" : "Meldingen er sendt til NETGEAR. Takk for tilbakemeldingen din. Vi leser alle meldinger, men det er ikke sikkert at NETGEAR sender deg svar. Hvis NETGEAR svarer, kan det ta flere dager før svaret sendes.",
"genie_182" : "<p>Hvis du vil blokkere eller tillate én eller flere enheter i å få tilgang til nettverket ditt, klikker du på koblingen Tilgangskontroll øverst i høyre hjørne på dette skjermbildet for å gå til skjermbildet Tilgangskontroll, hvor du kan gjøre endringene.",
"genie_183" : "<p><font size=4><B>Hjelp til tilgangskontroll</B></font></p><p>Du kan bruke Tilgangskontroll til å gi datamaskiner eller elektroniske enheter tilgang til nettverket eller blokkere dem. Når en enhet er blokkert, vil den bare kunne innhente en IP-adresse fra ruteren, men den vil ikke kunne kommunisere med andre enheter eller kunne kobles til Internett.<p><A name=enable_acc_control></A><p><b>Slik aktiverer du tilgangskontroll:</b><p>Velg avmerkingsboksen <b>Slå på tilgangskontroll</b>. Ved å velge denne avmerkingsboksen kan du gi datamaskiner eller elektroniske enheter tilgang til nettverket eller blokkere dem. Du må velge denne avmerkingsboksen før du kan spesifisere en tilgangsregel og bruke knappene Tillat og Blokker. Når denne avmerkingsboksen er fjernet, kan alle enheter kobles til, selv om enheten er på listen over blokkerte enheter.<p><A name=access_rule></A><p>Radioknapper for <b>tilgangsregel</b>. Velg radioknappen for den tilgangsregelen du ønsker for nye enheter som prøver å koble til nettverket. Tilgangsregelen påvirker ikke tidligere blokkerte eller tillatte enheter. Det gjelder bare for fremtidige enheter som kobles til nettverket etter at du velger disse innstillingene.<p>Som standard velger du Tillat at alle nye enheter kan kobles til, slik at en ny enhet som du eller familien kjøper, får tilgang til nettverket uten å konfigurere MAC-adressen på denne siden.<p>NETGEAR anbefaler at du velger dette alternativet. Hvis du bytter til Blokker alle nye enheter fra å koble til, vil ikke den nye enheten få tilgang til nettverket før du legger til enhetens MAC-adresse på listen over tillatte enheter. Hvis en ny datamaskin for eksempel både har trådløs nettverkstilkobling og Ethernet-nettverkstilkobling, har hver tilkobling sin egen MAC-adresse, noe som betyr at du må legge til begge MAC-adressene i listen over tillatte enheter.<p>Knappene <b>Tillat</b> og <b>Blokker</b>. Hvis du vil gi tilgang til eller blokkere spesifikke enheter, velger du denne avmerkingsboksen og klikker på knappen Tillat ellet Blokker for å endre statusen.<p>Klikk på <b>Bruk</b> når du er ferdig med å endre innstillingene.<p>Klikk på <b>Avbryt</b> for å gå tilbake til de forrige innstillingene.",
