"genie_200" : "<b>Trinn 2: </b>Hvis den eksisterende ruteren har trådløse tilkoblingsmuligheter, kan du slå den av eller deaktivere den for å unngå forstyrrelser med denne nye AP-enheten. Eller kjøre den på en annen trådløs kanal.",
