"genie_249" : "NETGEAR-ruteren er koblet til et nettverk som allerede har en annen ruter. Hvis du vil ha den første ruteren tilkoblet, anbefaler genie at du bruker tilgangspunktmodusen for NETGEAR-ruteren. Når NETGEAR-ruteren er i tilgangspunktmodus, kan du bruke den til å koble til nettverket, slik at den andre ruteren fortsetter å utføre de samme nettverksoppgavene som tidligere.",
