"genie_271" : "VLAN-ID",
"genie_272" : "<P><font size=4><B>VLAN/IPTV-hjelp</B></font></P><p>Enkelte Internett-leverandører (ISPs) krever rutere for å sende eller motta virtuelle LAN-pakker for Internett-tilkobling. Dette kravet er vanlig for fibertilgang.</p><p>Noen IPTV-er fungerer ikke bak brannmuren til en trådløs ruters nettverksadresseoverføring (NAT). Du kan opprette et nettverk ved å lage en bro mellom IPTV-porten og Internett-porten uten NAT.</p><p name=vlan id=vlan></p><p><b>VLAN-oppsett</b><p><ol><li> Velg avmerkingsboksen Aktiver VLAN-nøkkelord.</li><li>Klikk på knappen Rediger.</li><li>Endre innstillingene for VLAN-ID og Prioritet og portene som tilhører gruppen.</li>Denne informasjonen er tilgjengelig fra Internett-leverandøren.<br>   <li>Klikk på knappen Legg til.</li></ol><p>VLAN-gruppen er lagt til.</p>Gi gruppen et navn som er enkelt å huske.</p><p name=iptv id=iptv></p><p><b>IPTV-oppsett</b><p><ol><li>1. Tøm avmerkingsboksen Aktiver VLAN-nøkkelord.</li><li>Klikk på knappen Legg til.</li></ol><p>De relaterte portene sammekobles med en bro. Pakker mellom porter koblet sammen av en bro, blir ikke behandlet via NAT eller brannmur.</p></p>",
