"genie_934" : "<P><font size=4><B>Hjelp for profilinnstillinger</B></font></P><p>Profilen kan foreta raske ruterkonfigurasjoner i forskjellige miljøer. Her kan du også administrere, velge eller slette profiler.</p><p><ol><li> Valgt profil: </li> Vis profilen som brukes. </p><p> <li> Bruk alltid den valgte profilen: </li> <p>For å bruke den brukerdefinerte profilen og deaktivere systemets automatiske oppdagingsmekanisme. Når avkrysningsboksen er krysset av, vil ikke ruteren gjøre automatisk oppdaging mellom profiler for brukere, selv etter at ruteren starter på nytt.</p><li> Profilliste: </li> Vis alle eksisterende profiler. <li> Slett profil: </li> Slett den valgte profilen.</ol> </p>",
