"genie_1017" : "<p>ReadyCLOUD-funksjonen gir deg ekstern tilgang via Internett til en USB-lagringsenhet som er koblet til ruterens USB-port.</p><p><b>Slik konfigurerer du ReadyCLOUD</b><br>Trinn 1: Du trenger en ReadyCLOUD-konto. Hvis du ikke har en, <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com/client/index.html#page=manage&quot;>klikker du her</a> for å opprette en konto og velger &quot;Opprett konto&quot;.<br> Trinn 2: Gå til rutergrensesnittet på ReadySHARE-siden <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://routerlogin.net&quot;>http://routerlogin.net</a>, velg alternativet ReadyCLOUD, og skriv inn brukernavnet og passordet ditt for ReadyCLOUD for å registrere ruteren din på ReadyCLOUD.<br>Trinn 3: Logg på <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>http://readycloud.netgear.com</a> igjen med ReadyCLOUD-kontoen din. USB-enheten som er koblet til ruteren, vises.<br><b>Merk:</b>Du kan bruke et supplerende eksternt program til å opprette en sikker kobling fra datamaskinen eller den mobile enheten til ruterens USB-enhet.<br>Når du logger på dette eksterne programmet, kan du få tilgang til USB-enheten hvor som helst. <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>Klikk her</a> for å få det eksterne programmet.</p>",
