"D-genie_79" : "Veiviseren kan eksportere trådløsinnstillingene til en ekstern USB-stasjon. Du kan sette den i en USB-port på en annen Windows-PC. Kjør deretter programmet <b>genieWirelessConfig.exe</b> på USB-stasjonen for å oppdatere PC-ens trådløsinnstillinger slik at den kan koble til det trådløse nettverket.",
