"D-genie_117" : "Hvordan kan jeg koble en ny datamaskin eller trådløs enhet til det trådløse nettverket",
"D-genie_118" : "For å koble til nettverket kan du velge det og angi passordet, eller hvis datamaskinen har støtte for WiFi Protected Setup (WPS), kan du bruke en WPS-knapp eller PIN-kode for å koble til nettverket.<br><br><B>Koble til et nettverk uten å bruke WPS: </B>Hvordan du gjør dette, avhenger av hva slags datamaskin du har. På en Windows-PC kan du for eksempel åpne den trådløse nettverkstilkoblingen, velge nettverket og angi nettverkspassordet. Hvis du bruker en trådløs NETGEAR-adapter, kan du bruke Smart Wizard for å koble til. <br><br><B>Bruke WPS for å koble til et nettverk:</B> Trykk på WPS-knappen på ruteren. Deretter, i løpet av to minutter, trykker du på WPS-knappen på datamaskinen eller den trådløse enheten. Datamaskinen eller den trådløse enheten kobles til nettverket. <br><br>Hvis du har endret navnet og passordet på det trådløse nettverket og du ikke husker dem, kan du logge på ruteren fra en datamaskin som allerede er koblet til nettverket for å se disse innstillingene.  Brukernavnet for ruteren er <b>admin<b>. Standardpassordet er <b>password<b>.  <br><br>Hvis du har en forhåndsinnstilt ruter, ble den levert med et unikt navn og passord for det trådløse nettverket. Begge disse finner du på merkelappen på ruteren. <br><br>For å logge på ruteren går du til <a href = &apos;http://routerlogin.net&apos;>http://routerlogin.net</a>, velger Wireless Settings (Trådløsinnstillinger) og henter navnet på det trådløse nettverket (SSID) og sikkerhetsinformasjonen.<br><br></B>",
"D-genie_119" : "Hva gjør jeg når det ikke er noen tilkobling til ruteren eller til Internett",
"D-genie_120" : "Prøv først denne sekvensen for å løse et problem med nettverkstilkoblingen:<br><br>1. Slå av modemet, og ta ut strømkontakten<br>2. Slå av ruteren<br>   3. Sett i strømkontakten til modemet, og slå det på. Vent i to minutter<br>4. Slå på ruteren, og vent i ett minutt",
"D-genie_121" : "Jeg kan koble til ruteren, men ikke til Internett",
"D-genie_122" : "Hvis du kan koble til ruteren, men ikke Internett, logger du på ruteren og kontrollerer at innstillingene til Internett-leverandøren (ISP) er korrekte. Disse innstillingene finner du på siden Basic Settings (Grunnleggende innstillinger) på <a href = &apos;http://routerlogin.net&apos;>http://routerlogin.net</a>. De riktige innstillingene avhenger av bredbåndstjenesten din. Vanlig for DSL: Du angir DSL-brukernavnet (som xxx@att.net) og DSL-passordet.<br><br>Hvis du er usikker på hvilke innstillinger du skal bruke, tar du kontakt med Internett-leverandøren din.<br><br>Hvis du har Internett via en kabeltjeneste, må du sørge for at kabelmodemet er slått av og deretter på under ruterkonfigurasjonen. Hvis ruteren fremdeles ikke får en Internett-forbindelse fra modemet, kan det være fordi modemet husker den forrige enhetens MAC-adresse (for eksempel MAC-adressen fra datamaskinen du brukte for å få tilgang til Internett før du fikk en ruter). Du kan angi enhetens MAC på siden Basic Settings (Grunnleggende innstillinger) på <a href = &apos;http://routerlogin.net&apos;>http://routerlogin.net</a>.",
"D-genie_123" : "Hva er passordet jeg bruker for å logge på ruteren?",
"D-genie_124" : "Ruterens brukernavn er <B>admin</B>.<br><br>Standardpassordet er <B>password</B>.<br><br>Prøv standardpassordet før du gjenoppretter fabrikkinnstillingene.<br><br>Hvis NETGEAR-ruteren støtter<b> Gjenoppretting av passord</b>, aktiveres det når du endrer ruterpassordet. <br><br>Hvis du gjenoppretter fabrikkinnstillingene, mister du all informasjon om konfigureringen på ruteren, og du vil måtte konfigurere den på nytt! Ruteren vil for eksempel ikke huske innstillingene for Internett-tilkobling eller andre egendefinerte innstillinger som du har angitt<br><br>Derfor bør du ha ISP-informasjonen klar før du gjenoppretter fabrikkinnstillingene.",
"D-genie_125" : "Hva slags trådløs sikkerhet bør jeg bruke for nettverket?",
"D-genie_126" : "For å sikre det trådløse nettverket anbefaler NETGEAR trådløs sikkerhet for WPA2 eller WPA (WEP er en eldre standard og anbefales ikke). Trådløs sikkerhet bidrar til å beskytte nettverket ditt mot hackere og uautoriserte brukere.<br><br>Hvis du har en forhåndsinnstilt ruter, har den et unikt navn for det trådløse nettverket, og den er også konfigurert med trådløs sikkerhet for WPA/WPA2 og et unikt passord.  Andre som kjøper samme rutermodell, vil ha forskjellige navn på trådløse nettverk og forskjellige passord for sine nettverk. <br><br>For NETGEAR-rutere kan du konfigurere WPA2 eller WPA med NETGEAR genie eller Smart Wizard, eller du kan logge på ruteren på <a href = &apos;http://routerlogin.net&apos;>http://routerlogin.net</a> og gå til siden Wireless Settings (Trådløsinnstillinger). Etter at du har konfigurert trådløs sikkerhet på ruteren, må alle som prøver å koble seg til trådløst, angi nettverkspassordet eller -nøkkelen som du valgte. Hvis ikke kan de ikke koble seg til.",
"D-genie_127" : "Feilsøking i trådløse nettverk",
"D-genie_128" : "Alle trådløse enheter på det trådløse nettverket må ha de samme innstillingene:<br><br><B>SSID</B>: Navnet til det trådløse nettverket skiller mellom store og små bokstaver. (Netgear er forskjellig fra NETGEAR). Hvis du har en forhåndsinnstilt ruter, har den et unikt navn på det trådløse nettverket, som du kan finne på merkelappen. Standard SSID for andre NETGEAR trådløse rutere er NETGEAR.<br><br><B>Kanal</B>: De trådløse kanalene er 1 til 11 i Nord-Amerika (1 til 13 i andre land).<br><br><B>Modus</B>: Trådløs modus bør settes til infrastrukturmodus for klienter (datamaskiner) for å kunne koble til en trådløs ruter.<br><br><B>Kryptering</B>: Disse alternativene for kryptering finnes:<br><B>.</B>Ingen sikkerhet<br><B>.</B>Bruk WEP<br><B>.</B>Bruk WPA-PSK<br><B>.</B>Bruk WPA2-PSK<br><br><B>Trådløs radio</B>: Denne bør være PÅ (ruterens trådløslampe bør lyse.)<br><br><B>Tilgangskontrolliste (ACL)</B>: Hvis du aktiverer en ACL på ruteren, kontrollerer du at MAC-adressen for hver trådløse adapter er inkludert i listen.",
"D-genie_129" : "En PC er ikke koblet til Internett, men andre PC-er koblet til",
"D-genie_130" : "Kontroller at PC-en er konfigurert til automatisk å motta en IP-adresse og automatisk motta DNS-serveradresse for IP-adressen. Du kan høyreklikke på nettverkstilkoblingen og velge <B>Egenskaper</B> og deretter <B>Egenskaper for TCP/IP</B> for å kontrollere eller endre innstillingene.<br><br>Du bør kunne pinge www.routerlogin.net etter at den er angitt som automatisk IP-adresse.<br><br>Hvis du endrer disse innstillingene for en PC, kan det hende at du må starte den på nytt for å aktivere den for tilgang til nettverket.",
