"D-genie_167" : "Ansvarsfraskrivelse",
"D-genie_168" : "NETGEAR genie tilbyr to hastighetstester. Én måler hvor raskt PC-en kan laste ned webområdeinnhold, og det andre tredjepartsområdet måler bredbåndshastigheten til Internett-leverandøren din. Med den første testen kan resultatene variere ut fra nettverksforholdene på det tidspunktet testen blir utført. I tillegg kan resultatene fra testen for nedlastingshastighet variere ut fra svarterskelen til webområdet. Ingen av disse tilfellene blir kontrollert av hastighetstestene, så vær oppmerksom på at testresultatene bare er overslag som bare kan brukes til informasjon.",
