"D-genie_309" : "&quot;Jeg har kjøpt en NETGEAR 11n trådløs ruter. Hvorfor finner jeg ikke støtte for WEP trådløs sikkerhet i ruterkonfigurasjonen GUI?",
"D-genie_310" : "WEP er støttet. Men WiFi Alliance gjør at en trådløs ruter ikke kan kjøre sikkerhetsmodusen WEP når den trådløse hastigheten er satt til 11n-modus. For å kunne se WEP-alternativet må du angi ruterens modus til &quot;Up to 54Mbps&quot; (Opptil 54 Mbps) (Legacy 802.11a/b/g-hastighet). Deretter blir WEP-alternativet tilgjengelig. <br>WEP er mindre sikkert og tregere enn WPA. Derfor anbefales ikke WEP-modusen av NETGEAR. ",
