"D-genie_329" : "Nettverksenhet",
"D-genie_330" : ".Trådløsinnstillinger\n.ReadySHARE\n.Gjestetilgang\n.Trafikkmåler\n.Ruteroppdatering",
"D-genie_331" : "Den trådløse radioen kan være avslått. Slå den på, og klikk deretter på Try again (Prøv igjen).",
"D-genie_332" : "NETGEAR genie gir deg to muligheter til å teste hastigheten. Den ene metoden måler hvor raskt PC-en kan laste ned innhold fra webområder, og den andre metoden gir deg en kobling til det tredjeparts webområdet www.speedtest.net, som måler bredbåndshastigheten fra Internett-leverandøren din.  I den første testen kan resultatene variere ut fra nettverksforholdene på det tidspunktet testene blir utført.  I tillegg kan resultatene fra den første testen variere basert på responsen til webområdet som du laster ned innhold fra. Ingen av disse tilfellene blir kontrollert av den første hastighetstesten, så vær oppmerksom på at testresultatene er overslag som bare kan brukes til å få informasjon.  Gå til www.speedtest.net for å lese eventuelle diskusjoner på dette webområdet om faktorer som påvirker målingene av bredbåndshastigheter fra Internett-leverandøren.",
