"D-genie_356" : "Skriverdeling for Windows-PC-er og Mac-datamaskiner med en USB-skriver",
"D-genie_357" : "Trinn 1: Koble USB-skriveren til ruterens USB-port med en USB-skriverkabel.",
"D-genie_358" : "Trinn 2: Installer driverprogramvaren for USB-skriveren på hver datamaskin som skal dele denne skriveren.",
"D-genie_359" : "Hvis du ikke har driveren, kan du ta kontakt med selskapet som laget skriveren for å finne og laste ned den nyeste driverprogramvaren til skriveren.",
"D-genie_360" : "Trinn 3: På hver datamaskin som skal dele skriveren, kan du laste ned verktøyet NETGEAR USB Control Center fra <a href=&apos;http://www.netgear.com/readyshare&apos;>http://www.netgear.com/readyshare</a>. ",
"D-genie_361" : "Følg instruksjonene i verktøyet for å koble til skriveren fra datamaskinen og skrive ut.",
"D-genie_362" : "ReadySHARE-utskrift",
"D-genie_363" : "Ruteren min sluttet å fungere, og strømlampen blinker sakte. Hva skal jeg gjøre?",
"D-genie_364" : "Hvis ruterens strømlampe blinker sakte, betyr det at noe er feil med ruterens fastvare. Du kan bruke følgende prosedyre for å gjenopprette ruteren. Hvis denne prosedyren ikke fungerer, og garantien fremdeles er gjeldende for ruteren, kan du ta kontakt med NETGEARs kundestøtte.<br><br>Trinn 1: Ved hjelp av en annen Internett-forbindelse (som på jobben eller i et Wi-Fi-hotspot) kan du laste ned ruterens nyeste fastvare fra <a href=&apos;http://www.netgear.com&apos;>http://www.netgear.com</a>.<br><br>Trinn 2: Bruk en Ethernet-kabel for å koble datamaskinen til én av de fire LAN-portene på ruteren. Konfigurer datamaskinen med en statisk IP-adresse på 192.168.1.2 og en nettverksmaske på 255.255.255.0.<br><br><B>.</B>&nbsp;&nbsp;<b>Windows</b>: Velg <b>Kontrollpanel &gt; Nettverkstilkoblinger</b>. Høyreklikk på <b>Lokal tilkobling</b>, og velg <b>Egenskaper</b>. Deretter uthever du <b>Internet Protocol (TCP/IPv4)</b> og klikker på <b>Egenskaper</b>. På IP-konfigurasjonssiden velger du avmerkingsboksen <b>Bruk følgende IP-adresse</b> og angir <b>192.168.1.2</b> som IP-adresse og <b>255.255.255.0</b> som nettverksmaske. Deretter klikker du på <b>OK</b>.<br><B>.</B>&nbsp;&nbsp;<b>Linux eller Mac</b>: Bruk instruksjonene for Linux eller Mac for å konfigurere datamaskinen med denne statiske IP-adressen.<br><br>Trinn 3: Hvis du bruker en Windows-PC, åpner du et kommandovindu. For Linux eller Mac bruker du en TFTP-klient.<br><br><B>.</B>&nbsp;&nbsp;<b>Windows 7</b>: Klikk på <b>Start</b>-knappen. I søkeboksen skriver du inn <b>cmd</b> og trykker på <b>Enter</b>.<br><B>.</B>&nbsp;&nbsp;<b>Windows XP</b>: Velg <b>Start &gt; Kjør</b>, og skriv inn <b>cmd</b> og trykk <b>Enter</b>.<br><br>Bruk cd-kommandoen for å gå til katalogen (mappe) med fastvaren du lastet ned under Trinn 1. Kjør kommandoen <b>tftp -i 192.168.1.1 put firmware_filename</b>.<br><br><B>.</B>&nbsp;&nbsp;<b>Linux eller Mac</b>: Last ned og kjør en TFTP-klient som er tilgjengelig for operativsystemet ditt.<br><br>Trinn 4: Vent i noen få minutter på at ruteren lagrer den nye fastvaren og starter på nytt igjen. Strømlampen blir grønn etter en vellykket gjenoppretting.<br><br>Trinn 5: Angi datamaskinens IP-adresse tilbake til dynamisk IP ved hjelp av en prosedyre lignende Trinn 2 ved å velge avmerkingsboksen <b>Hent en IP-adresse automatisk</b>.",
