"D-genie_564" : "<p><font size=4><b>Hjelp for enhetsnavn</b></font></p><p name=mode></p><p><b>Enhetsnavn:</b> Enhetsnavnet identifiserer denne ruteren. Mange ruterfunksjoner gir dette navnet til tilkoblede klientenheter for å identifisere og vise dem. Hvis du endrer enhetsnavnet, blir alle de følgende feltene nedenfor oppdatert. Du får også muligheten til å endre tilgangsbanen for ReadySHARE-lagringen til det nye enhetsnavnet.</p><p><b>Rutergrensesnittets feltnavn som viser enhetsnavnet</b><br>Følgende liste viser feltnavnene i brukergrensesnittet som viser enhetsnavnet og sidene de befinner seg på:<ul><li>Side for Internett-konfigurering: Kontonavn</li><li>Side for LAN-konfigurering: Enhetsnavn</li><li>Side for medieserver: Navn på medieserver</li><li>Ruter-/AP-/Utvidermodus> Side for AP-modus: Enhetsnavn</li><li>Ruter-/AP-/Utvidermodus> Side for utvidermodus: Enhetsnavn</li></ul></p><p><b>Klienter som viser enhetsnavnet</b><br>Enhetsnavnet vises i følgende klienter:<ul><li>iTunes Server</li><li>Time Machine Server</li><li>ReadySHARE Printer eller Bonjour Print Server</li><li>LLTD</li><li>UPNP</li><li>WPS-enhet</li></ul></p>",
