"Circle_027" : "Deaktivert",
"Analytics_001" : "Aktiver innhenting av <a href=&quot;#&quot; onclick=&quot;window.open(&apos;http://www.routerlogin.net/ra_data_detail.htm&apos;,&apos;name&apos;,&apos;width=600,height=400,scrollbars=1,resizable=1&apos;,&apos;blank&apos;)&quot; style=&quot;color: rgb(000,000,255);text-decoration:underline&quot;> <font size=&quot;&quot;>analytiske data for rutere</font></a> for å hjelpe NETGEAR å forbedre produktene og tjenestene sine.",
"Analytics_002" : "Aktiver ruteren til automatisk å oppdatere til fremtidige fastvareversjoner. Dette holder ruteren oppdatert med de nyeste funksjonene og sikkerhetsoppdateringene.",
"Analytics_003" : "For å fullføre installeringen må du godta tjenestevilkårene.<br>Hvis du ikke godtar disse tjenestevilkårene, må du returnere NETGEAR-enheten.",
"Analytics_004" : "Jeg godtar",
"Analytics_005" : "Jeg godtar ikke",
"Analytics_006" : "Personvernerklæring",
"Analytics_007" : "For å fullføre installeringen må du velge ett av følgende alternativer.",
"Analytics_008" : "Automatisk fastvareoppdatering av ruter",
"Analytics_009" : "Innhenting av analyseinformasjon fra ruteren ",
"Analytics_010" : "Tjenestevilkår",
"Analytics_011" : "Velg ett av følgende alternativer:",
"Analytics_012" : "Foreta valg for begge funksjonene ovenfor for å fortsette.",
"Analytics_013" : "Tekniske data om funksjonene og bruken av ruterne våre og de tilhørende WiFi-nettverkene kan hjelpe oss med å isolere og feilsøke tekniske problemer raskt, forbedre ruterens funksjoner og funksjonalitet og forbedre ytelsen og brukervennligheten til ruterne.   Dataene kan inkludere informasjon om ruterens driftsstatus, antall enheter som er koblet til ruteren, typer tilkoblinger, LAN/WAN-status, WiFi-bånd og -kanaler, IP-adresser, MAC-adresser, serienummer og lignende tekniske data om funksjonene og bruken av ruteren og WiFi-nettverket.",
"Analytics_014" : "Ved å velge Jeg godtar samtykker du til at ruteren kan overføre dataene beskrevet ovenfor, til NETGEAR ved installasjon, og at NETGEAR kan bruke informasjonen til å forbedre produktene og tjenestene sine. Hvis du vil ha mer informasjon om beskyttelse av overført informasjon og hvordan den kan brukes, kan du se NETGEARs personvernerklæring.  NETGEAR bruker ikke denne informasjonen til å markedsføre produkter eller tjenester til deg, spore eller innhente nettstedene du besøker, eller innhente innhold fra trafikken på nettverket ditt.  Du kan trekke tilbake samtykket når som helst ved å gå til routerlogin.net Avansert > Administrasjon > Ruteroppdatering.",
"Analytics_015" : "Noe grunnleggende informasjon kan likevel innhentes, for eksempel ruterens fastvareversjonnummer og modellnummer, og brukes til å overvåke utplasseringen av NETGEAR-produkter og -fastvareversjoner.   Vi kommer ikke til å knytte denne informasjonen til ruterens serienummer eller MAC-adresse, navnet ditt eller annen personlig informasjon.",
"Analytics_016" : "13.03.2017 versjon 1.0 ",
"Analytics_017" : "<b>NETGEARs tjenestevilkår</b>",
"Analytics_018" : "Les NETGEARs vilkår for automatisk fastvareoppdatering (&quot;<b>Fastvarevilkår</b>&quot;) nøye. Din bruk av NETGEAR-enheten og de inkluderte tjenestene (som definert nedenfor) indikerer at du har lest og godtatt disse fastvarevilkårene og utgjør ditt samtykke til denne avtalen.",
"Analytics_019" : "Disse fastvarevilkårene er mellom deg (&quot;<b>Du&quot;</b> eller &quot;<b>Brukeren&quot;</b>) og NETGEAR, Inc. og handler om bruken av (inkludert tilgangen til) tjenester som tilbys av NETGEAR, Inc., dets datterselskaper og tilknyttede selskaper (samlet kalt &quot;<b>NETGEAR&quot;</b>) i forbindelse med NETGEAR-enheten din og programvare (inkludert programvare på enheten ved kjøp), fastvare, dokumentasjon og annen informasjon og materiell på eller i forbindelse med slike tjenester (individuelt og samlet kalt &quot;<b>Tjenester&quot;</b>). ",
"Analytics_020" : "<b>1. AKSEPT AV FASTVAREVILKÅRENE</b>",
"Analytics_021" : "1.1 Ved å bruke tjenestene bekrefter du at du er myndig og kan godta disse fastvarevilkårene. Du kan ikke bruke tjenestene hvis du er en (a) person som ikke er myndig eller som på grunn av andre forhold ikke er berettiget til å inngå en bindende kontrakt med NETGEAR, eller (b) person som er utestengt fra å motta tjenestene ifølge lovene i noe land, inkludert i det landet du er bosatt i eller der du bruker tjenestene.",
"Analytics_022" : "1.2 Hvis du er en person som har tilgang til eller bruker tjenestene på vegne av et selskap, partnerskap eller annen virksomhet som du er knyttet til (en <b>&quot;Organisasjon&quot;</b>), samtykker du til disse fastvarevilkårene på vegne av deg selv og organisasjonen, og du garanterer at du har myndighet til å binde organisasjonen til disse fastvarevilkårene. Referansene til &quot;<b>du</b>&quot; og &quot;<b>din</b>&quot; i disse fastvarevilkårene refererer både til personen og eventuelle organisasjoner som bruker tjenestene.",
"Analytics_023" : "<b>2. PROGRAMVARE OG PROGRAMVAREOPPDATERINGER FOR TJENESTENE OG ENHETEN</b>",
"Analytics_024" : "2.1 Programvareoppdateringer. NETGEAR-enheten kan (i) kommunisere med NETGEAR-servere fra tid til annen for automatisk å søke etter tilgjengelige oppdateringer som feilsøkinger, viktige systemoppdateringer, feilrettinger, forbedrede funksjoner, oppgraderinger, manglende plugin-moduler og nye versjoner (samlet kalt <b>Programvareoppdateringer</b>) og (ii) installere programvareoppdateringer. Slike programvareoppdateringer kan være i ulike former og utføres vanligvis for å forbedre ytelsen, sikkerheten eller påliteligheten til NETGEAR-enheten eller tjenestene. Ved å bruke tjenestene godtar du å motta alle programvareoppdateringene NETGEAR sender til programvaren til tjenestene og NETGEAR-enheten. Hvis du deaktiverer den automatiske tjenesteoppgraderingen, kan enkelte funksjoner forbundet med tjenestene og/eller NETGEAR-enheten, påvirkes på en negativ måte. Selv om du deaktiverer funksjonen for automatisk oppgradering av tjenestene, kan NETGEAR likevel implementere oppdateringer for visse programmer som kjøres på NETGEARs servertjenester.",
"Analytics_025" : "2.2 Programvare med åpen kildekode. Enkelte komponenter i programvaren til NETGEAR-enheten og/eller tjenestene og programvareoppdateringene er underlagt GNUs General Public License (<b>GPL</b>) eller andre såkalte lisenser for åpen kildekode (<b>Programvare med åpen kildekode</b>). Programvare med åpen kildekode kan ikke underlegges bestemte restriksjoner. Du har muligheten til å bruke, endre og distribuere programvare med åpen kildekode som er underlagt en lisensmodell med GPL eller annen kostnadsfri eller åpen kildekode-basert programvare i programvarens dokumentasjon. Dette kan du gjøre så lenge du overholder GPL-vilkårene (tilgjengelig på www.gnu.org/copyleft/gpl.html) eller lisensvilkårene til annen kostnadsfri eller åpen kildekode-basert programvare. Disse fastvarevilkårene begrenser ikke rettighetene dine i henhold til lisensvilkårene for eventuell aktuell programvare med åpen kildekode og gir deg heller ikke rettigheter som erstatter disse.",
