"PCVP_042" : "<body bgcolor=#0099cc ><P><font size=4><B> Hjelp for Viderekobling av port / portutløsing (Port Forwarding / Port Triggering) </B></font></P><p>Portutløsing er en avansert funksjon som kan brukes for spill og andre Internett-programmer. Viderekobling av port kan vanligvis brukes for å aktivere tilsvarende funksjonalitet, men den er statisk og har enkelte begrensninger. </p><p>Portutløsing åpner en innkommende port midlertidig og krever for eksempel ikke at serveren på Internett skal spore IP-adressen din hvis den endres av DHCP. </p><p>Portutløsing overvåker utgående trafikk. Når ruteren registrerer trafikk på den angitte utgående porten, husker den IP-adressen til datamaskinen som sendte dataene, og &apos;utløser&apos; den innkommende porten. Den innkommende trafikken på den utløste porten viderekobles deretter til utløserdatamaskinen.</p><p><a name=select></a>Du kan bruke skjermbildet Viderekobling av port / portutløsing (Port Forwarding / Port Triggering) til å gjøre lokale datamaskiner eller servere tilgjengelige for ulike Internett-tjenester (for eksempel FTP eller HTTP), spille Internett-spill (som Quake III), eller bruke Internett-programmer (som CU-SeeMe).</p><p>Viderekobling av port er utformet for FTP, webserver eller andre serverbaserte tjenester. Når viderekobling av port er konfigurert, viderekobles forespørsler fra Internett til den riktige serveren. </p><p>Portutløsing tillater bare forespørsler fra Internett etter at en angitt port er utløst. Portutløsing brukes for chat og Internett-spill.</p><hr><p><a name=pt_enable></a><b>Portutløsing</b></p><p>Merk: Hvis det merkes av for <b>Deaktiver portutløsing</b>, deaktiveres <b>alle</b> funksjonene for portutløsing, men konfigurasjonsinformasjonen blir liggende i ruteren.</p><p><a name=pt_timeout></a><b>Tidsavbrudd for portutløsing</b></p><p>Angi en verdi på opptil 9999 minutter. Verdien for Tidsavbrudd for portutløsing kontrollerer tidsmåleren for inaktivitet for den eller de angitte portene. Den eller de angitte portene lukkes når tidsmåleren for inaktivitet utløper.</p><p><b> For Internett-spill eller -programmer </b></p><p>Før du starter, må du vite hvilken tjeneste, hvilket program eller hvilket spill som skal konfigureres. Du trenger også adressen til den utgående porten (utløserporten) for dette spillet eller programmet.</p><p>Slik konfigurerer du datamaskinen slik at det blir mulig å spille Internett-spill eller bruke Internett-programmer: <ol> <li> Klikk på knappen <b>Legg til tjeneste</b>. </li> <li> Skriv inn et tjenestenavn i boksen <b>Tjenestenavn</b>.  </li> <li> Hvis du velger <b>Alle</b> (standard) under <b>Bruker av tjeneste</b>, kan denne tjenesten brukes av alle i nettverket. Hvis ikke velger du <b>Én adresse</b> og angir IP-adressen til PC-en for å begrense tjenesten til en bestemt PC. </li> <li> Velg <b>Tjenestetype</b>. </li> <li> Angi nummeret til den utgående porten i boksen <b>Utløserport</b>. </li> <li> Angi informasjonen for den innkommende tilkoblingsporten, for eksempel <b>Tilkoblingstype</b>, <b>Startport</b> og <b>Sluttport</b>. Du finner denne informasjonen i brukerhåndboken for spillet eller programmet, eller på webområdet for produktstøtte.  </li> <li> Klikk på knappen <b>Bruk</b>.  </li></ol><p>Slik endrer du en tjenesteoppføring:<ol> <li>Klikk på alternativknappen for oppføringen i tabellen. </li> <li> Klikk på <b>Rediger tjeneste</b>. </li> <li> Endre tjenesten.</li> <li> Klikk på knappen <b> Bruk</b>.</li></ol><p>Slik sletter du en tjenesteoppføring:<ol> <li> Velg alternativknappen for oppføringen i tabellen. </li> <li> Klikk på knappen <b> Slett tjeneste</b>. </li></ol></body>",
