"PCVP_089": "Denne modusen konfigurerer den nye NETGEAR-ruteren som en vanlig WiFi-ruter, som kan enten kobles direkte til en Internett-tilkobling fra Internett-leverandøren eller kobles til bak gatewayen for å opprette et separat nettverk. Begge tilkoblingene er vist nedenfor.",
