"PCVP_091": "Hvis du vil bruke den nye ruteren for å få bedre WiFi-ytelse utover hva du har med den eksisterende gatewayen, anbefaler vi at du konfigurerer ruteren i tilgangspunktmodus. Hvis den eksisterende gatewayen har en WiFi-funksjon, anbefaler vi at du deaktiverer WiFi-funksjonen på den eksisterende gatewayen. Med denne modusen kan du koble kablede enheter til den eksisterende gatewayen og koble kablede enheter og WiFi-enheter til den nye ruteren.  I tilgangspunktmodusen blir IP-adressen til den nye ruteren som standard tilordnet dynamisk av gatewayen. Du kan imidlertid fortsatt gå til <a class='linktype' target='_blank' href='http://www.routerlogin.net'>http://www.routerlogin.net</a> for å få tilgang til ruterens nettgrensesnitt fra en enhet som er koblet til ruteren. Enkelte ruterfunksjoner er ikke tilgjengelige i tilgangspunktmodusen, og du må bruke rutermodus hvis du vil bruke disse funksjonene.",
"PCVP_092": "Konfigurere trådløsinnstillinger for bromodus",
"PCVP_093": "For raskest mulig oppsett kan du laste ned Nighthawk-appen fra",
"PCVP_094": "Gå til Nighthawk-App.com, og last ned Nighthawk-appen på mobiltelefonen eller tablet-enheten ved hjelp av en mobil datatilkobling for å fullføre WiFi-nettverksoppsettet.",
"PCVP_095": "Hvis du ikke har en kompatibel mobiltelefon eller et nettbrett, klikker du her >",
"PCVP_096": "La oss sette opp ruteren.",
"PCVP_097": "Sørg for at ruteren er tilkoblet Internett med en Ethernet-kabel for å fortsette.",
"PCVP_098": "Velkommen",
"PCVP_099": "Konfigurasjon fullført",
"PCVP_100": "Dine nye WiFi-legitimasjonsbeskrivelser vises nedenfor.",
"WSM001": "Administrasjon av nettjenester",
