"WSM003": "Bruk alltid HTTPS for å få tilgang til ruteren",
"PCVP_101": "Avanserte innstillinger for trådløs tilkobling",
"PCVP_102": "Internett registrert",
"PCVP_103": "Du er bare noen få trinn fra å fullføre installasjonen.",
"PCVP_104": "Problemet mitt er ikke løst",
"PCVP_105": "<p><font size=4><b>Hjelp for Bridge-modus</b></font></p><p><b>Bridge-modus:</b> Sett denne ruteren i Bridge-modus, og bruk 802.11ac WiFi-tilkoblingen til å koble den til den eksisterende ruteren eller gatewayen. I denne modusen kan du dra nytte av gigabit-WiFi-hastighet på gjeldende enheter og unngå behovet for separate WiFi-adaptere for hver enhet. Enkelte ruterfunksjoner er ikke tilgjengelige i bromodus.</p><p><b>Ruterfunksjoner</b></p><p>Følgende ruterfunksjoner er ikke tilgjengelige hvis du velger tilgangspunkt eller Bridge-modus:</p><ul><li>gjestenettverk</li><li>Foreldrekontroller</li><li>QoS</li><li>tilgangskontroll</li><li>trafikkmåler</li><li>blokkering av nettsteder</li><li>blokkering av nettsteder</li><li>blokkering av tjenester</li><li>statisk rute</li></ul><p><b>Hent IP-adresse dynamisk</b></p><p>Fjern avmerkingen for <b>Hent IP-adresse dynamisk</b> hvis du ønsker å legge inn IP-adresse, nettverksmaske og gateway-IP-adresser manuelt.</p><p><b>Hent DNS-serveradresse dynamisk</b></p><p>Fjern avmerkingen for <b>Hent DNS-adresse dynamisk</b> hvis du ønsker å legge inn IP-adressen til DNS-serveren manuelt.</p>",
"PCVP_106": "<font size=4><b>NTP</b></font></p><P>For å sikre at tiden som NETGEAR-produktet bruker, er nøyaktig, bruker du Network Time Protocol (NTP) til å synkronisere ditt NETGEAR-produkt med UTC (Coordinated Universal Time). </P><P><B>Gjeldende klokkeslett</B></P><P>Etter at du har angitt tidssone, justeres det nåværende klokkeslettet tilsvarende. </P><P><B>Bruk standard NETGEAR NTP-server</B></P><P>NTP-servere over hele verden som brukes av NETGEAR. Etter at du har angitt tidssonen, velger NETGEAR en NTP-server i nærheten til å synkronisere klokkeslettet på NETGEAR-produktet. </P><P><B>Angi foretrukket NTP-server</B></P><P>Slik endrer du NTP-serveren til din foretrukne NTP-server: </P><ol><li>Velg alternativknappen <B>Konfigurer din foretrukne NTP-server</B>. </li><li>Angi den foretrukne NTP-serveren i feltet <B>NTP-server</B>. </li></ol><P>Merk: NTP-serveren som du angir, må ha format som en IP-adresse eller et domenenavn. </P><a name=timezone></a><p><b>Tidssone</b><p>Velg din lokale tidssone. Dette er nødvendig for at tidsplanen skal fungere riktig.</p><p>Hvis du bor i et område som justerer for sommertid, merker du <b>av for Juster automatisk for sommertid</b> .",
