"RAX5_QOS_4" : "<p><font size=4><b>Hjelp for Hastighetstest</b></font></p><p>Hastighetstest forbedrer spill- og streamingkvaliteten på Internett ved å prioritere bruken av Internett-båndbredde. Når ruteren oppdager trafikk fra spilling og streaming på Internett, prøver den å begrense bakgrunnstrafikken, som BitTorrent- eller FTP-nedlastinger, for å forbedre spillingen og streamingen. </p><a name=enable_qos></a><p><b>Aktiver Hastighetstest:</b> Aktiver eller deaktiver Hastighetstest. </p><a name=ookla_detect></a><p><b>Internett-båndbredde – La Speedtest finne Internett-båndbredden (anbefalt):</b> Nøyaktig Internett-båndbredde er nødvendig for at Hastighetstest skal fungere skikkelig. Ruteren kjører automatisk Speedtest første gang du aktiverer Hastighetstest. Klikk på knappen <b>Speedtest</b> for å kontrollere båndbredden igjen. Unngå Internett-aktivitet mens Speedtest kjører. </p><a name=manual_define></a><p><b>Internett-båndbredde – jeg vil angi Internett-båndbredden:</b> Hvis du vet hva Internett-båndbredden er, kan du angi den manuelt her. Maksimumsverdien er 1000,00. </p>",
"AQSH09" : "<p><font size=4><b>Hjelp for QoS</b></font></p><p>QoS forbedrer spill- og streamingkvaliteten på Internett ved å prioritere bruken av Internett-båndbredde. Når ruteren oppdager trafikk fra spilling og streaming på Internett, prøver den å begrense bakgrunnstrafikken, som BitTorrent- eller FTP-nedlastinger, for å forbedre spillingen og streamingen. </p><a name=enable_qos></a><p><b>Aktiver QoS:</b> Aktiver eller deaktiver QoS. </p><a name=ookla_detect></a><p><b>Internett-båndbredde – La Speedtest finne Internett-båndbredden (anbefalt):</b> Nøyaktig Internett-båndbredde er nødvendig for at QoS skal fungere skikkelig. Ruteren kjører automatisk Speedtest første gang du aktiverer QoS. Klikk på knappen <b>Speedtest</b> for å kontrollere båndbredden igjen. Unngå Internett-aktivitet mens Speedtest kjører. </p><a name=manual_define></a><p><b>Internett-båndbredde – jeg vil angi Internett-båndbredden:</b> Hvis du vet hva Internett-båndbredden er, kan du angi den manuelt her. Maksimumsverdien er 1000,00. </p>",
